DROP TABLE IF EXISTS actors;
DROP TABLE IF EXISTS directors;
DROP TABLE IF EXISTS persons;
DROP TABLE IF EXISTS movies;
DROP TABLE IF EXISTS languages;

CREATE TABLE persons (
    id integer NOT NULL,
    name character varying
);
CREATE TABLE actors (
    person_id integer,
    movie_id integer
);
CREATE TABLE directors (
    movie_id integer NOT NULL,
    director_id integer NOT NULL
);
CREATE TABLE languages (
    id integer NOT NULL,
    lang_key character varying,
    name character varying
);
CREATE TABLE movies (
    id integer NOT NULL,
    title character varying,
    release_date date,
    budget bigint,
    runtime integer,
    original_language integer,
    overview character varying
);









ALTER TABLE ONLY persons
    ADD CONSTRAINT person_pk PRIMARY KEY (id);

ALTER TABLE ONLY movies
    ADD CONSTRAINT movies_pk PRIMARY KEY (id);

ALTER TABLE ONLY directors
    ADD CONSTRAINT directors_pk PRIMARY KEY (movie_id, director_id);
	
ALTER TABLE ONLY languages
    ADD CONSTRAINT languages_pk PRIMARY KEY (id);
	
ALTER TABLE ONLY actors
    ADD CONSTRAINT movies_fk FOREIGN KEY (movie_id) REFERENCES movies(id) NOT VALID;

ALTER TABLE ONLY actors
    ADD CONSTRAINT persons_fk FOREIGN KEY (person_id) REFERENCES persons(id) NOT VALID;

ALTER TABLE ONLY directors
    ADD CONSTRAINT movies_fk FOREIGN KEY (movie_id) REFERENCES movies(id) NOT VALID;

ALTER TABLE ONLY directors
    ADD CONSTRAINT persons_fk FOREIGN KEY (director_id) REFERENCES persons(id) NOT VALID;

ALTER TABLE ONLY movies
    ADD CONSTRAINT languages_fk FOREIGN KEY (original_language) REFERENCES languages(id) NOT VALID;

