INSERT INTO movies VALUES (173, '20,000 Leagues Under the Sea', '1954-12-23', 5000000, 127, 0, 'A ship sent to investigate a wave of mysterious sinkings encounters the advanced submarine, the Nautilus, commanded by Captain Nemo.');
INSERT INTO movies VALUES (220, 'East of Eden', '1955-03-09', 1, 115, 0, 'In the Salinas Valley, in and around World War I, Cal Trask feels he must compete against overwhelming odds with his brother Aron for the love of their father Adam. Cal is frustrated at every turn, from his reaction to the war, to how to get ahead in business and in life, to how to relate to estranged mother.');
INSERT INTO movies VALUES (221, 'Rebel Without a Cause', '1955-10-27', 1500000, 111, 0, 'After moving to a new town, troublemaking teen Jim Stark is supposed to have a clean slate, although being the new kid in town brings its own problems. While searching for some stability, Stark forms a bond with a disturbed classmate, Plato, and falls for local girl Judy. However, Judy is the girlfriend of neighborhood tough, Buzz. When Buzz violently confronts Jim and challenges him to a drag race, the new kid''s real troubles begin.');
INSERT INTO movies VALUES (288, 'High Noon', '1952-03-27', 730000, 85, 0, 'High Noon is about a recently freed leader of a gang of bandits in the desert who is looking to get revenge on the Sheriff who put him in jail. A legendary western film from the Austrian director Fred Zinnemann.');
INSERT INTO movies VALUES (381, 'To Catch a Thief', '1955-08-03', 2500000, 106, 0, 'A delightful Hitchcock film about an ex-burglar who must catch a thief who’s been copying this style before he gets accused of the wrong crimes. His time is running out as the police are close behind him yet he finds time for a little romance of course. A classic masterpiece starring Grace Kelly and Cary Grant.');
INSERT INTO movies VALUES (457, 'Sissi', '1955-12-22', NULL, 102, 3, 'The young Bavarian princess Elisabeth, who all call Sissi, goes with her mother and older sister Néné to Austria where Néné will be wed to an emperor named Franz Joseph, Yet unexpectedly Franz runs into Sissi while out fishing and they fall in love.');
INSERT INTO movies VALUES (488, 'The African Queen', '1951-12-03', 1300000, 105, 0, 'At the start of the first World War, in the middle of Africa’s nowhere, a gin soaked riverboat captain is persuaded by a strong-willed missionary to go down river and face-off a German warship.');
INSERT INTO movies VALUES (521, 'Dial M for Murder', '1954-05-29', 1400000, 104, 0, 'An ex-tennis pro carries out a plot to have his wife murdered after discovering she is having an affair, and assumes she will soon leave him for the other man anyway. When things go wrong, he improvises a new plan - to frame her for murder instead.');
INSERT INTO movies VALUES (541, 'The Man with the Golden Arm', '1955-12-14', NULL, 119, 0, 'Frankie is a heroin addict and sits in prison. He wants a different life but the rehabilitation isn’t as easy as he had thought. Director Otto Preminger films one of the first social studies of an addict in this 1955 film.');
INSERT INTO movies VALUES (567, 'Rear Window', '1954-08-01', 1000000, 112, 0, 'Professional photographer L.B. "Jeff" Jeffries breaks his leg while getting an action shot at an auto race. Confined to his New York apartment, he spends his time looking out of the rear window observing the neighbors. He begins to suspect that a man across the courtyard may have murdered his wife. Jeff enlists the help of his high society fashion-consultant girlfriend Lisa Freemont and his visiting nurse Stella to investigate.');
INSERT INTO movies VALUES (599, 'Sunset Boulevard', '1950-08-10', 1752000, 110, 0, 'A hack screenwriter writes a screenplay for a former silent-film star who has faded into Hollywood obscurity.');
INSERT INTO movies VALUES (632, 'Stalag 17', '1953-05-29', 1661530, 120, 0, 'It''s a dreary Christmas 1944 for the American POWs in Stalag 17. For the men in Barracks 4, all sergeants, have to deal with a grave problem - there seems to be a security leak. The Germans always seem to be forewarned about escapes and in the most recent attempt the two men, Manfredi and Johnson, walked straight into a trap and were killed. For some in Barracks 4, especially the loud-mouthed Duke, the leaker is obvious: J.J. Sefton, a wheeler-dealer who doesn''t hesitate to trade with the guards and who has acquired goods and privileges that no other prisoner seems to have. Sefton denies giving the Germans any information and makes it quite clear that he has no intention of ever trying to escape. He plans to ride out the war in what little comfort he can arrange, but it doesn''t extend to spying for the Germans.');
INSERT INTO movies VALUES (654, 'On the Waterfront', '1954-06-22', 910000, 108, 0, 'Terry Malloy dreams about being a prize fighter, while tending his pigeons and running errands at the docks for Johnny Friendly, the corrupt boss of the dockers union. Terry witnesses a murder by two of Johnny''s thugs, and later meets the dead man''s sister and feels responsible for his death. She introduces him to Father Barry, who tries to force him to provide information for the courts that will smash the dock racketeers.');
INSERT INTO movies VALUES (702, 'A Streetcar Named Desire', '1951-09-18', 1800000, 125, 0, 'Disturbed Blanche DuBois moves in with her sister in New Orleans and is tormented by her brutish brother-in-law while her reality crumbles around her.');
INSERT INTO movies VALUES (705, 'All About Eve', '1950-11-09', 1400000, 138, 0, 'From the moment she glimpses her idol at the stage door, Eve Harrington is determined to take the reins of power away from the great actress Margo Channing. Eve maneuvers her way into Margo''s Broadway role, becomes a sensation and even causes turmoil in the lives of Margo''s director boyfriend, her playwright and his wife. Only the cynical drama critic sees through Eve, admiring her audacity and perfect pattern of deceit.');
INSERT INTO movies VALUES (759, 'Gentlemen Prefer Blondes', '1953-07-14', NULL, 91, 0, 'Lorelei Lee is a beautiful showgirl engaged to be married to the wealthy Gus Esmond, much to the disapproval of Gus'' rich father, Esmond Sr., who thinks that Lorelei is just after his money. When Lorelei goes on a cruise accompanied only by her best friend, Dorothy Shaw, Esmond Sr. hires Ernie Malone, a private detective, to follow her and report any questionable behavior that would disqualify her from the marriage.');
INSERT INTO movies VALUES (800, 'Los Olvidados', '1950-11-09', NULL, 85, 2, 'A group of juvenile delinquents live a violent and crime-filled life in the festering slums of Mexico City, and the morals of young Pedro are gradually corrupted and destroyed by the others.');
INSERT INTO movies VALUES (804, 'Roman Holiday', '1953-09-02', 1500000, 119, 0, 'Overwhelmed by her suffocating schedule, touring European princess Ann takes off for a night while in Rome. When a sedative she took from her doctor kicks in, however, she falls asleep on a park bench and is found by an American reporter, Joe Bradley, who takes her back to his apartment for safety. At work the next morning, Joe finds out Ann''s regal identity and bets his editor he can get exclusive interview with her, but romance soon gets in the way.');
INSERT INTO movies VALUES (828, 'The Day the Earth Stood Still', '1951-09-17', 1200000, 92, 0, 'An alien and a robot land on earth after World War II and tell mankind to be peaceful or face destruction. A classic science fiction film from Robert Wise with an exceptional message.');
INSERT INTO movies VALUES (831, 'This Island Earth', '1955-06-01', 800000, 87, 0, 'Aliens have landed and are hiding on Earth, but need Earth’s scientists to help them fight an inter-planetary war.');
INSERT INTO movies VALUES (845, 'Strangers on a Train', '1951-06-18', 1200000, 101, 0, 'A psychotic socialite confronts a pro tennis star with a theory on how two complete strangers can get away with murder...a theory that he plans to implement.');
INSERT INTO movies VALUES (872, 'Singin'' in the Rain', '1952-04-10', 2540800, 103, 0, 'In 1927 Hollywood, Don Lockwood and Lina Lamont are a famous on-screen romantic pair in silent movies, but Lina mistakes the on-screen romance for real love. When their latest film is transformed into a musical, Don has the perfect voice for the songs, but strident voice faces the studio to dub her voice. Aspiring actress, Kathy Selden is brought in and, while she is working on the movie, Don falls in love with her.');
INSERT INTO movies VALUES (1810, 'Viva Zapata!', '1952-02-07', NULL, 113, 0, 'The story of Mexican revolutionary Emiliano Zapata, who led a rebellion against the corrupt, oppressive dictatorship of president Porfirio Diaz in the early 20th century.');
INSERT INTO movies VALUES (1882, 'The Men', '1950-07-20', NULL, 85, 0, 'Fred Zinnemann''s sensitive film on the plight of paraplegic WWII veterans features Marlon Brando in his superbly moving screen debut. He plays Lt. Bud Wilozek, one of a group of veterans recovering in the paraplegic ward of a hospital in his hometown. His former fiancée, Ellen (Teresa Wright), explains to his physician, Dr. Brock (Everett Sloane), her concern about his isolation and apparent depression since he has broken their engagment and refuses to see her. He counsels her to be patient, but when he decides to broach the issue with Bud, the embittered patient reacts angrily to the doctor''s intrusiveness, and continues to refuse to see Ellen. The doctor cajoles the withdrawn paraplegic into the life of the ward, where fellow patients begin to pull Bud out of his spiritual miasma. At length, his sense of hope starts to return, and after seeing Ellen for the first time in months, he begins to contemplate the possibility of marriage.');
INSERT INTO movies VALUES (1936, 'River of No Return', '1954-04-30', NULL, 91, 0, 'The itinerant farmer and his young son help a heart-of-gold saloon singer search for her estranged husband');
INSERT INTO movies VALUES (1938, 'Angel Face', '1952-12-10', NULL, 92, 0, 'An ambulance driver gets involved with a rich girl that might have a darker side.');
INSERT INTO movies VALUES (1978, 'Stage Fright', '1950-02-23', NULL, 110, 0, 'A struggling actress tries to help a friend prove his innocence when he''s accused of murdering the husband of a high society entertainer.');
INSERT INTO movies VALUES (2438, 'The Country Girl', '1954-05-17', NULL, 104, 0, 'The 1954 musical film based on the play by the same name. Actress Grace Kelly won an Academy Award for Best Actress. The film tells the story of an ex-theater actor who is given one more chance to star in a musical yet his alcoholism may prevent it from happening.');
INSERT INTO movies VALUES (2769, 'An American in Paris', '1951-08-08', 2723903, 113, 0, 'Jerry Mulligan is an exuberant American expatriate in Paris trying to make a reputation as a painter. His friend Adam is a struggling concert pianist who''s a long time associate of a famous French singer, Henri Baurel. A lonely society woman, Milo Roberts, takes Jerry under her wing and supports him, but is interested in more than his art.');
INSERT INTO movies VALUES (3014, 'The Man Between', '1953-11-18', NULL, 100, 0, '"The Man Between" is a 1953 British thriller film directed by Carol Reed and starring James Mason, Claire Bloom, Hildegard Knef and Geoffrey Toone. A British woman on a visit to post-war Berlin is caught up in an espionage ring smuggling secrets into and out of the Eastern Bloc.');
INSERT INTO movies VALUES (3023, 'Abbott and Costello Meet Dr. Jekyll and Mr. Hyde', '1953-08-01', NULL, 76, 0, 'Abbott &amp; Costello are two bumbling (naturally) American cops, on exchange in London, hunting for Mr. Hyde, the monster that has been terrorizing the city.');
INSERT INTO movies VALUES (3109, 'The Quiet Man', '1952-07-21', NULL, 129, 0, 'Sean Thornton has returned from America to reclaim his homestead and escape his past. Sean''s eye is caught by Mary Kate Danaher, the beautiful spinster and younger sister of ill-tempered "Red" Will Danaher. The riotous relationship that forms between Sean and Mary Kate, punctuated by Will''s pugnacious attempts to keep them apart, form the plot, with Sean''s past as the dark undercurrent.');
INSERT INTO movies VALUES (3110, 'Shane', '1953-04-23', 3100000, 118, 0, 'A weary gunfighter attempts to settle down with a homestead family, but a smouldering settler and rancher conflict forces him to act.');
INSERT INTO movies VALUES (3111, 'A Star Is Born', '1954-09-29', 5019770, 181, 0, 'A movie star helps a young singer/actress find fame, even as age and alcoholism send his own career into a downward spiral.');
INSERT INTO movies VALUES (3112, 'The Night of the Hunter', '1955-04-03', 795000, 93, 0, 'In the Deep South, a serial-killing preacher hunts two young children who know the whereabouts of a stash of money.');
INSERT INTO movies VALUES (4459, 'Night Without Sleep', '1952-09-26', NULL, 77, 0, 'Awaking one morning out of a drunken stupor, composer Richard Morton can''t shake the feeling he has murdered a woman during the night.');
INSERT INTO movies VALUES (4460, 'The Snows of Kilimanjaro', '1952-08-18', NULL, 117, 0, 'Writer Harry Street reflects on his life as he lies dying from an infection while on safari in the shadow of Mount Kilimanjaro.');
INSERT INTO movies VALUES (4461, 'Decision Before Dawn', '1951-12-21', NULL, 119, 0, 'WWII is entering its last phase: Germany is in ruins, but does not yield. The US army lacks crucial knowledge about the German units operating on the opposite side of the Rhine, and decides to send two German prisoners to gather information. The scheme is risky: the Gestapo retains a terribly efficient network to identify and capture spies and deserters. Moreover, it is not clear that "Tiger", who does not mind any dirty work as long as the price is right, and war-weary "Happy", who might be easily betrayed by his feelings, are dependable agents. After Tiger and another American agent are successfully infiltrated, Happy is parachuted in Bavaria. His duty: find out the whereabouts of a powerful German armored unit moving towards the western front.');
INSERT INTO movies VALUES (4462, 'Diplomatic Courier', '1952-06-13', NULL, 97, 0, 'A U.S. agent uses a State Department courier as a spy after Soviets kill his Salzburg contact.');
INSERT INTO movies VALUES (4809, 'Good Morning Miss Dove', '1955-11-23', NULL, 107, 0, 'Beloved schoolteacher reflects back on her life and former students when she is hospitalized...');
INSERT INTO movies VALUES (4822, 'Kismet', '1955-10-08', NULL, 103, 0, 'Like a tale spun by Schehrazade, Kismet follows the remarkable and repeated changes of fortune that engulf a poor poet. It all happens in one incredible day when Kismet (Fate) takes a hand.');
INSERT INTO movies VALUES (4825, 'Guys and Dolls', '1955-11-03', 5500000, 150, 0, 'In New York, a gambler is challenged to take a cold female missionary to Havana, but they fall for each other, and the bet has a hidden motive to finance a crap game.');
INSERT INTO movies VALUES (4938, 'The Last Frontier', '1955-12-07', NULL, 98, 0, 'Three trappers become scouts for a cavalry captain (Guy Madison) who loses his fort to a hated colonel (Robert Preston).');
INSERT INTO movies VALUES (5506, 'The Ladykillers', '1955-12-08', NULL, 91, 0, 'A gang of five diverse oddball criminal types rent a two room apartment in an isolated house on a London cul-de-sac from an octogenarian widow with three pet parrots. The group''s mastermind, Professor Marcus, tells her a cover story that they are members of an amateur string quintet and would like to use the rooms to hone their musical skills. In reality, they''re plotting to rob a bank and plan to use Mrs. Wilberforce''s naiveté and her Victorian sensibilities to their advantage.');
INSERT INTO movies VALUES (5996, 'We''re No Angels', '1955-01-01', NULL, 106, 0, 'Three convicts escape from prison on Devil''s Island just before Christmas and arrive at a nearby French colonial town. They go to the store of the Ducotels, the only store that gives supplies on credit. They initially intend to take advantage of them but have a change of heart after they find the family is in financial troubles.');
INSERT INTO movies VALUES (6529, 'Hondo', '1953-11-25', NULL, 83, 0, 'Army despatch rider Hondo Lane discovers a woman and her son living in the midst of warring Apaches, and he becomes their protector.');
INSERT INTO movies VALUES (6620, 'Sabrina', '1954-09-28', 2238813, 113, 0, 'Linus and David Larrabee are the two sons of a very wealthy family. Linus is all work -- busily running the family corporate empire, he has no time for a wife and family. David is all play -- technically he is employed by the family business, but never shows up for work, spends all his time entertaining, and has been married and divorced three times. Meanwhile, Sabrina Fairchild is the young, shy, and awkward daughter of the household chauffeur, who has been infatuated with David all her life, but David hardly notices her -- "doesn''t even know I exist" -- until she goes away to Paris for two years, and returns an elegant, sophisticated, beautiful woman. Suddenly, she finds that she has captured David''s attention, but just as she does so, she finds herself falling in love with Linus, and she finds that Linus is also falling in love with her.');
INSERT INTO movies VALUES (6646, 'Treasure Island', '1950-07-18', NULL, 96, 0, 'Enchanted by the idea of locating treasure buried by Captain Flint, Squire Trelawney, Dr. Livesey and Jim Hawkins charter a sailing voyage to a Caribbean island. Unfortunately, a large number of Flint''s old pirate crew are aboard the ship, including Long John Silver.');
INSERT INTO movies VALUES (7983, 'Tiefland', '1954-02-11', 8500000, 98, 3, 'Set in the early part of 20th century Europe. There lived a dancer who becomes the romantic bone of contention between a humble shepherd and an imperious marquis.');
INSERT INTO movies VALUES (8974, 'The War of the Worlds', '1953-08-13', 2000000, 85, 0, 'The residents of a small town are excited when a flaming meteor lands in the hills, but their joy is short-lived when they discover it has passengers who are not very friendly.');
INSERT INTO movies VALUES (9077, 'Tarantula', '1955-12-14', NULL, 80, 0, 'A spider escapes from an isolated desert laboratory experimenting in giantism and grows to tremendous size as it wreaks havoc on the local inhabitants.');
INSERT INTO movies VALUES (10056, 'Killer''s Kiss', '1955-09-21', 75000, 67, 0, 'The film revolves around Davey Gordon (Jamie Smith), a 29 year old welterweight New York boxer in the end of his career, and his relationship with a dancer and her violent employer.');
INSERT INTO movies VALUES (10165, 'Fear and Desire', '1953-04-01', 53000, 62, 0, 'A ficticious war in an unidentified country provides the setting for this drama. Four soldiers survive the crash-landing of their plane to find themselves in a forest six miles behind enemy lines. The group, led by Lt. Corby, has a plan: They''ll make their way to a nearby river, build a raft, and then, under cover of night, float back to friendly territory. Their plans for getting back safely are sidetracked by a young woman who stumbles across them as they hide in the woods, and by the nearby presence of an enemy general who one member of the group is determined to kill.');
INSERT INTO movies VALUES (10178, 'The Caine Mutiny', '1954-06-24', 2000000, 124, 0, 'When a US Naval captain shows signs of mental instability that jeopardizes the ship, the first officer relieves him of command and faces court martial for mutiny.');
INSERT INTO movies VALUES (10297, 'How to Marry a Millionaire', '1953-10-29', NULL, 95, 0, 'Three women set out to find eligible millionaires to marry, but find true love in the process.');
INSERT INTO movies VALUES (10340, 'Lady and the Tramp', '1955-06-16', NULL, 76, 0, 'Lady, a golden cocker spaniel, meets up with a mongrel dog who calls himself the Tramp. He is obviously from the wrong side of town, but happenings at Lady''s home make her decide to travel with him for a while.');
INSERT INTO movies VALUES (10653, 'The Seven Year Itch', '1955-06-01', 1800000, 105, 0, 'With his family away for their annual summer holiday, Richard Sherman decides he has the opportunity to live a bachelor''s life. The beautiful but ditzy blonde from the apartment above catches his eye and they soon start spending time together - maybe a little too much time!');
INSERT INTO movies VALUES (10693, 'Peter Pan', '1953-02-05', 4000000, 77, 0, 'Leaving the safety of their nursery behind, Wendy, Michael and John follow Peter Pan to a magical world where childhood lasts forever. But while in Neverland, the kids must face Captain Hook and foil his attempts to get rid of Peter for good.');
INSERT INTO movies VALUES (10785, 'The Thing from Another World', '1951-04-29', NULL, 87, 0, 'Scientists and American Air Force officials fend off a blood-thirsty alien organism while at a remote arctic outpost.');
INSERT INTO movies VALUES (10910, 'Moulin Rouge', '1952-12-23', 1500000, 119, 0, 'Fictional account of French artist Henri de Toulouse-Lautrec.');
INSERT INTO movies VALUES (10973, 'Creature from the Black Lagoon', '1954-03-05', NULL, 79, 0, 'A scientific expedition searching for fossils along the Amazon River discover a prehistoric Gill-Man in the legendary Black Lagoon. The explorers capture the mysterious creature, but it breaks free. The Gill-Man returns to kidnap the lovely Kay, fiancée of one of the expedition, with whom it has fallen in love.');
INSERT INTO movies VALUES (11071, 'Them!', '1954-06-16', 23000000, 94, 0, 'Nuclear tests in the desert result in the growth of gigantic mutant ants who menace cities in the American south-west as a team of investigators and the army search for a way to control their spread in this Cold War-era monster film.');
INSERT INTO movies VALUES (11219, 'The Trouble with Harry', '1955-10-03', 1200000, 99, 0, 'Trouble erupts in a small, quiet New England town when a man''s body is found in the woods. The problem is that almost everyone in town thinks that they had something to do with his death.');
INSERT INTO movies VALUES (11224, 'Cinderella', '1950-03-04', 2900000, 74, 0, 'Cinderella has faith her dreams of a better life will come true. With help from her loyal mice friends and a wave of her Fairy Godmother''s wand, Cinderella''s rags are magically turned into a glorious gown and off she goes to the Royal Ball. But when the clock strikes midnight, the spell is broken, leaving a single glass slipper... the only key to the ultimate fairy-tale ending!');
INSERT INTO movies VALUES (11383, 'The Living Desert', '1953-11-10', NULL, 69, 0, 'The Living Desert was the first feature-length film in Disney’s True-Life Adventures series of documentaries focusing on zoological studies; the previous films in the series, including the Academy Award-winning Seal Island, were short subjects.  The documentary was filmed at the Westward Look Wyndham Grand Resort and Spa in Tucson, Arizona. Most of the wildlife shown in the film was donated to what would soon become the Arizona-Sonora Desert Museum.  The film was inspired by 10 minutes of footage shot by N. Paul Kenworthy Jr., a doctoral student at the University of California at Los Angeles. Kenworthy’s footage of a battle between a tarantula and a wasp intrigued Disney, who funded a feature-length production following the lives of diverse desert species. Disney was highly supportive of Kenworthy’s work and its impact on nonfiction filmmaking, stating, “This is where we can tell a real, sustained story for the first time in these nature pictures.”');
INSERT INTO movies VALUES (11402, 'The Belles of St. Trinian''s', '1954-09-28', NULL, 91, 0, 'Story of manic schoolgirls who are more interested in racing form than books as they try to get-rich-quick, aided by the head-mistress'' brother, played by Alastair Sim, who also plays the head-mistress.');
INSERT INTO movies VALUES (11426, 'From Here to Eternity', '1953-08-28', 1650000, 118, 0, 'In 1941 Hawaii, a private is cruelly punished for not boxing on his unit''s team, while his captain''s wife and second in command are falling in love.');
INSERT INTO movies VALUES (28775, 'The Neanderthal Man', '1953-06-19', NULL, 78, 0, 'A scientist develops a formula which will cause animals to regress to the form of their primitive ancestors, and tries it on himself with disastrous results.');
INSERT INTO movies VALUES (11570, 'The Crimson Pirate', '1952-09-27', 1850000, 105, 0, 'Burt Lancaster plays a pirate with a taste for intrigue and acrobatics who involves himself in the goings on of a revolution in the Caribbean in the late 1700s. A light hearted adventure involving prison breaks, an oddball Scientist, sailing ships, naval fights, and tons of swordplay.');
INSERT INTO movies VALUES (11617, 'Rio Grande', '1950-11-15', NULL, 105, 0, 'Lt. Col. Kirby Yorke is posted on the Texas frontier to defend settlers against depredations of marauding Apaches. Col. Yorke is under considerable stress by a serious shortage of troops of his command. Tension is added when Yorke''s son (whom he hasn''t seen in fifteen years), Trooper Jeff Yorke, is one of 18 recruits sent to the regiment.');
INSERT INTO movies VALUES (11620, 'Quo Vadis', '1951-11-08', 8250000, 171, 0, 'Set against the back drop of Rome in crisis, General Marcus Vinicius returns to the city from the battle fields and falls in love with a Christian woman, Lygia. Caught in the grip of insanity, Nero''s atrocities become more extreme and he burns Rome, laying the blame on the Christians. Vinicius races to save Lygia from the wrath of Nero as the empire of Rome collapses around them.');
INSERT INTO movies VALUES (11700, 'Sommarnattens leende', '1955-12-26', NULL, 108, 25, 'Sommarnattens leende (Smiles of a Summer Night) is a 1955 Swedish comedy film directed by Ingmar Bergman. The film''s plot – which involves switching partners on a summer''s night – has been adapted many times, most notably the theatrical musical A Little Night Music by Stephen Sondheim, Hugh Wheeler and Harold Prince, which opened on Broadway in 1973, and in Woody Allen''s film A Midsummer Night''s Sex Comedy (1982).');
INSERT INTO movies VALUES (11787, 'Harvey', '1950-10-13', NULL, 104, 0, 'The classic stage hit gets the Hollywood treatment in the story of Elwood P. Dowd who makes friends with a spirit taking the form of a human-sized rabbit named Harvey that only he sees (and a few privileged others on occasion also.) After his sister tries to commit him to a mental institution, a comedy of errors ensues. Elwood and Harvey become the catalysts for a family mending its wounds and for romance blossoming in unexpected places.');
INSERT INTO movies VALUES (11839, 'The Court Jester', '1955-12-24', 4000000, 101, 0, 'A 12th century court jester in England becomes involved with a desperate band of outlaws who are attempting to overthrow the king.');
INSERT INTO movies VALUES (11848, 'Animal Farm', '1954-12-29', NULL, 72, 0, 'A successful farmyard revolution by the resident animals vs. the farmer goes horribly wrong when corrupt pigs hijack it for their personal gain.');
INSERT INTO movies VALUES (12092, 'Alice in Wonderland', '1951-07-03', 3000000, 75, 0, 'On a golden afternoon, young Alice follows a White Rabbit, who disappears down a nearby rabbit hole. Quickly following him, she tumbles into the burrow - and enters the merry, topsy-turvy world of Wonderland! Memorable songs and whimsical escapades highlight Alice''s journey, which culminates in a madcap encounter with the Queen of Hearts - and her army of playing cards!');
INSERT INTO movies VALUES (12766, 'Vera Cruz', '1954-12-25', NULL, 94, 0, 'After the American Civil War, mercenaries travel to Mexico to fight in their revolution for money. The former soldier and gentleman Benjamin Trane meets the gunman and killer Joe Erin and his men, and together they are hired by the Emperor Maximillian and the Marquis Henri de Labordere to escort the Countess Marie Duvarre to the harbor of Vera Cruz.');
INSERT INTO movies VALUES (12781, 'Das fliegende Klassenzimmer', '1954-09-02', NULL, 92, 3, 'They do not like particularly, the third form of a boarding school and the students of a neighboring school. Both groups think up the craziest tricks, just to obliterate the enemy one. When the high school students one day dare to steal the top issues of the high school and then they do not burn, the first school day gets really out of control ...');
INSERT INTO movies VALUES (13188, 'Scrooge', '1951-10-31', NULL, 86, 0, 'Ebeneezer Scrooge (Alastair Sim) contentedly meanders through his life as a cruel miser until one fateful Christmas Eve when he is visited by three ghosts. The spirits show him how his behavior over the years has made him a lonely, bitter old man, and how his heart has grown colder. Using events from Scrooge''s idealistic past, dreary present and dismal future, the apparitions try their best to melt his steely soul. Tightfisted Ebeneezer Scrooge learns the error of his ways through the intervention of the ghost of his former partner and of the three spirits and, just in time for the holidays, manages to make everyone''s lives a little brighter, his included!');
INSERT INTO movies VALUES (13210, 'The Dam Busters', '1955-05-16', NULL, 124, 0, 'Adapted by R.C. Sherriff from Guy Gibson''s book Enemy Coast Ahead, The Dam Busters is a docudrama following the conception of a new British weapon for smashing the German dams in the Ruhr industrial complex and the execution of the raid by 617 Squadron ''The Dam Busters''');
INSERT INTO movies VALUES (13368, 'White Christmas', '1954-10-13', NULL, 120, 0, 'Two talented song-and-dance men team up after the war to become one of the hottest acts in show business.');
INSERT INTO movies VALUES (13457, 'Magnificent Obsession', '1954-08-07', NULL, 108, 0, 'When churlish, spoiled rich man Bob Merrick foolishly wrecks his speed boat, the rescue team resuscitates him with equipment that''s therefore unavailable to aid a local hero, Dr. Wayne Phillips, who dies as a result. Phillips had helped many people, and when Merrick learns Phillips'' secret, to give selflessly and in secret, he tries it in a ham-handed way.');
INSERT INTO movies VALUES (13936, 'Oklahoma!', '1955-10-10', NULL, 145, 0, 'This joyous celebration of frontier life combines tender romance and violent passion in the Oklahoma Territory of the 1900''s, with a timeless score filled with unforgettable songs. Rodgers and Hammerstein''s hit Broadway musical.');
INSERT INTO movies VALUES (14117, 'Calamity Jane', '1953-11-04', NULL, 101, 0, 'Doris Day and Howard Keel fuss, feud and fall in love as Calamity Jane and Wild Bill Hickok. At first curvaceous Calamity is too durned busy fighting Indians and cracking a bullwhip to pay mind to such girlie what-alls as dresses and perfume. She soon changes her mind when Katie Brown arrives in town.');
INSERT INTO movies VALUES (14551, 'Winchester ''73', '1950-07-12', NULL, 92, 0, 'Lin McAdam rides into town on the trail of Dutch Henry Brown, only to find himself in a shooting competition against him. McAdam wins the prize, a one-in-a-thousand Winchester rifle, but Dutch steals it and leaves town. McAdam follows, intent on settling his old quarrel, while the rifle keeps changing hands and touching a number of lives.');
INSERT INTO movies VALUES (14554, 'Bad Day at Black Rock', '1955-01-07', 1271000, 81, 0, 'A stranger visits a tiny Western town determined to keep a horrible secret.');
INSERT INTO movies VALUES (14580, 'The Big Heat', '1953-10-14', NULL, 89, 0, 'Dave Bannion is an upright cop on the trail of a vicious gang he suspects holds power over the police force. Bannion is tipped off after a colleague''s suicide and his fellow officers'' suspicious silence lead him to believe that they are on the gangsters'' payroll. When a bomb meant for him kills his wife instead, Bannion becomes a furious force of vengeance and justice, aided along the way by the gangster''s spurned girlfriend Debbie. As Bannion and Debbie fall further and further into the Gangland''s insidious and brutal trap, they must use any means necessary (including murder) to get to the truth.');
INSERT INTO movies VALUES (15919, 'Marty', '1955-04-11', 343000, 90, 0, 'Marty, a butcher who lives in the Bronx with his mother is unmarried at 34. Good-natured but socially awkward he faces constant badgering from family and friends to get married but has reluctantly resigned himself to bachelorhood. Marty meets Clara, an unattractive school teacher, realising their emotional connection, he promises to call but family and friends try to convince him not to.');
INSERT INTO movies VALUES (28894, 'Rancho Notorious', '1952-03-01', NULL, 89, 0, 'A cowboy infiltrates a bandit hideout in search of his girlfriend''s killer.');
INSERT INTO movies VALUES (16089, 'Love Nest', '1951-10-10', NULL, 84, 0, 'Jim and Connie''s postwar New York building troubles keep Jim from working on his novel. Ex-WAC from Jim''s army days Roberta moves in, further upsetting Connie but pleasing Jim''s friend Ed. Tenant Charley, who marries tenant Eadie, loans money to Jim to help him keep the building, money which this Casanova obtains from rich widows.');
INSERT INTO movies VALUES (16380, 'When Worlds Collide', '1951-08-01', NULL, 83, 0, 'When a group of astronomers calculate a star is on a course to slam into Earth, a few days before, it''s accompanying planet will first pass close enough to the Earth to cause havoc on land and sea. They set about building a rocket so a few selected individuals can escape to the planet.');
INSERT INTO movies VALUES (16410, 'Hobson''s Choice', '1954-04-19', NULL, 107, 0, 'Henry Hobson owns and tyrannically runs a successful Victorian boot maker’s shop in Salford, England. A stingy widower with a weakness for overindulging in the local Moonraker Public House, he exploits his three daughters as cheap labour. When he declares that there will be ‘no marriages’ to avoid the expense of marriage settlements at L500 each, his eldest daughter Maggie rebels.');
INSERT INTO movies VALUES (16514, 'To Hell and Back', '1955-09-22', NULL, 106, 0, 'The true WWII story of Audie Murphy, the most decorated soldier in U.S. history. Based on the autobiography of Audie Murphy who stars as himself in the film.');
INSERT INTO movies VALUES (16535, 'Titanic', '1953-04-11', 1805000, 98, 0, 'Unhappily married, Julia Sturges decides to go to America with her two children on the unsinkable Titanic. Her husband, Richard also arranges passage on the luxury liner so as to have custody of their two children. All this fades to insignificance once the ship hits an iceberg.');
INSERT INTO movies VALUES (16563, 'Seven Brides for Seven Brothers', '1954-07-22', NULL, 102, 0, 'Things are different for the Pontipee men now that big brother Adam''s fetched a bride and brought her to their cabin. Indeed, the unwed brothers are so inspired they raid the town and carry off brides of their own!');
INSERT INTO movies VALUES (16618, 'Hans Christian Andersen', '1952-12-19', NULL, 112, 0, 'The inimitable Danny Kaye stars as famed storyteller Hans Christian Andersen in this charming fictionalized biopic that blends music, romance, comedy and fantasy to trace the life of Denmark''s literary hero. A small-town shoemaker with a knack for spinning yarns, Hans encounters happiness and heartbreak on his road to becoming a full-fledged writer.');
INSERT INTO movies VALUES (16912, 'The Colditz Story', '1955-01-25', NULL, 94, 0, 'Allied prisoners attempt to excape from an "escape-proof" German POW camp - Colditz Castle, during WWII. Classic British War drama.');
INSERT INTO movies VALUES (16914, 'The Cruel Sea', '1953-02-24', NULL, 126, 0, 'At the start of World War II, Cmdr. Ericson is assigned to convoy escort HMS Compass Rose with inexperienced officers and men just out of training. The winter seas make life miserable enough, but the men must also harden themselves to rescuing survivors of U-Boat attacks, while seldom able to strike back. Traumatic events afloat and ashore create a warm bond between the skipper and his first officer');
INSERT INTO movies VALUES (16939, 'Last Holiday', '1950-05-15', NULL, 88, 0, 'George Bird is a salesman of agricultural machinery who finds out that he hasn''t long to live. On his doctor''s advice, he goes to an exclusive seaside resort to spend his savings on one last holiday.');
INSERT INTO movies VALUES (16958, 'The Asphalt Jungle', '1950-05-22', NULL, 112, 0, 'Recently paroled from prison, legendary burglar "Doc" Riedenschneider, with funding from Alonzo Emmerich, a crooked lawyer, gathers a small group of veteran criminals together in the Midwest for a big jewel heist.');
INSERT INTO movies VALUES (17057, 'In a Lonely Place', '1950-05-17', NULL, 94, 0, 'Dixon ''Dix'' Steele, a down-on-his-luck screenwriter, needs to adapt a trashy novel. At a nightclub, the hatcheck girl, Mildred Atkinson, is engrossed reading it. Too tired to read the novel, he asks Mildred to go home with him, to explain the plot. Later that night, Mildred is murdered and Steele is a prime suspect. His record of violence when angry goes against him.');
INSERT INTO movies VALUES (17221, 'Where the Sidewalk Ends', '1950-07-07', NULL, 95, 0, 'Tough NYC police detective Dixon misses out on a promotion because of his record of roughing up suspects. When he accidentally kills a suspect in a murder case he plants clues to absolve himself. But when the father of a woman he recently fell in love with is accused of the crime his plan looks like it''s back firing.');
INSERT INTO movies VALUES (17409, 'The Gunfighter', '1950-06-23', NULL, 85, 0, 'Gregory Peck stars as an aging notorious gunslinger, Johnny Ringo. Sick of killing he tries to avoid trouble, but when a cocksure young man named Eddie draws on him, Ringo has no choice but to kill him. Now Eddie''s three brothers are after him. Ringo decides to return East to see his estranged wife and young son before the brothers catch up with him.');
INSERT INTO movies VALUES (17640, 'It''s Always Fair Weather', '1955-02-09', NULL, 102, 0, 'Three World War II buddies promise to meet at a specified place and time 10 years after the war. They keep their word only to discover how far apart they''ve grown. But the reunion sparks memories of youthful dreams that haven''t been fulfilled -- and slowly, the three men reevaluate their lives and try to find a way to renew their friendship.');
INSERT INTO movies VALUES (17729, 'The Glenn Miller Story', '1954-01-08', NULL, 115, 0, 'A vibrant tribute to one of America''s legendary bandleaders, charting Glenn Miller''s rise from obscurity and poverty to fame and wealth in the early 1940s.');
INSERT INTO movies VALUES (17761, 'The High and the Mighty', '1954-07-03', NULL, 147, 0, 'Dan Roman is a veteran pilot haunted by a tragic past. Now relegated to second-in-command cockpit assignments he finds himself on a routine Honolulu-to-San Francisco flight - one that takes a terrifying suspense-building turn when disaster strikes high above the Pacific Ocean at the point of no return.');
INSERT INTO movies VALUES (17820, 'Show Boat', '1951-07-13', 2300000, 107, 0, 'A dashing Mississippi river gambler wins the affections of the daughter of the owner of the Show Boat.');
INSERT INTO movies VALUES (18019, 'Julius Caesar', '1953-06-04', NULL, 120, 0, 'The assassination of the would be ruler of Rome at the hands of Brutus and company has tragic consequences for the idealist and the re');
INSERT INTO movies VALUES (18030, 'Kiss Me Deadly', '1955-05-18', NULL, 106, 0, 'One evening, Hammer gives a ride to Christina, an attractive hitchhiker on a lonely country road, who has escaped from the nearby lunatic asylum. Thugs waylay them and force his car to crash. When Hammer returns to semi-consciousness, he hears Christina being tortured until she dies. Hammer, both for vengeance and in hopes that "something big" is behind it all, decides to pursue the case.');
INSERT INTO movies VALUES (18174, 'An Inspector Calls', '1954-03-16', NULL, 80, 0, 'Based on a famous stage play and set in the year 1912, an upper crust English family dinner is interrupted by a police inspector who brings news that a girl known to everyone present has died in suspicious circumstances. It seems that any or all of them could have had a hand in her death. But who is the mysterious Inspector and what can he want of them?');
INSERT INTO movies VALUES (18264, 'The Man from Laramie', '1955-08-31', NULL, 104, 0, 'Will Lockhart (James Stewart) becomes entangled in the happenings of Coronado, an isolated western town, after delivering supplies there. He is especially involved with the Waggomans, an influential ranching family, and begins his search for someone selling rifles to the local Apaches, only to find out it is the son of the most powerful man in the area. It is at this point that his troubles begin.');
INSERT INTO movies VALUES (18281, 'Side Street', '1950-03-23', NULL, 83, 0, 'A struggling young father-to-be gives in to temptation and impulsively steals an envelope of money from the office of a corrupt attorney. Instead of a few hundred dollars it contains $30,000 and when he decides to return the money things go wrong and that is only the beginning of his troubles.');
INSERT INTO movies VALUES (18283, 'Brigadoon', '1954-09-08', NULL, 108, 0, 'Americans Jeff and Tommy, hunting in Scotland, stumble upon a village - Brigadoon. They soon learn that the town appears once every 100 years in order to preserve its peace and special beauty. The citizens go to bed at night and when they wake up, it''s 100 years later. Tommy falls in love with a beautiful young woman, Fiona, and is torn between staying or going back to his hectic life in New York.');
INSERT INTO movies VALUES (18398, 'Suddenly', '1954-10-07', NULL, 75, 0, 'The tranquility of a small town is marred only by sheriff Tod Shaw''s unsuccessful courtship of widow Ellen Benson, a pacifist who can''t abide guns and those who use them. But violence descends on Ellen''s household willy-nilly when the U.S. President passes through town... and slightly psycho hired assassin John Baron finds the Benson home ideal for an ambush.');
INSERT INTO movies VALUES (18573, 'House of Wax', '1953-04-10', 658000, 90, 0, 'A horribly disfigured sculptor opens up the House of Wax in New York, using the wax-covered bodies of his victims as his displays.');
INSERT INTO movies VALUES (18612, 'The Desperate Hours', '1955-10-05', NULL, 112, 0, 'Escaped convicts terrorize a suburban family they''re holding hostage.');
INSERT INTO movies VALUES (18646, 'Royal Wedding', '1951-01-01', NULL, 93, 0, 'Fred Astaire (Tom) and Jane Powell (Ellen) are asked to perform as a dance team in England at the time of Princess Elizabeth''s wedding. As brother and sister, each develops a British love interest, Ellen with Lord John Brindale (Peter Lawford) and Tom with dancer Anne Ashmond (Sarah Churchill--Winston''s daughter).');
INSERT INTO movies VALUES (18671, 'Gun Crazy', '1950-01-20', NULL, 86, 0, 'Bart Tare is an ex-Army man who has a lifelong fixation with guns, he meets a kindred spirit in sharpshooter Annie Starr and goes to work at a carnival. After upsetting the carnival owner who lusts after Starr, they both get fired. Soon, on Starr''s behest, they embark on a crime spree for cash. Subjects of a manhunt, they are tracked by police in the hills Tare enjoyed as a boy.');
INSERT INTO movies VALUES (18698, 'Jack and the Beanstalk', '1952-01-01', NULL, 70, 0, 'Abbott and Costello''s version of the famous fairy tale, about a young boy who trades the family cow for magic beans.');
INSERT INTO movies VALUES (18721, 'The Far Country', '1955-02-12', NULL, 97, 0, 'In 1896, Jeff Webster sees the start of the Klondike gold rush as a golden opportunity to make a fortune in beef...and woe betide anyone standing in his way! He drives a cattle herd from Wyoming to Seattle, by ship to Skagway, and (after a delay caused by larcenous town boss Gannon) through the mountains to Dawson. There, he and his partner Ben Tatum get into the gold business themselves. Two lovely women fall for misanthropic Jeff, but he believes in every-man-for-himself, turning his back on growing lawlessness...until it finally strikes home.');
INSERT INTO movies VALUES (18995, 'D.O.A.', '1950-04-30', NULL, 83, 0, 'Frank Bigelow, told he''s been poisoned and has only a few days to live, tries to find out who killed him and why.');
INSERT INTO movies VALUES (19119, 'Night and the City', '1950-04-01', NULL, 101, 0, 'A small-time grifter and nightclub tout takes advantage of some fortuitous circumstances and tries to become a big-time player as a wrestling promoter.');
INSERT INTO movies VALUES (19170, 'Mystery Street', '1950-07-28', NULL, 93, 0, 'When the skeletal remains of a pregnant prostitute turn up on a Massachusetts beach the Barnstable cop Peter Morales (Montalban) teams up with Boston police and uses forensics with the help of Dr. McAdoo, a Harvard doctor (Bennett), to figure out who the woman is. The cop then tries to figure out how she died and, later, who killed her.');
INSERT INTO movies VALUES (19171, 'Sudden Fear', '1952-08-01', NULL, 110, 0, 'Actor Lester Blaine has all but landed the lead in Myra Hudson''s new play when Myra vetoes him because, to her, he doesn''t look like a "romantic leading man." On a train from New York to San Francisco, Blaine sets out to prove Myra wrong...by romancing her. Is he sincere, or does he have a dark ulterior motive?');
INSERT INTO movies VALUES (19430, '08/15', '1954-09-30', NULL, 95, 3, 'No overview found.');
INSERT INTO movies VALUES (19483, 'It Came from Outer Space', '1953-05-26', NULL, 81, 0, 'Author &amp; amateur astronomer John Putnam and schoolteacher Ellen Fields witness an enormous meteorite come down near a small town in Arizona, but Putnam becomes a local object of scorn when, after examining the object up close, he announces that it is a spacecraft, and that it is inhabited...');
INSERT INTO movies VALUES (19590, 'By the Light of the Silvery Moon', '1953-03-26', NULL, 101, 0, 'Sequel to On Moonlight Bay. The trials and tribulations of the Winfield family in small town Indiana as Marjorie Winfield''s boyfriend, William Sherman, returns from the Army after W.W.I. Bill &amp; Marjorie''s on-again, off-again provide the backdrop for other family issues, primarily brought on by little brother Wesley''s overactive imagination and tall tales');
INSERT INTO movies VALUES (19618, 'Crime Wave', '1954-01-12', NULL, 73, 0, 'Reformed parolee Steve Lacey is caught in the middle when a wounded former cellmate seeks him out for shelter. The other two former cellmates then attempt to force him into doing a bank job.');
INSERT INTO movies VALUES (19957, 'Knights of the Round Table', '1953-12-22', NULL, 115, 0, 'In Camelot, kingdom of Arthur and Merlin, Lancelot is well known for his courage and honor. But one day he must quit Camelot and the Queen Guinevere''s love, leaving the Round Table without protection.');
INSERT INTO movies VALUES (19997, 'Niagara', '1953-01-26', 1250000, 92, 0, 'Rose Loomis and her older, gloomier husband, George, are vacationing at a cabin in Niagara Falls, N.Y. The couple befriend Polly and Ray Cutler, who are honeymooning in the area. Polly begins to suspect that something is amiss between Rose and George, and her suspicions grow when she sees Rose in the arms of another man. While Ray initially thinks Polly is overreacting, things between George and Rose soon take a shockingly dark turn.');
INSERT INTO movies VALUES (20088, 'Kon-Tiki', '1950-01-12', NULL, 58, 34, '"Kon-Tiki" was the name of a wooden raft used by six Scandinavian scientists, led by Thor Heyerdahl, to make a 101-day journey from South America to the Polynesian Islands. The purpose of the expedition was to prove Heyerdal''s theory that the Polynesian Islands were populated from the east---specifically Peru---rather than from the west (Asia) as had been the theory for hundreds of years. Heyerdahl made a study of the winds and tides in the Pacific, and by simulating conditions as closely as possible to those he theorized the Peruvians encountered, set out on the voyage.');
INSERT INTO movies VALUES (20127, 'It Should Happen to You', '1954-01-18', NULL, 86, 0, 'Gladys Glover has just lost her modeling job when she meets filmmaker Pete Sheppard shooting a documentary in Central Park. For Pete it''s love at first sight, but Gladys has her mind on other things, making a name for herself. Through a fluke of advertising she winds up with her name plastered over 10 billboards throughout city.');
INSERT INTO movies VALUES (20153, 'Where Danger Lives', '1950-07-14', NULL, 82, 0, 'A young doctor falls in love with a disturbed young woman and apparently becomes involved in the death of her husband. They head for Mexico trying to outrun the law.');
INSERT INTO movies VALUES (20174, 'The Fast and the Furious', '1955-02-15', 66000, 73, 0, 'A man wrongly imprisoned for murder breaks out of jail. He wants to clear his name, but with the police pursuing him, he''s forced to take a beautiful young woman, driving a fast sports car, hostage and slip into a cross-border sports car race to try to make it to Mexico before the police get him.');
INSERT INTO movies VALUES (20324, 'The Importance of Being Earnest', '1952-06-02', NULL, 95, 0, 'Jack Worthing and Algernon Moncrieff are two men that are both pretending to be someone they are not.');
INSERT INTO movies VALUES (20424, 'Invaders from Mars', '1953-04-22', NULL, 78, 0, 'In the early hours of the night, young David Maclean sees a flying saucer land and disappear into the sand dunes just beyond his house. Slowly, all of the adults, including his once loving parents, begin to act strangely.');
INSERT INTO movies VALUES (20442, 'The Naked Spur', '1953-02-06', NULL, 91, 0, 'Stewart is a bounty hunter in Colorado territory after killer Robert Ryan. Stewart''s efforts to bring in Ryan and collect the reward are compromised by the presence of Ryan''s loyal girl friend Janet Leigh and Stewart''s two disreputable sidekicks, wily prospector Millard Mitchell and disgraced Union-officer Ralph Meeker.');
INSERT INTO movies VALUES (20758, 'Father of the Bride', '1950-06-16', NULL, 92, 0, 'Proud father Stanley Banks remembers the day his daughter, Kay, got married. Starting when she announces her engagement through to the wedding itself, we learn of all the surprises and disasters along the way.');
INSERT INTO movies VALUES (20853, 'Detective Story', '1951-11-01', NULL, 103, 0, 'Tells the story of one day in the lives of the various people who populate a police detective squad. An embittered cop, Det. Jim McLeod (Douglas), leads a precinct of characters in their grim daily battle with the city''s lowlife. The characters who pass through the precinct over the course of the day include a young petty embezzler, a pair of burglars, and a naive shoplifter.');
INSERT INTO movies VALUES (20942, 'House of Bamboo', '1955-07-01', NULL, 102, 0, 'Eddie Kenner (Robert Stack) is given a special assignment by the Army to get the inside story on Sandy Dawson (Robert Ryan), a former GI who has formed a gang of fellow servicemen and Japanese locals. They use their muscle to take over Tokyo''s pachinko racket and commit a series of train robberies, targeting deliveries of military ammunition.');
INSERT INTO movies VALUES (21296, 'Kansas City Confidential', '1952-11-11', NULL, 99, 0, 'A down-on-his-luck ex-GI finds himself framed for an armored car robbery. When he''s finally released for lack of evidence--after having been beaten up and tortured by the police--he sets out to discover who set him up, and why. The trail leads him into Mexico and a web of hired killers and corrupt cops.');
INSERT INTO movies VALUES (21468, 'There''s No Business Like Show Business', '1954-12-16', NULL, 117, 0, 'Molly and Terry Donahue, plus their three children, are The Five Donahues. Son Tim meets hat-check girl Vicky and the family act begins to fall apart.');
INSERT INTO movies VALUES (21564, 'Human Desire', '1954-08-05', NULL, 91, 0, 'Jeff Warren, a Korean War vet just returning to his railroad engineer''s job, boards at the home of co-worker Alec Simmons and is charmed by Alec''s beautiful daughter. He becomes attracted immediately to Vicki Buckley, the sultry wife of brutish railroad supervisor Carl Buckley, an alcoholic wife beater with a hair trigger temper and penchant for explosive violence. Jeff becomes reluctantly drawn into a sordid affair by the compulsively seductive Vicki. After Buckley is fired for insubordination, he begs her to intercede on his behalf with John Owens, a rich and powerful businessman whose influence can get him reinstated.');
INSERT INTO movies VALUES (21594, 'The Blue Gardenia', '1953-03-23', NULL, 88, 0, 'Norah Larkin is a single woman whose heart is broken after receiving a "Dear John" letter. After a night of drinking she passes out in the apartment of womaniser Harry Prebble, awaking to find herself accused of his murder.');
INSERT INTO movies VALUES (22342, 'The Big Combo', '1955-02-15', NULL, 84, 0, 'Police Lt. Leonard Diamond vies to bring a clever, well connected, and sadistic gangster to justice all the while obsessing over the gangsters'' girlfriend.');
INSERT INTO movies VALUES (22408, 'Rage at Dawn', '1955-03-26', NULL, 87, 0, 'In this film''s version of the story, four of the Reno Brothers are corrupt robbers and killers while a fifth, Clint (Denver Pyle) is a respected Indiana farmer. A sister, Laura (Mala Powers), who has inherited the family home, serves the outlaw brothers as a housekeeper and cook. One brother is killed when they go after a bank, the men of the town appear to have been waiting for them…');
INSERT INTO movies VALUES (22733, 'Beat the Devil', '1953-11-24', 1000000, 89, 0, 'The script, which was written on a day-to-day basis as the film was being shot, concerns the adventures of a motley crew of swindlers and ne''er-do-wells trying to lay claim to land rich in uranium deposits in Kenya as they wait in a small Italian port to travel aboard an ill-fated tramp steamer en route to Mombasa.');
INSERT INTO movies VALUES (22734, 'Beneath the 12-Mile Reef', '1953-12-02', NULL, 102, 0, 'Mike and Tony Petrakis are a Greek father and son team who dive for sponges off the coast of Florida. After they are robbed by crooks, Arnold and the Rhys brothers, Mike decides to take his men to the dangerous 12-mile reef to dive for more sponges. Mike suffers a fatal accident when he falls from the reef leaving Tony to carry on the business. But now he has a companion, Gwyneth Rhys.');
INSERT INTO movies VALUES (22924, 'Armored Car Robbery', '1950-06-08', NULL, 67, 0, 'The film tells the story of a well-planned robbery of an armored car when it stops at a sports stadium. Yet, the heist goes awry, and a tough Los Angeles cop named Cordell (Charles McGraw) is in hot pursuit.');
INSERT INTO movies VALUES (22968, 'Father''s Little Dividend', '1951-04-12', NULL, 82, 0, 'In this sequel to Father of the Bride, newly married Kay Dunstan announces that she and her husband are going to have a baby, leaving her father having to come to grips with the fact that he will soon be a granddad.');
INSERT INTO movies VALUES (22985, 'The Prowler', '1951-05-25', NULL, 92, 0, 'After being frightened by a peeping Tom at her mansion in the suburbs, the beautiful Susan Gilvray calls the police for help. When a policeman, Webb Garwood, arrives, he becomes infatuated with Susan, and the two engage in an affair. Susan soon ends their relationship, choosing to remain with her husband, John. However, Webb''s obsession with her continues to grow, until he begins plotting to kill John and cash in on his life insurance policy.');
INSERT INTO movies VALUES (23020, 'Jail Bait', '1954-01-01', NULL, 74, 0, 'Don Gregor, the son of famous plastic surgeon Dr. Boris Gregor, begins to hang around with young criminal Vic Brady and carry a gun. The pair attempt an armed holdup, and when things start to go wrong Gregor accidentally kills a night watchman. Fearing that Gregor plans to turn himself in, Brady kills him and blackmails Dr. Gregor into giving him a new face.');
INSERT INTO movies VALUES (23045, 'Killers from Space', '1954-01-23', NULL, 71, 0, 'Atomic scientist/pilot Doug Martin is missing after his plane crashes on an reconnaissance mission after a nuclear test. Miraculously appearing unhurt at the base later, he is given sodium amethol, but authorities are skeptical of his story that he was captured by aliens determined to conquer the Earth with giant monsters and insects. Martin vows to use existing technology to destroy them.');
INSERT INTO movies VALUES (23097, 'Hell and High Water', '1954-02-06', NULL, 103, 0, 'A privately-financed scientist and his colleagues hire an ex-Navy officer to conduct an Alaskan submarine expedition in order to prevent a Red Chinese anti-American plot that may lead to World War III. Mixes deviously plotted schoolboy fiction with submarine spectacle and cold war heroics.');
INSERT INTO movies VALUES (23115, 'Long John Silver', '1954-12-16', NULL, 106, 0, 'In this sequel to Treasure Island, Long John hopes to rescue his friend Jim from a rival pirate and return for more treasure.');
INSERT INTO movies VALUES (23152, 'People Will Talk', '1951-08-29', NULL, 110, 0, 'Successful and well-liked, Dr. Noah Praetorius becomes the victim of a witchhunt at the hands of Professor Elwell, who disdains Praetorius''s unorthodox medical views and also questions his relationship with the mysterious, ever-present Mr. Shunderson.');
INSERT INTO movies VALUES (28696, 'The Wild One', '1953-12-30', NULL, 79, 0, 'A gang of forty motorcyclists, the Black Rebels Motorcycle Club, gate-crash a legitimate motorcycle race. They are eventually thrown out, but one of the gang steals the second prize trophy and gives it to their leader, Johnny.');
INSERT INTO movies VALUES (23325, 'At War with the Army', '1950-04-14', NULL, 93, 0, 'Two former nightclub partners are now enlisted in the Army. Sergeant Puccinelli ranks above his former partner, Private First Class Korwin. Puccinelli is desperately trying to get transferred from his dull job to active duty overseas. Meanwhile, all Korwin wants is a pass to see his wife and new baby.');
INSERT INTO movies VALUES (23331, 'Planet Outlaws', '1953-01-01', NULL, 71, 0, 'It is the story of an American soldier who wakes up in the future, it is the year 2500...');
INSERT INTO movies VALUES (23620, 'Salt of the Earth', '1954-03-14', NULL, 94, 0, 'The issues the miners strike for include equity in wages with Anglo workers, and health and safety issues.Ramon Quintero helps organize the strike, but at home he treats his wife,Esperanza Quintero,as a second class citizen.Esperanza who is pregnant with their third child,is usually passive but she changes her attitude when the men are forced to end their picketing by a Taft-Hartley Act injuction.');
INSERT INTO movies VALUES (23928, 'Captain Horatio Hornblower R.N.', '1951-04-10', NULL, 117, 0, 'A naval adventure, based on the novels by C.S. Forester, about the heroic, 19th-century British seafarer. The story sails with his ship, the Lydia, through battles with Spain and then France won with wit rather than might.');
INSERT INTO movies VALUES (24002, 'Let''s Make It Legal', '1951-10-31', NULL, 77, 0, 'The divorce of Hugh and Miriam Halsworth becomes final at midnight. Hugh wouldn''t dream of calling it off, but can''t abandon his rose garden. Things change that afternoon, though, when Miriam''s old suitor Victor Macfarland checks into the hotel where Hugh is publicity man. With Miriam''s daughter Barbara rooting for Hugh and son-in-law Jerry rooting for Victor, things are unlikely to be resolved by midnight...');
INSERT INTO movies VALUES (24003, 'Clash by Night', '1952-06-16', NULL, 105, 0, 'An embittered woman seeks escape in marriage, only to fall for her husband''s best friend.');
INSERT INTO movies VALUES (24004, 'We''re Not Married!', '1952-07-11', NULL, 86, 0, 'A Justice of the Peace performed weddings a few days before his license was valid. A few years later five couples learn they have never been legally married. Annabel Norris, already Mrs. Mississippi and ready to enter the Mrs. America contest, is now free to enter the Miss Mississippi contest.');
INSERT INTO movies VALUES (24005, 'Don''t Bother to Knock', '1952-07-18', NULL, 76, 0, 'Jed, an airline pilot, (Widmark) is resting in a hotel when he notices Nell (Monroe), a young woman babysitting for a wealthy couple. As Jed gets to know Nell better he realises that the woman is not as stable as perhaps she should be. A unique thriller featuring a rare dramatic performance from Monroe, illustrating a broader range than most people might expect..');
INSERT INTO movies VALUES (24006, 'O. Henry''s Full House', '1952-08-07', NULL, 117, 0, 'Five O. Henry stories, each separate. The primary one from the critic''s acclaim was "The Cop and the Anthem". Soapy tells fellow bum Horace that he is going to get arrested so he can spend the winter in a nice jail cell. He fails. He can''t even accost a woman; she turns out to be a streetwalker. The other stories are "The Clarion Call", "The Last Leaf", "The Ransom of Red Chief", and "The Gift of the Magi".');
INSERT INTO movies VALUES (24008, 'Monkey Business', '1952-09-02', NULL, 97, 0, 'Barnaby Fulton is a research chemist working on a fountain of youth pill for a chemical company. One of the labs chimps, Esther, gets loose in the laboratory and, having watched Dr Fulton do something similar, mixes a beaker of chemicals, but then pours the mix into the water cooler. Later, when trying one of his own samples sample, washed down with water from the cooler, Fulton begins to act just like a 20-year-old and believes his potion is working. Soon his wife and boss are also behaving like children.');
INSERT INTO movies VALUES (24018, 'Glen or Glenda', '1953-01-01', NULL, 71, 0, 'A psychiatrist tells two stories: one of a transvestite (Glen or Glenda), the other of a pseudohermaphrodite (Alan or Anne).');
INSERT INTO movies VALUES (24212, 'Devil Girl from Mars', '1954-05-01', NULL, 77, 0, 'An uptight, leather-clad female alien, armed with a raygun and accompanied by a menacing robot, comes to Earth to collect Earth''s men as breeding stock');
INSERT INTO movies VALUES (24381, 'The Titfield Thunderbolt', '1953-03-04', NULL, 84, 0, 'When British Railways announce the closure of the Titfield to Mallingford branch line a group of local residents make a bid to run it themselves, backed by a monied member of the community who is attracted by the complete lack of licensing hours on trains. Unfortunately the local bus company starts to use methods that can hardly be seen as fair competition.');
INSERT INTO movies VALUES (24442, 'The Black Shield Of Falworth', '1954-09-02', NULL, 99, 0, 'In the days of King Henry IV,stalwart young Myles and his sister Meg have been raised as peasants,without any knowledge of who their father really was. But one day they journey to Macworth castle. There Myles falls in love with the Macworth''s daughter Anne,makesfriends and enemies,and learns to be a knight.');
INSERT INTO movies VALUES (24481, 'Born Yesterday', '1950-12-25', NULL, 103, 0, 'Uncouth, loud-mouth junkyard tycoon Harry Brock descends upon Washington D.C. to buy himself a congressman or two, bringing with him his mistress, ex-showgirl Billie Dawn.');
INSERT INTO movies VALUES (24518, 'The Long, Long Trailer', '1954-02-18', NULL, 96, 0, 'A newly wed couple, Tacy and Nicky, travel in a trailer for their honeymoon. The journey is a humorous one that could end up destroying their marriage.');
INSERT INTO movies VALUES (24580, 'The Quatermass Xperiment', '1955-08-26', NULL, 82, 0, 'Professor Bernard Quatermass is in charge of a rocket mission that has gone awry. They lose contact with the spaceship and have no idea how far into space it may have traveled. When the rocket crash lands they find that only one of the three occupants, Victor Carroon, is on board; the others have simply vanished. Slowly, the surviving astronaut begins to transform into a deadly creature.');
INSERT INTO movies VALUES (24973, 'The Egyptian', '1954-08-25', 5000000, 139, 0, 'In eighteenth-dynasty Egypt, Sinuhe, a poor orphan, becomes a brilliant physician and with his friend Horemheb is appointed to the service of the new Pharoah. Sinuhe''s personal triumphs and tragedies are played against the larger canvas of the turbulent events of the 18th dynasty. As Sinuhe is drawn into court intrigues he learns the answers to the questions he has sought since his birth.');
INSERT INTO movies VALUES (25009, 'Mogambo', '1953-10-09', NULL, 115, 0, 'Victor Marswell runs a big game trapping company in Kenya. Eloise Kelly is ditched there, and an immediate attraction happens between them. Then Mr. and Mrs. Nordley show up for their gorilla documenting safari. Mrs. Nordley is not infatuated with her husband any more, and takes a liking to Marswell. The two men and two women have some difficulty arranging these emotions to their mutual satisfaction, but eventually succeed.');
INSERT INTO movies VALUES (25209, 'Annie Get Your Gun', '1950-05-17', 3768785, 107, 0, 'This film adaptation of Irving Berlin''s classic musical stars Betty Hutton as gunslinger Annie Oakley, who romances fellow sharpshooter Frank Butler (Howard Keel) as they travel with Buffalo Bill''s Wild West Show. Previously off target when it comes to love, Annie proves you can get a man with a gun in this battle-of-the-sexes extravaganza, which features timeless numbers like "Anything You Can Do" and "There''s No Business Like Show Business."');
INSERT INTO movies VALUES (25364, 'Ace in the Hole', '1951-06-29', 1821052, 111, 0, 'A frustrated former big-city journalist now stuck working for an Albuquerque newspaper exploits a story about a man trapped in a cave to revitalize his career, but the situation quickly escalates into an out-of-control media circus.');
INSERT INTO movies VALUES (25392, 'Destination Moon', '1950-06-26', NULL, 91, 0, 'Postulates the first manned trip to the moon, happening in the (then) near future, and being funded by a consortium of private backers. Assorted difficulties occur and must be overcome in-flight. Attempted to be realistic, with Robert A. Heinlein providing advice.');
INSERT INTO movies VALUES (25548, 'Shadow on the Wall', '1950-05-19', NULL, 84, 0, 'Angered that her sister Celia has stolen her fiance, Dell Faring kills her and allows Celia''s husband David, knocked out in an argument with Celia, to take the blame and end up on death row. Later Dell, finding out that David''s young daughter Susan was witness to the crime and is undergoing psychiatric treatment, plans to eliminate her before her memory returns.');
INSERT INTO movies VALUES (25549, 'Split Second', '1953-05-02', NULL, 85, 0, 'Escaped convicts hold hostages in a ghost town targeted for a nuclear bomb test.');
INSERT INTO movies VALUES (25550, 'The Sellout', '1952-05-30', NULL, 83, 0, 'A small-town newspaper editor risks everything to expose a corrupt sheriff.');
INSERT INTO movies VALUES (25551, 'The Sniper', '1952-05-09', NULL, 88, 0, 'Eddie Miller struggles with his hatred of women, he''s especially bothered by seeing women with their lovers. He starts a killing spree as a sniper by shooting women from far distances. In an attempt to get caught, he writes an anonymous letter to the police begging them to stop him.');
INSERT INTO movies VALUES (25564, 'Appointment with Danger', '1951-05-09', NULL, 89, 0, 'Al Goddard (Alan Ladd), a detective who works for the United States Postal Inspection Service, is assigned to arrest two criminals who''ve allegedly murdered a U.S. postal detective.');
INSERT INTO movies VALUES (25673, 'A Place in the Sun', '1951-06-12', NULL, 122, 0, 'An ambitious young man wins an heiress''s heart but has to cope with his former girlfriend''s pregnancy.');
INSERT INTO movies VALUES (25728, 'The Mob', '1951-09-07', NULL, 87, 0, 'An undercover officer (Broderick Crawford) tracks waterfront corruption from California to New Orleans and back.');
INSERT INTO movies VALUES (25738, 'He Ran All The Way', '1951-06-19', NULL, 77, 0, 'A crook on the run hides out in an innocent girl''s apartment.');
INSERT INTO movies VALUES (25787, 'One Girl''s Confession', '1953-04-06', NULL, 74, 0, 'Cleo Moore stars as Mary Adams, whose first step on the road to ruin is a $25,000 robbery. Mary hides the money, then confesses to the crime, secure in the belief that she can dig up the loot upon her release from prison.');
INSERT INTO movies VALUES (25876, 'The Racket', '1951-12-12', NULL, 88, 0, 'Mobster Nick Scanlon (Ryan) has managed to buy several of the local government and law-enforcement officials. However, he can''t seem to touch the incorruptible police captain Tom McQueeg (Mitchum), who refuses all attempts at bribery. Prosecuting attorney, Welch (Collins), and a police detective, Turck (Conrad), are crooked and make McQueeg''s job as an honest officer nearly impossible.');
INSERT INTO movies VALUES (25893, 'The Seven Little Foys', '1955-09-30', NULL, 93, 0, 'Vaudeville entertainer Eddie Foy, who has vowed to forever keep his act a solo, falls in love with and marries Italian ballerina Madeleine. While they continue to tour the circuit, they begin a family and before long have seven little Foys to clutter the wings. After tragedy threatens to stall Eddie''s career, he comes to realize that his little terrors are worth their weight in gold. - Chris Stone');
INSERT INTO movies VALUES (25952, 'Conquest of Space', '1955-04-20', NULL, 81, 0, 'A team of American astronauts leave their space station on the first mission to Mars, but the captain''s religious beliefs may get in the way.');
INSERT INTO movies VALUES (25953, 'Radar Secret Service', '1950-01-28', NULL, 59, 0, 'A federal agent (John Howard) and his partner track uranium-ore hijackers with radar.');
INSERT INTO movies VALUES (25955, 'Pickup on South Street', '1953-05-29', NULL, 80, 0, 'A pickpocket unwittingly lifts a message destined for enemy agents and becomes a target for a Communist spy ring.');
INSERT INTO movies VALUES (26009, 'Scandal Sheet', '1952-01-16', NULL, 82, 0, 'A tabloid editor assigns a young reporter to solve a murder the editor committed himself.');
INSERT INTO movies VALUES (26175, 'Ivanhoe', '1952-01-01', NULL, 106, 0, 'Sir Walter Scott''s classic story of the chivalrous Ivanhoe who joins with Robin of Locksley in the fight against Prince John and for the return of King Richard the Lionheart.');
INSERT INTO movies VALUES (26205, 'The Desert Fox: The Story of Rommel', '1951-10-16', NULL, 88, 0, 'The life and career of Erwin Rommel and his involvement in the plot to assassinate Hitler.');
INSERT INTO movies VALUES (26242, 'Park Row', '1952-08-12', NULL, 83, 0, 'In New York''s 1880''s newspaper district a dedicated journalist manages to set up his own paper. It is an immediate success but attracts increasing opposition from one of the bigger papers and its newspaper heiress owner.');
INSERT INTO movies VALUES (26270, 'Project Moon Base', '1953-09-04', NULL, 63, 0, 'In the future (1970) the US sends a mission to the moon to investigate the building of a moon base.');
INSERT INTO movies VALUES (26282, 'Macao', '1952-04-30', NULL, 81, 0, 'A man on the run in the Far East is mistaken for an undercover cop.');
INSERT INTO movies VALUES (26283, 'The Las Vegas Story', '1952-01-30', NULL, 88, 0, 'When newlyweds visit Las Vegas, the wife''s shady past comes to the surface.');
INSERT INTO movies VALUES (26516, 'Blackboard Jungle', '1955-03-25', NULL, 101, 0, 'Richard Dadier is a teacher at North Manual High School, an inner-city school where many of the pupils frequently engage in anti-social behavior. Dadier makes various attempts to engage the students'' interest in education, challenging both the school staff and the pupils. He is subjected to violence as well as duplicitous schemes.');
INSERT INTO movies VALUES (26596, 'Johnny Guitar', '1954-05-26', NULL, 110, 0, 'On the outskirts of town, the hard-nosed Vienna owns a saloon frequented by the undesirables of the region, including Dancin'' Kid and his gang. Another patron of Vienna''s establishment is Johnny Guitar, a former gunslinger and her lover. When a heist is pulled in town that results in a man''s death, Emma Small, Vienna''s rival, rallies the townsfolk to take revenge on Vienna''s saloon – even without proof of her wrongdoing.');
INSERT INTO movies VALUES (26661, 'Abbott and Costello Meet the Mummy', '1955-06-01', NULL, 79, 0, 'When the murder of an archaeologist puts a valuable medallion into their hands, Abbott and Costello waste little time in trying to sell it, only to find themselves pursued by police, a slinky adventuress, an Egyptian high priest, and the mummy himself.');
INSERT INTO movies VALUES (26712, 'The Enforcer', '1951-02-24', NULL, 87, 0, 'After years of pursuit, Assistant D.A. Martin Ferguson has a good case against Murder, Inc. boss Albert Mendoza. Mendoza is in jail and his lieutenant Joseph Rico is going to testify. But Rico falls to his death and Ferguson must work through the night going over everything to build the case anew.');
INSERT INTO movies VALUES (26758, 'Man with the Gun', '1955-11-05', NULL, 83, 0, 'A stranger comes to town looking for his estranged wife. He finds her running the local girls. He also finds a town and sheriff afraid of their own shadow, scared of a landowner they never see who rules through his rowdy sidekicks. The stranger is a town tamer by trade, and he accepts a $500 commission to sort things out.');
INSERT INTO movies VALUES (26948, 'Loophole', '1954-03-28', NULL, 80, 0, 'Bank teller Mike Donovan (Barry Sullivan) takes the first step on the road to Perdition when he fails to report a $49,000 shortage. Accused of theft, Donovan is fired from his job. He is then prevented from finding other employment by Javert-like insurance investigator Gus Slavin (Charles McGraw). Despite many setbacks, Donovan attempts to clear his muddied name.');
INSERT INTO movies VALUES (27191, 'The Greatest Show on Earth', '1952-01-10', 4000000, 152, 0, 'To ensure a full profitable season, circus manager Brad Braden engages The Great Sebastian, though this moves his girlfriend Holly from her hard-won center trapeze spot. Holly and Sebastian begin a dangerous one-upmanship duel in the ring, while he pursues her on the ground.');
INSERT INTO movies VALUES (27212, 'A Bullet for Joey', '1955-04-15', NULL, 85, 0, 'Edward G. Robinson is a police inspector trailing a spy who plots to kidnap an important American atomic scientist. George Raft a gangster who is hired to carry out the abduction, balks when he learns what is at stake and helps Robinson out instead.');
INSERT INTO movies VALUES (37911, '5 Against the House', '1955-06-10', NULL, 84, 0, 'Former war-time Army buddies now students in college decide to rip off a Reno casino.');
INSERT INTO movies VALUES (27256, 'The Woman in Question', '1952-02-18', NULL, 88, 0, 'Director Anthony Asquith, working in the style of a Hitchcock whodunit, deftly moves between multiple points of view in this gritty look at life in a seaport town. Jean Kent stars as Agnes "Astra" Huston, a fortune teller at a run-down fair, who is found strangled in her bedroom. As the police question five suspects their interactions with her are shown in flashbacks from their point of view.');
INSERT INTO movies VALUES (27263, 'The Tall Target', '1951-08-17', NULL, 78, 0, 'A detective tries to prevent the assassination of a mysterious "tall man" during a train ride.');
INSERT INTO movies VALUES (27399, 'Forbidden', '1953-12-02', NULL, 85, 0, 'Forbidden bears traces of several earlier film noirs, with Tony Curtis filling the shoes vacated by the likes of Alan Ladd, Dick Powell and Robert Mitchum. Curtis acquits himself very nicely as a small-time hood sent to Macao by gangster Lyle Bettger to locate Joanne Dru, the widow of another gangster.');
INSERT INTO movies VALUES (27443, 'Silver Lode', '1954-07-23', NULL, 81, 0, 'Dan Ballard, a respected citizen in the western town of Silver Lode, has his wedding interrupted by four men led by Ned McCarthy, an old acquaintance who, as a US Marshal, arrests Ballard for the murder of his brother and the theft of $20,000. Ballard seeks to stall McCarthy while tracking down evidence that will prove his innocence.');
INSERT INTO movies VALUES (27543, 'The Sound of Fury', '1950-12-12', NULL, 85, 0, 'A family man -desperate for a job- latches onto a friend that encourages him into being a criminal.');
INSERT INTO movies VALUES (27544, 'The Company She Keeps', '1951-01-27', NULL, 82, 0, 'A lady con artist sets out to steal her parole officer''s fiance.');
INSERT INTO movies VALUES (27560, 'Cry of the Hunted', '1953-05-08', NULL, 80, 0, 'A prison convict escapes through the Louisiana swamps.');
INSERT INTO movies VALUES (27629, 'Here Comes the Groom', '1951-09-20', NULL, 113, 0, 'Foreign correspondent Pete Garvey has 5 days to win back his former fiancée, or he''ll lose the orphans he adopted.');
INSERT INTO movies VALUES (27884, 'The Story of Robin Hood and His Merrie Men', '1952-05-26', NULL, NULL, 0, 'Young Robin Hood, in love with Maid Marian, enters an archery contest with his father at the King''s palace. On the way home his father is murdered by henchmen of Prince John. Robin takes up the life of an outlaw, gathering together his band of merry men with him in Sherwood Forest, to avenge his father''s death and to help the people of the land that Prince John are over taxing.');
INSERT INTO movies VALUES (27917, 'Pool of London', '1951-02-20', NULL, 85, 0, 'Jewel thieves, murder and a manhunt swirl around a sailor (Bonar Colleano) off a cargo ship in London.');
INSERT INTO movies VALUES (28023, 'Riot in Cell Block 11', '1954-02-28', NULL, 80, 0, 'A prisoner leads his counterparts in a protest for better living conditions which turns violent and ugly.');
INSERT INTO movies VALUES (28296, 'Queen Bee', '1955-11-07', NULL, 95, 0, 'A devilish Southern woman, married to a man who despises her, manages to manipulate those around her under the guise of being kind. But, when her sister-in-law is engaged to be married to the woman''s former lover and her husband starts up an affair with her cousin, visting from New York, things start to go awry and she sets a plan to destroy it all.');
INSERT INTO movies VALUES (28304, 'The Furies', '1950-08-16', NULL, 109, 0, 'A New Mexico cattle man and his strong-willed daughter clash over the man''s choice for a new bride. Things get worse when the elder man has his daughter''s lover hanged. With the help of an old flame, a gambler, the daughter puts into motion a plan to drive her father from his estate.');
INSERT INTO movies VALUES (28363, 'The Mad Magician', '1954-05-19', NULL, 72, 0, 'Vincent Price plays Gallico the great, an inventor of stage-magic effects who aspires to become a star in his own right. Just before his first performance, his act is shut down by capricious manager Ormond who wants Gallico''s brilliant buzzsaw effect for the act of the Great Rinaldi, an established star. With this defeat, and the humiliation of having already lost his wife Claire to his rival, Gallico goes insane and uses the buzzsaw to decapitate his manager.');
INSERT INTO movies VALUES (28431, 'The Prisoner of Zenda', '1952-11-14', NULL, 96, 0, 'The classic tale of a king and an everyman switching places.');
INSERT INTO movies VALUES (28433, 'No Way Out', '1950-08-16', NULL, 106, 0, 'The Biddle brothers, shot while robbing a gas station, are taken to the prison ward of the County Hospital; Ray Biddle, a rabid racist, wants no treatment from black resident Dr. Luther Brooks. When brother John dies while Luther tries to save him, Ray is certain it''s murder and becomes obsessed with vengeance. But there are black racists around too, and the situation slides rapidly toward violence.');
INSERT INTO movies VALUES (28434, 'The House on Telegraph Hill', '1951-08-27', NULL, 93, 0, 'Concentration camp survivor Victoria Kowelska finds herself involved in mystery, greed, and murder when she assumes the identity of a dead friend in order to gain passage to America.');
INSERT INTO movies VALUES (28490, 'I Died a Thousand Times', '1955-11-09', NULL, 109, 0, 'I Died a Thousand Times is essentially a remake of the 1941 crime-drama classic High Sierra.  Jack Palance steps into the old Humphrey Bogart role as Roy "Mad Dog" Earle, the ageing bank robber who intends to pull off one last heist before retiring.  Sprung from prison by likeable crime boss Big Mac (Lon Chaney Jr.), Earle is commissioned to mastermind the robbery of a resort hotel.  His partners in crime include the hotheaded, immature Babe (Lee Marvin) and Red (Earl Holliman), as well as "inside man" Mendoza (Perry Lopez).  Also along for the ride is Marie (Shelley Winters), a dance-hall girl whom Babe has picked up. Marie falls in love with Earle, but he has eyes only for Velma (Lori Nelson), the club-footed daughter of a farmer (Ralph Moody) whom Earle had earlier befriended.  While the 1955 film cannot match the excellence of its 1941 role model, I Died a Thousand Times works quite well on its own terms.');
INSERT INTO movies VALUES (28561, 'Roadblock', '1951-09-17', NULL, 73, 0, 'An insurance agent''s greedy girlfriend with a taste for mink leads him to a life of crime.');
INSERT INTO movies VALUES (28575, 'I''ll Cry Tomorrow', '1955-12-25', NULL, 117, 0, 'Deprived of a normal childhood by her ambitious mother, Katie (Jo Van Fleet), Lillian Roth (Susan Hayward) becomes a star of Broadway and Hollywood before she is twenty. Shortly before her marriage to her childhood sweetheart, David Tredman (Ray Danton), he dies and Lillian takes her first drink of many down the road of becoming an alcoholic.');
INSERT INTO movies VALUES (28590, 'King Dinosaur', '1955-07-17', NULL, 63, 0, 'Four astronauts in 1960 travel to a planet called Nova that has just entered Earth''s solar system. The crew begins to study the planet to see if it''s able to withstand a possible Earth colony. After first discovering normal Earth animals such as a kinkajou and an alligator, they soon encounter and battle giant insects, an enormous snake, prehistoric mammals, dinosaurs, and the titular character, King Dinosaur, a Tyrannosaurus Rex. Eventually, the scientists blow up the planet with an atomic bomb, killing all of its inhabitants.');
INSERT INTO movies VALUES (28661, 'World for Ransom', '1954-01-31', NULL, 82, 0, 'Made by the same production set-up on the same lot that was producing the 1953-54 "China Smith/Captain China" TV series that starred Dan Duryea as soldier-of-fortune China Smith, using many of the same players that were regulars on the TV series. Director Aldrich went uncredited possibly because the film was a quickly-made but poor product.');
INSERT INTO movies VALUES (28663, 'Woman on the Run', '1950-11-29', NULL, 77, 0, 'Frank Johnson, sole witness to a gangland murder, goes into hiding and is trailed by Police Inspector Ferris, on the theory that Frank is trying to escape from possible retaliation. Frank''s wife, Eleanor, suspects he is actually running away from their unsuccessful marriage. Aided by a newspaperman, Danny Leggett, Eleanor sets out to locate her husband. The killer is also looking for him, and keeps close tabs on Eleanor.');
INSERT INTO movies VALUES (28909, 'Above Us the Waves', '1955-03-29', NULL, 99, 0, 'In World War II, the greatest threat to the British navy is the German battleship Tirpitz. While anchored in a Norwegian fjord, it is impossible to attack by conventional means, so a plan is hatched for a special commando unit to attack it, using midget submarines to plant underwater explosives.');
INSERT INTO movies VALUES (28971, 'Limelight', '1952-10-31', NULL, 137, 0, 'A fading music hall comedian tries to help a despondent ballet dancer learn to walk and to again feel confident about life.');
INSERT INTO movies VALUES (29112, 'The Well', '1951-09-10', NULL, 86, 0, 'In a racially mixed American town, a 5-year-old black girl falls unnoticed into a hidden, forgotten well on her way to school. Having nothing better to go on, the police follow up a report that the child was seen with a white stranger, and rumors run wild. Before hapless, innocent Claude Packard is even found, popular hysteria has him tried and convicted. But is he guilty?');
INSERT INTO movies VALUES (29254, 'Rhubarb', '1951-08-29', NULL, 94, 0, 'Rich, eccentric T.J. Banner adopts a feral cat who becomes an affectionate pet. Then T.J. dies, leaving to Rhubarb most of his money and a pro baseball team, the Brooklyn Loons. When the team protests, publicist Eric Yeager convinces them Rhubarb is good luck. But Eric''s fiacee Polly seems to be allergic to cats, and the team''s success may mean new hazards for Rhubarb.');
INSERT INTO movies VALUES (29257, 'Under the Gun', '1951-02-22', NULL, 83, 0, 'A convicted racketeer becomes prison trustee when an inmate whom he persuaded to escape is killed.');
INSERT INTO movies VALUES (29284, 'Murder Is My Beat', '1955-02-27', NULL, 77, 0, 'Mr. Dean''s body is found face down in the fireplace, his features burned beyond recognition. Detectives Patrick (Paul Langton) and Rawley (Robert Shayne) arrest nightclub-singer Eden Lane (Barbara Payton) and she is convicted of the crime. On the way to prison, Eden sees a man through the train window, identifying him as the murderer, and Patrick and Eden jump from the train to search for the man.');
INSERT INTO movies VALUES (29376, 'The Band Wagon', '1953-08-07', NULL, 112, 0, 'A pretentiously artistic director is hired for a new Broadway musical and changes it beyond recognition.');
INSERT INTO movies VALUES (29377, 'Blood Alley', '1955-10-01', NULL, 110, 0, 'A merchant marine captain, rescued from the Chinese Communists by local visitors, is "shanghaied" into transporting the whole village to Hong Kong on an ancient paddle steamer.');
INSERT INTO movies VALUES (29381, 'Caged', '1950-05-19', NULL, 96, 0, 'Caged tells the story of a teenage newlywed, who is sent to prison for being an accessory to a robbery. Her experiences while incarcerated, along with the killing of her husband, change her from a very frightened young girl into a hardened convict.');
INSERT INTO movies VALUES (29467, 'Tomorrow Is Another Day', '1951-09-22', NULL, 90, 0, 'A man who spent his formative years in prison for murder is released, and struggles to adjust to the outside world and escape his lurid past. He gets involved with a cheap dancehall girl, and when her protector is accidentally killed, they go on the lam together, getting jobs as farm labourers. But some fellow workers get wise to them.');
INSERT INTO movies VALUES (29477, 'Highway 301', '1950-12-01', NULL, 83, 0, 'The "Tri-State" gang goes on a successful bank robbing streak causing local authorities to turn up the heat on the daring career criminals.');
INSERT INTO movies VALUES (29577, 'On the Riviera', '1951-04-20', NULL, 89, 0, 'In this fast-paced remake of the Muarice Chavlier vehicle Folies Bergere, talented Danny Kaye plays both a performer and a heroic French military pilot.');
INSERT INTO movies VALUES (29835, 'Cause for Alarm', '1951-03-30', NULL, 74, 0, 'A woman fights to intercept a letter in which her husband tries to prove her guilty of murder.');
INSERT INTO movies VALUES (29912, 'The Robe', '1953-09-16', 4100000, 135, 0, 'Marcellus is a tribune in the time of Christ. He is in charge of the group that is assigned to crucify Jesus. Drunk, he wins Jesus'' homespun robe after the crucifixion. He is tormented by nightmares and delusions after the event. Hoping to find a way to live with what he has done, and still not believing in Jesus, he returns to Palestine to try and learn what he can of the man he killed.');
INSERT INTO movies VALUES (29959, 'It Came from Beneath the Sea', '1955-07-01', NULL, 79, 0, 'A Giant Octopus, whose feeding habits have been affected by radiation from H-Bomb tests, rises from the Mindanao Deep to terrorize the California Coast.');
INSERT INTO movies VALUES (29967, 'Moonfleet', '1955-06-24', NULL, 87, 0, 'set in the eighteenth century, the film is about John Mohune, a young orphan, played by Jon Whiteley, who is sent to the Dorset village of Moonfleet to stay with an old friend of his mother''s, Jeremy Fox. Fox, played by Stewart Granger, is a morally ambiguous character, an elegant gentleman involved with smugglers and pirates.');
INSERT INTO movies VALUES (30014, 'House by the River', '1950-03-25', NULL, 88, 0, 'Louis Hayward stars as a wealthy man who tries to seduce the family maid. She resists, and he kills her. Long jealous of his brother Lee Bowman, Hayward does his best to pin the blame for the murder on his sibling. Also affected by Hayward''s arrogant dementia is his long-suffering wife Jane Wyatt. Originally, director Lang had proposed that the unfortunate maid be a black woman, but was over ruled');
INSERT INTO movies VALUES (30025, 'Sirocco', '1951-06-13', NULL, 98, 0, 'A mysterious American gets mixed up with gunrunners in Syria.');
INSERT INTO movies VALUES (30034, 'Shield for Murder', '1954-08-27', NULL, 82, 0, 'A crooked detective masterminds a robbery then fights to keep his money.');
INSERT INTO movies VALUES (30036, 'Rogue Cop', '1954-09-17', NULL, 92, 0, 'A police detective on the take tries to catch his brother''s killer.');
INSERT INTO movies VALUES (30131, 'El siete machos', '1951-02-05', NULL, 108, 2, 'Rosario, the niece of the rancher, returns to the ranch after ten years of absence. She takes in Margarito, a worker at the ranch, who is immediately smitten by her. Rosario is rescued from a runaway horse by the Seven Men, an outlaw a la Robin Hood that steals from the rich and gives to the poor. He also happens to be the twin brother of Margarito, unbeknownst to him. The confusion between Margarito and the Seven Men generates great comical situations in the film.');
INSERT INTO movies VALUES (30159, 'I Confess', '1953-02-28', NULL, 95, 0, 'Unable, due to the seal of the confessional, to be forthcoming with information that would serve to clear himself during a murder investigation, a priest becomes the prime suspect.');
INSERT INTO movies VALUES (30195, 'A Lady Without Passport', '1950-08-03', NULL, 74, 0, 'A secret service agent falls in love with an illegal immigrant.');
INSERT INTO movies VALUES (30345, 'The Black Castle', '1952-12-15', NULL, 82, 0, 'A Man investigates the disappearance of two of his friends who were the guests of a sinister Austrian count.');
INSERT INTO movies VALUES (30801, 'Son of Paleface', '1952-07-14', NULL, 95, 0, 'In this sequel to "The Paleface", Peter Potter Jr. and Mike ''The Torch'' Delroy return as the lead characters. Junior Potter returns to claim his father''s gold, which is nowhere to be found; Mike ''The Torch'' Delroy is the luscious head of a gang of thieves; and Roy Barton is a federal marshal hot on Mike''s trail.');
INSERT INTO movies VALUES (30909, 'Si muero antes de despertar', '1952-04-29', NULL, 73, 0, 'During a prank an 11 year old boy gets information about the identity of a kidnapper of girls in the vicinity but does not reveal it to his father, a policeman, not to confess his own fault and it jeopardizes his life.');
INSERT INTO movies VALUES (31024, 'The Flanagan Boy', '1953-04-10', NULL, 81, 0, 'Johnny Flanagan did not have the privileges of a good education or wealthy background but the streets developed his natural talent to be a great fighter. His enormous potential to reach the top is born out of a string of spectacular successes. All of which is brought to a halt when he develops a physical relationship with his manager''s wife, the beautiful but manipulative Lorna. His naive temperament is no match for her callous, dispassionate scheming and he unwittingly becomes a pawn in Lorna''s ultimate plan... .to murder her husband.');
INSERT INTO movies VALUES (31042, 'Target Earth', '1954-11-07', 100000, 75, 0, 'Giant robots from Venus invade Chicago. Stranded in the deserted city are Frank and Nora (who has recently attempted suicide). They meet a celebrating couple at a café, Vicki Harris and Jim Wilson. The quartet escape the robot patrol and take refuge in a large hotel. There, they encounter a new danger in Davis, a psychopathic killer.');
INSERT INTO movies VALUES (31152, 'On Dangerous Ground', '1951-12-17', NULL, 82, 0, 'A big-city cop is reassigned to the country after his superiors find him too angry to be an effective policeman. While on his temporary assignment he assists in a manhunt of a suspected murderer.');
INSERT INTO movies VALUES (31555, 'Pushover', '1954-08-06', NULL, 88, 0, 'A police detective falls for the bank robber''s girlfriend he is supposed to be tailing.');
INSERT INTO movies VALUES (31559, 'The Steel Trap', '1952-11-12', NULL, 85, 0, 'Joseph Cotten plays a assistant bank manager who steals $500,000 from the safe late on a Friday. His plans to flee to Brazil are hampered after he does get away with the money as planned.');
INSERT INTO movies VALUES (31560, 'A Blueprint for Murder', '1953-09-01', NULL, 77, 0, 'Two orphans, Polly and Doug, live with their stepmother Lynn; Polly collapses with the same mystery symptoms that killed her father. The kids'' visiting uncle, Whitney Sargent, is warned that the symptoms match strychnine poisoning, but that poisoners are seldom detected and rarely convicted. Sure enough, no case can be made against the obvious suspect; so what can he do to save the next victim?');
INSERT INTO movies VALUES (31713, 'The Narrow Margin', '1952-05-03', NULL, 71, 0, 'A tough cop meets his match when he has to guard a gangster''s widow on a tense train ride.');
INSERT INTO movies VALUES (32078, 'Panic in the Streets', '1950-06-12', NULL, 96, 0, 'One night in the New Orleans slums, vicious hoodlum Blackie and his friends kill an illegal immigrant who won too much in a card game. Next morning, Dr. Clint Reed of the Public Health Service confirms the dead man had pneumonic plague. To prevent a catastrophic epidemic, Clint must find and inoculate the killers and their associates, with the reluctant aid of police captain Tom Warren, despite official skepticism, and in total secrecy, lest panic empty the city. Can a doctor turn detective? He has 48 hours to try...');
INSERT INTO movies VALUES (32499, 'The Bad and the Beautiful', '1952-12-25', 1558000, 118, 0, 'Told in flashback form, the film traces the rise and fall of a tough, ambitious Hollywood producer Jonathan Shields, as seen through the eyes of various acquaintances, including a writer James Lee Bartlow, a star Georgia Lorrison and a director Fred Amiel. He is a hard-driving, ambitious man who ruthlessly uses everyone - including the writer, star and director - on the way to becoming one of Hollywood''s top movie makers.');
INSERT INTO movies VALUES (32563, 'The Flame and the Arrow', '1950-07-09', NULL, 88, 0, 'Dardo, a Robin Hood-like figure, and his loyal followers use a Roman ruin in Medieval Lombardy as their headquarters as they conduct an insurgency against their Hessian conquerors.');
INSERT INTO movies VALUES (32568, 'The Man in the White Suit', '1951-08-07', NULL, 85, 0, 'The unassuming, nebbishy inventor Sidney Stratton creates a miraculous fabric that will never be dirty or worn out. Clearly he can make a fortune selling clothes made of the material, but may cause a crisis in the process. After all, once someone buys one of his suits they won''t ever have to fix them or buy another one, and the clothing industry will collapse overnight. Nevertheless, Sidney is determined to put his invention on the market, forcing the clothing factory bigwigs to resort to more desperate measures...');
INSERT INTO movies VALUES (32929, 'Backfire', '1950-02-11', NULL, 91, 0, 'When he''s discharged from a military hospital, ex-GI Bob Corey (Gordon MacRae) goes on a search for his army buddy Steve Connolly (Edmond O''Brien). A reformed crook, Connolly is on the lam from a trumped-up murder rap, and Corey hopes to clear his pal. Tagging along is Army nurse Julie Benson (Virginia Mayo), who has fallen for Corey.');
INSERT INTO movies VALUES (32941, 'The House Across the Lake', '1954-04-16', NULL, 68, 0, 'Sensuous and desirable, Carol Forrest has always attracted the attention of men. Expert in the art of manipulation and control she married an older man, loving only his vast wealth and continued to amuse herself with indiscreet affairs. But when neighbour Mark Kendrick lets slip that her husband intends cutting her out of his will Carol concentrates all her attentions on the unsuspecting Kendrick, obtaining his help to dispose of this irritating obstacle.');
INSERT INTO movies VALUES (32961, 'The Lavender Hill Mob', '1951-06-21', NULL, 81, 0, 'A meek bank clerk who oversees the shipment of bullion joins with an eccentric neighbor to steal gold bars and smuggle them out of the country as miniature Eiffel Towers.');
INSERT INTO movies VALUES (33117, 'Tea for Two', '1950-09-02', NULL, 98, 0, 'In this reworking of "No, No, Nanette," wealthy heiress Nanette Carter bets her uncle $25,000 that she can say "no" to everything for 48 hours. If she wins, she can invest the money in a Broadway show featuring songs written by her beau, and of course, in which she will star. Trouble is, she doesn''t realize her uncle''s been wiped out by the Stock Market crash.');
INSERT INTO movies VALUES (33218, 'Daddy Long Legs', '1955-05-05', NULL, 126, 0, 'Wealthy American Jervis Pendleton III (Fred Astaire) has a chance encounter at a French orphanage with a cheerful 18-year-old resident, Julie Andre (Leslie Caron). He anonymously pays for her education at a New England college. She writes letters to her mysterious benefactor regularly, but he never writes back. Her nickname for him, "Daddy Long Legs", is taken from the description of him given to Andre by some of her fellow orphans who see his shadow as he leaves their building. Several years later, he visits her at school, still concealing his identity. Despite their large age difference, they soon fall in love.');
INSERT INTO movies VALUES (33224, 'Black Tuesday', '1954-12-31', NULL, 80, 0, 'Vicious gangster Vincent Canelli pulls off a daring prison escape just moments before going to the electric chair, taking with him Peter Manning – a bank robber and cop killer who was to die right after him. Taking several hostages along, they try to get their hands on the loot from Manning’s robbery to finance their escape from the country.');
INSERT INTO movies VALUES (33454, 'Scaramouche', '1952-05-08', 3005000, 115, 0, 'In 18th-century France, a young man masquerades as an actor to avenge his friend''s murder.');
INSERT INTO movies VALUES (33472, 'Abbott and Costello Go to Mars', '1953-04-05', NULL, 77, 0, 'Lester and Orville accidentally launch a rocket which is supposed to fly to Mars. Instead it goes to New Orleans for Mardi Gras. They are then forced by bank robber Mugsy and his pal Harry to fly to Venus where they find a civilization made up entirely of women, men having been banished.');
INSERT INTO movies VALUES (33474, 'Abbott and Costello in the Foreign Legion', '1950-08-05', NULL, 80, 0, 'Jonesy and Lou are in Algeria looking for a wrestler they are promoting. Sergeant Axmann tricks them into joining the Foreign Legion, after which they discover Axmann''s collaboration with the nasty Sheik Hamud El Khalid. Bits include Lou''s mirage sightings, one a New York newsboy ("they gave me a bad corner").');
INSERT INTO movies VALUES (33475, 'Abbott and Costello Meet the Invisible Man', '1951-03-07', NULL, 82, 0, 'Boxer Tommy Nelson is accused of killing his manager. While detectives Bud and Lou investigate they come across an invisibility formula with which Tommy injects himself rather than face the police. This sparks an idea for trapping gangster Morgan by having Lou fight champ Rocky Hanlon, with Tommy''s invisible help');
INSERT INTO movies VALUES (33476, 'Abbott and Costello Meet the Keystone Kops', '1955-01-01', 736, 80, 0, 'Harry and Willie are scammed into buying the Thomas Edison studio lot by a man named Gorman. They decide to follow Gorman''s trail to Hollywood where, unbeknownst to them, he has taken the identity of a foreign film director. The lads wind up as stunt doubles in film the which Gorman is now shooting, while the conman tries to have the bungling pair done away with before they realize who he really is.');
INSERT INTO movies VALUES (33575, 'Pat and Mike', '1952-06-13', NULL, 95, 0, 'Pat Pemberton (Hepburn) is a brilliant athlete, except when her domineering fiancé is around. The ladies golf championship is in her reach until she gets flustered by his presence at the final holes. He wants them to get married and forget the whole thing, but she cannot give up on herself that easily. She enlists the help of Mike Conovan (Tracy), a slightly shady sports promoter. Together they face mobsters, a jealous boxer (Aldo Ray), and a growing mutual attraction.');
INSERT INTO movies VALUES (33673, 'His Kind of Woman', '1951-08-29', NULL, 120, 0, 'Nick Ferraro, deported crime boss, needs to re-enter the USA. His plan involves "honest" gambler Dan Milner, who''s subjected to a series of "misfortunes," then bribed to take a trip to Mexico. En route, Dan meets chanteuse Lenore Brent, truly his kind of woman. But on arrival at posh Morros Lodge in Baja California, Dan finds the ostensibly rich, carefree guests all playing roles...except, possibly, ham actor Mark Cardigan. What does Ferraro want with him? Can he trust anyone?');
INSERT INTO movies VALUES (33743, 'The 5,000 Fingers of Dr. T.', '1953-07-01', NULL, 89, 0, 'Young Bart Collins lives with his widowed mother Heloise. The major blight on Bart''s existence is the hated piano lessons he is forced to endure under the tutelage of the autocratic Dr. Terwilliker. Bart feels that his mother has fallen under Terwilliker''s sinister influence, and gripes to visiting plumber August Zabladowski, without much result. While grimly hammering away at his lessons, Bart dozes off and enters a fantastical musical dream.');
INSERT INTO movies VALUES (33754, 'Scared Stiff', '1953-04-27', NULL, 108, 0, 'A nightclub singer and his partner escape mobsters by fleeing to Cuba with a beautiful heiress, who has inherited a haunted castle on an isolated island. The trio hunt for a hidden treasure and encounter a ghost, a zombie, and a mysterious killer...');
INSERT INTO movies VALUES (33814, 'Cast a Dark Shadow', '1955-09-20', NULL, 82, 0, 'Edward "Teddy" Bare killed his first wife (making it look like an accident) hoping to claim her inheritance, only to discover she didn''t have one. When another chance presents itself Bare plans to kill his next wife. But murder second time round is a bit more difficult.');
INSERT INTO movies VALUES (33839, 'Cheaper by the Dozen', '1950-03-31', NULL, 85, 0, '"Cheaper by the Dozen", based on the real-life story of the Gilbreth family, follows them from Providence, Rhode Island, to Montclair, New Jersey, and details the amusing anecdotes found in large families.');
INSERT INTO movies VALUES (33924, 'City That Never Sleeps', '1953-06-12', NULL, 90, 0, 'Chicago cop Johnny Kelly, dissatisfied with his job and marriage, would like to run away with his stripper girlfriend Angel Face, but keeps getting cold feet. During one crowded night, Angel Face decides she''s had enough vacillation, and crooked lawyer Biddel has an illegal mission for Johnny that could put him in a financial position to act. But other, conflicting schemes are also in progress...');
INSERT INTO movies VALUES (34000, 'The Million Pound Note', '1954-01-07', NULL, 90, 0, 'An impoverished American sailor is fortunate enough to be passing the house of two rich gentlemen who have conceived the crazy idea of distributing a note worth one million pounds. The sailor finds that whenever he tries to use the note to buy something, people treat him like a king and let him have whatever he likes for free. Ultimately, the money proves to be more troublesome than it is worth when it almost costs him his dignity and the woman he loves.');
INSERT INTO movies VALUES (34082, 'Road to Bali', '1952-01-01', NULL, 91, 0, 'Having to leave Melbourne in a hurry to avoid various marriage proposals, two song-and-dance men sign on for work as divers. This takes them to an idyllic island on the way to Bali where they vie with each other for the favours of Princess Lala. The hazardous dive produces a chest of priceless jewels which arouses the less romantic interest of some shady locals.');
INSERT INTO movies VALUES (34269, 'Across the Wide Missouri', '1951-10-01', NULL, 78, 0, 'In the 1830''s beaver trapper Flint Mitchell and other white men hunt and trap in the then unnamed territories of Montana and Idaho. Flint marries a Blackfoot woman as a way to gain entrance into her people''s rich lands, but finds she means more to him than a ticket to good beaver habitat.');
INSERT INTO movies VALUES (34623, 'Young Man with a Horn', '1950-02-09', NULL, 112, 0, 'Aimless youth Rick Martin learns he has a gift for music and falls in love with the trumpet. Legendary trumpeter Art Hazzard takes Rick under his wing and teaches him all he knows about playing. To the exclusion of anything else in life, Rick becomes a star trumpeter, but his volatile personality and desire to play jazz rather than the restricted tunes of the bands he works for lands him in trouble.');
INSERT INTO movies VALUES (34651, 'Devil''s Doorway', '1950-09-15', NULL, 84, 0, 'A Native American Civil War hero returns home to fight for his people.');
INSERT INTO movies VALUES (34652, 'Drive a Crooked Road', '1954-03-10', NULL, 83, 0, 'A mechanic gets caught up with the mob when he falls for a gangster''s girlfriend.');
INSERT INTO movies VALUES (34689, 'The Barefoot Contessa', '1954-01-01', NULL, 128, 0, 'Has-been director Harry Dawes gets a new lease on his career when independently wealthy Kirk Edwards hires him to write and direct a film. They go to Madrid to find Maria Vargas, a dancer who will star in the film. Millionaire Alberto Bravano takes Maria from Kirk. Count Vincenzo Torlato-Favrini takes Maria from Alberto.');
INSERT INTO movies VALUES (34752, 'The Glass Wall', '1953-03-19', NULL, 82, 0, 'Peter Kaban, a Hungarian refugee, is about to be deported after jumping ship in New York harbor. He needs to find an ex-G.I named Tom whom he helped during the war, as Tom.can prove Peter''s right to legal entry iof the United States. It is a race against the clock! If he can''t find Tom within 24 hours and prove his case, he will be branded a fugitive and will be permanently disqualified for U.S. citizenship.');
INSERT INTO movies VALUES (34857, 'Kiss Me Kate', '1953-11-26', NULL, 109, 0, 'Fred and Lilly are a divorced pair of actors who are brought together by Cole Porter who has written a musical version of The Taming of the Shrew. Of course, the couple seem to act a great deal like the characters they play. A fight on the opening night threatens the production, as well as two thugs who have the mistaken idea that Fred owes their boss money and insist on staying next to him all night.');
INSERT INTO movies VALUES (34933, 'Bully for Bugs', '1953-08-08', NULL, 7, 0, 'Bugs Bunny once again making that "wrong turn at Albuquerque" burrows into a bullring, where a magnificent bull is making short work of a toreador. The bull bucks Bugs out of the arena, prompting the bunny to declare "Of course you realize, this means war!" The deft Bugs'' arsenal comes plenty packed, as he uses anvils, well-placed face slaps and the bull''s horns as a slingshot. The bull fights back, using his horns as a shotgun barrel. The bull''s comeback is short-lived; just after Bugs makes out his will, he lures the bull out of the arena, just in time to set up a rube-like device that leads to the bull''s defeat.');
INSERT INTO movies VALUES (35009, 'Storm Warning', '1951-02-10', NULL, 93, 0, 'Ginger Rogers is troubled when she finds her sister''s husband is a member of the KKK.');
INSERT INTO movies VALUES (37954, 'The Breaking Point', '1950-10-06', NULL, 97, 0, 'Based on the Hemingway novel To Have and Have Not. A fisherman with money problems hires out his boat to transport criminals.');
INSERT INTO movies VALUES (35023, 'Two of a Kind', '1951-07-01', NULL, 75, 0, 'Brandy Kirby (Lizabeth Scott ) and crooked Lawyer Vincent Mailer (Alexander Knox) plan to rob William (Griff Barnett) and Maida McIntyre (Virginia Brissac) by producing a convincing double for their long-lost son. Brandy charms gambler Lefty Farrell (Edmond O''Brien) into impersonating the missing son.');
INSERT INTO movies VALUES (35073, 'The Beast from 20,000 Fathoms', '1953-06-13', 210000, 80, 0, 'The Beast from 20,000 Fathoms is a 1953 science fiction film directed by Eugene Lourié and stars Paul Christian, Paula Raymond and Cecil Kellaway with visual effects by Ray Harryhausen. The film is about an atomic bomb test in the Arctic Circle that unfreezes a hibernating fictional dinosaur, a Rhedosaurus, that begins to wreak havoc in New York City.');
INSERT INTO movies VALUES (35115, 'Davy Crockett, King of the Wild Frontier', '1955-05-25', NULL, 93, 0, 'Legends (and myths) from the life of famed American frontiersman Davey Crockett are depicted in this feature film edited from television episodes. Crockett and his friend George Russell fight in the Creek Indian War. Then Crockett is elected to Congress and brings his rough-hewn ways to the House of Representatives. Finally, Crockett and Russell journey to Texas and the last stand at the Alamo.');
INSERT INTO movies VALUES (35404, 'The File on Thelma Jordon', '1950-01-18', NULL, 100, 0, 'A woman seduces a District Attorney and pulls him into a web of theft and murder.');
INSERT INTO movies VALUES (35580, 'The Bridges at Toko-Ri', '1954-12-01', NULL, 102, 0, 'A naval aviator is assigned to bomb a group of heavily defended bridges during the Korean War.');
INSERT INTO movies VALUES (35692, 'The Black Knight', '1954-08-26', NULL, 85, 0, 'John (Alan Ladd), a blacksmith and swordsmith, is tutored at Camelot. As a commoner, he can''t hope to win the hand of Lady Linet (Patricia Medina), daughter of the Earl of Yeoniland (Harry Andrews), so he creates a secret alternate identity as the Black Knight. In this new role, he is now able to help King Arthur when Saracens and Cornish men—disguised as Vikings -- plot to take over the country.');
INSERT INTO movies VALUES (35793, 'Penny Points to Paradise', '1951-01-01', NULL, 77, 0, 'When Harry and Spike visit Bristol to spend the winnings from Harry''s latest Pools win, the boys are soon targeted by a gang of local counterfeiters.');
INSERT INTO movies VALUES (35911, 'Cult of the Cobra', '1955-05-30', NULL, 82, 0, 'While stationed in Asia, six American G.I.''s witness the secret ritual of Lamians (worshipers of women who can change into serpents). When discovered by the cult, the High Lamian Priest vows that "the Cobra Goddess will avenge herself". Once back in the United States, a mysterious woman enters into their lives and accidents begin to happen. The shadow of a cobra is seen just before each death.');
INSERT INTO movies VALUES (35919, 'Creature with the Atom Brain', '1955-07-01', NULL, 69, 0, 'A gangster enlists a mad Nazi scientist to create an army of atomic zombies.');
INSERT INTO movies VALUES (35956, 'The Phenix City Story', '1955-08-14', NULL, 100, 0, 'Phil Karlson''s docudrama based on the notorious Phenix City -- a city known for its gambling, crime and prostitution rackets.');
INSERT INTO movies VALUES (35957, 'Dial 1119', '1950-11-03', NULL, 75, 0, 'A killer holds the customers at a bar hostage.');
INSERT INTO movies VALUES (35958, 'New York Confidential', '1955-02-15', NULL, 87, 0, 'Story follows the rise and subsequent fall of the notorious head of a New York crime family, who decides to testify against his pals in order to avoid being killed by his fellow cohorts.');
INSERT INTO movies VALUES (36331, 'Dark City', '1950-10-17', NULL, 98, 0, 'Danny Haley''s bookie operation is shut down, so he and his pals need money; when Danny meets Arthur Winant, a sucker from out of town, he decoys him into a series of poker games where eventually Winant loses $5000 that isn''t his... then hangs himself. But it seems Winant had a shadowy, protective elder brother who believes in personal revenge.');
INSERT INTO movies VALUES (36334, 'Deadline - U.S.A.', '1952-03-14', NULL, 87, 0, 'With three days before his paper folds, a crusading editor tries to expose a vicious gangster.');
INSERT INTO movies VALUES (36339, 'Double Confession', '1950-04-01', NULL, 80, 0, 'The hero discovers his estranged wife dead and tries to frame her lover for the murder. He becomes involved with the criminals who make various unsuccessful attempts on his life while the police clear up the mystery.');
INSERT INTO movies VALUES (36373, 'M', '1951-03-01', NULL, 88, 0, 'Remake of the 1931 original. In the city, someone is murdering children. The Police search is so intense, it is disturbing the ''normal'' criminals, and the local hoods decide to help find the murderer as quickly as possible.');
INSERT INTO movies VALUES (36375, 'Edge of Doom', '1950-08-03', NULL, 99, 0, 'A priest sets out to catch the man who killed one of his colleagues.');
INSERT INTO movies VALUES (36439, 'Tuntematon sotilas', '1955-12-23', NULL, 181, 55, 'It is the summer of 1941. An eastern-Finnish machine gun company receives an order to turn in their surplus equipment. The company is transferred to the front lines. The next morning the soldiers wake to the sound of guns - the war has begun. The Finnish troops attack and quickly move across the border. The young, nervous rookies of the company get their baptism of fire, and the men become familiar with death and the hardships of war. Under strength and badly equipped they fight a superior enemy. The lists of heroes and of the dead seem endless. Edvin Laine''s epic interpretation of Väinö Linna''s war novel "Tuntematon Sotilas" is an entire chapter in the book of Finnish movie history.');
INSERT INTO movies VALUES (36489, 'Bride of the Monster', '1955-05-11', NULL, 69, 0, 'Dr. Varnoff captures twelve men for his experiment: to turn them into supermen using atomic energy. Newspaperwoman Lawton gets too snoopy for her own good.');
INSERT INTO movies VALUES (36516, 'One Way Street', '1950-04-01', NULL, 79, 0, 'After stealing a gangster''s money and his girlfriend, a doctor heads for a small village in Mexico to hide out.');
INSERT INTO movies VALUES (36520, 'Playgirl', '1954-04-21', NULL, 85, 0, 'If you remember Shelley Winters from "The Poseidon Adventure" or "Bloody Mama," you might tend to forget what a knockout she was early in her career. This film will give you the chance to see her as a sexy nightclub singer teaching her just-in-from-the-sticks friend Colleen Miller the ropes in New York City. When Winters finds out that her married boyfriend Barry Sullivan has fallen for Miller, the recriminations...and bullets...start to fly!');
INSERT INTO movies VALUES (36522, 'Private Hell 36', '1954-09-03', NULL, 81, 0, 'Two LA detectives get in over their heads when they get involved with a nightclub singer who holds the key to the missing loot from a New York elevator robbery. Once they find the money, they are tempted to keep it and betrayal and corruption come to run the order of things.');
INSERT INTO movies VALUES (36554, 'The Desert Rats', '1953-05-20', NULL, 88, 0, 'Richard Burton plays a Scottish Army officer put in charge of a disparate band of ANZAC troops on the perimeter of Tobruk with the German Army doing their best to dislodge them');
INSERT INTO movies VALUES (36634, 'The People Against O''Hara', '1951-09-01', NULL, 102, 0, 'A defense attorney jeopardizes his career to save his client.');
INSERT INTO movies VALUES (40642, 'The Secret of Convict Lake', '1951-08-03', NULL, 83, 0, 'Prison inmates escape but-- after a difficult drudge through the woods-- find themselves snowed in with a town populated only by women.');
INSERT INTO movies VALUES (36922, 'Der Untertan', '1951-08-31', NULL, 109, 3, 'Diederich Heßling is scared of everything and everyone. But as he grows up, he comes to realize that he has to offer his services to the powers-that-be if he wants to wield power himself. His life motto now runs: bow to those at the top and tread on those below. In this way, he always succeeds: as a student in a duel-fighting student fraternity and as a businessman in a paper factory. He cajoles the obese district administrative president Von Wulkow and wins his favor. He slanders his financial rivals and hatches a plot with the social democrats in the town council. On his honeymoon with his rich wife Guste, he finally finds a chance to do his beloved Kaiser a favor. And when a memorial to the Kaiser is unveiled in the town where Diederich lives and works, he delivers the address. He stands behind the lectern in the pouring rain, saluting his Kaiser. The crowd is dispersed. Everything is laid in ruins...');
INSERT INTO movies VALUES (36949, '99 River Street', '1953-03-10', NULL, 83, 0, 'A former boxer --now taxi driver-- gets mixed up with jewel thieves.');
INSERT INTO movies VALUES (37084, 'The Big Night', '1951-11-13', NULL, 75, 0, 'A film noir treatise about the coming of age of a young man is beautifully realized by the great Joseph Losey. John Drew Barrymore zigzags through the sordid vortex of downtown Los Angeles while seeking vengeance on the man who beat his Father. This superbly crafted “trial by fire” tale with memorable dialogue and shaded photography co-stars Preston Foster, Joan Lorring, Harold St. John and Dorothy Comingore');
INSERT INTO movies VALUES (37087, '711 Ocean Drive', '1950-07-01', NULL, 102, 0, 'The Horatio Alger parable gets the film noir treatment with the redoubtable Edmund O’Brien as a whip-smart telephone technician who moves up the ladder of a Syndicate gambling empire in Southern California until distracted by an inconveniently married Joanne Dru and his own greed. Ripped from the headlines of the 1950 Kevaufer Organized Crime Hearings, this fast-moving picture is laden with location sequences shot in Los Angeles, the Hoover Dam and Palm Springs including the famous Doll House watering hole on North Palm Canyon Drive!');
INSERT INTO movies VALUES (37126, 'Impulse', '1954-01-01', NULL, 80, 0, 'An American realtor living in England is dissatisfied with what he believes to be his humdrum life. One weekend while his wife is out of town, he gives a ride to a woman he sees stranded on the road. One thing leads to another, and he soon finds himself enmeshed in a plot involving a diamond robbery, gangsters and murder.');
INSERT INTO movies VALUES (37183, 'The Glass Web', '1953-11-11', NULL, 81, 0, 'The ice-cold diva Paula ruthlessly exploits the guys she dates. While blackmailing the married Don with a recent one-night-stand, she has a secret affair with Henry, who works as researcher for the weekly authentic TV show "Crime of the Week", which Don writes for. When Henry fails to help her to a role, she insults him deadly... and ends up dead herself. Now Don desperately tries to hide his traces, but Henry sabotages his efforts and suggests he write the unsolved murder case for next week''s show...');
INSERT INTO movies VALUES (37198, 'Inferno', '1953-08-12', 1055000, 83, 0, 'A spoiled and alcoholic millionaire, Robert Ryan, breaks his leg falling off of a horse, and is left to die in the desert by his cheating wife, Rhonda Fleming, and her lover, William Lundigan.');
INSERT INTO movies VALUES (37214, 'Go for Broke!', '1951-05-04', NULL, 92, 0, 'A tribute to the U.S. 442nd Regimental Combat Team, formed in 1943 by Presidential permission with Japanese-American volunteers. We follow the training of a platoon under the rueful command of Lt. Mike Grayson who shares common prejudices of the time. The 442nd serve in Italy, then France, distinguishing themselves in skirmishes and battles; gradually and naturally, Grayson''s prejudices evaporate with dawning realization that his men are better soldiers than he is.');
INSERT INTO movies VALUES (37292, 'Broken Arrow', '1950-08-01', NULL, 93, 0, 'Indian scout Tom Jeffords (James Stewart) is sent out to stem the war between the Whites and Apaches in the late 1870s. He learns (through an uncomfortably close encounter) that the Indians kill only to protect themselves, or out of retaliation for white atrocities.');
INSERT INTO movies VALUES (37317, 'The Tall Men', '1955-09-22', NULL, 122, 0, 'Two brothers, Ben and Clint, join a cattle drive from Texas to Montana. While heading for Texas they save Nella from the Indians, and she decides to ride with them. Ben and Nella start to get romantic, but Ben isn''t ambitious enough for her, and she soon meets up with the boss of the cattle drive. Will she make the right choice, and, more importantly, will the cattle make it to Montana !');
INSERT INTO movies VALUES (37327, 'Wagon Master', '1950-04-19', NULL, 86, 0, 'Two young drifters guide a Mormon wagon train to the San Juan Valley and encounter cutthroats, Indians, geography, and moral challenges on the journey.');
INSERT INTO movies VALUES (37329, 'The Baron of Arizona', '1950-03-04', NULL, 97, 0, 'The U.S. government recognizes land grants made when the West was under Spanish rule. This inspires James Reavis to forge a chain of historical evidence that makes a foundling girl the Baroness of Arizona. Reavis marries the girl and presses his claim to the entire Arizona territory.');
INSERT INTO movies VALUES (37340, 'The Man Who Watched Trains Go By', '1952-12-01', NULL, 82, 0, 'A meek teller thinks he''s killed his boss. He flees with a box of cash hoping for a new life with his younger mistress.');
INSERT INTO movies VALUES (37380, 'Thunder Bay', '1953-05-21', NULL, 103, 0, 'Shrimpers and oilmen clash when an ambitious wildcatter begins constructing an off-shore oilrig.');
INSERT INTO movies VALUES (37408, 'Vicki', '1953-10-05', NULL, 85, 0, 'A supermodel gets murdered. While investigating the case the story of a waitress turned glamor girl is revealed.');
INSERT INTO movies VALUES (37413, 'Down Three Dark Streets', '1954-09-02', NULL, 85, 0, 'An FBI Agent takes on the three unrelated cases of a dead agent to track down his killer.');
INSERT INTO movies VALUES (37463, 'Phantom of the Rue Morgue', '1954-03-27', NULL, 83, 0, 'One of many films based on the mysterious tale written by Edger Allen Poe.');
INSERT INTO movies VALUES (37468, 'The Big Lift', '1950-04-26', NULL, 120, 0, 'The Berlin Air Lift from the point of view of two NCOs.');
INSERT INTO movies VALUES (37628, 'Ensayo de un crimen', '1955-01-01', NULL, 89, 2, 'A bizarre black comedy about a man whose overwhelming ambition in life is to be a renowned serial killer of women, and will stop at nothing to achieve it - but not everything goes according to plan...');
INSERT INTO movies VALUES (37635, 'Witness to Murder', '1954-04-15', NULL, 83, 0, 'A woman fights to convince the police that she witnessed a murder while looking out her bedroom window.');
INSERT INTO movies VALUES (37744, 'Rocketship X-M', '1950-06-02', NULL, 77, 0, 'Astronauts blast off to explore the moon on Rocketship X-M or "Rocketship eXploration Moon". A spacecraft malfunction and some fuel miscalculations cause them to end up landing on Mars. On Mars, evidence of a once powerful civilization is found. The scientists determined that an atomic war destroyed most of the Martians. Those that survived reverted to a caveman like existence.');
INSERT INTO movies VALUES (37853, 'Mister Roberts', '1955-07-13', NULL, 123, 0, 'A hilarious and heartfelt military comedy-drama co-directed by John Ford and Mervyn LeRoy, Mister Roberts stars Henry Fonda as an officer who''s yearning for battle but is stuck in the backwaters of World War II on a noncommissioned Navy ship run by the bullying Capt. Morton (James Cagney). Jack Lemmon enjoys a star-making turn as the freewheeling Ensign Pulver, and William Powell stars as the ship''s doctor in his last screen role.  Based on the 1946 novel with the same name, by Thomas Heggen, and the 1948 Broadway play, written by Thomas Heggen and Joshua Logan. Henry Fonda also starred in the original Broadway production. Warner Bros. didn''t want Fonda to star in the film, as they thought he was too old, and had been a stage player for so long (8 years), that he no longer was box office material. However, John Ford insisted on Fonda and the company eventually agreed.');
INSERT INTO movies VALUES (38382, 'Man of the Moment', '1955-01-01', NULL, 85, 0, 'Norman is a file clerk who accidentally becomes a British delegate to a diplomatic conference, befriends the queen of a remote island, and winds up a knight. Norman leaves rooms in shambles, tailors in shreds, and diplomats in bandages. Chased by gunmen and assassins of foreign powers, Norman finds himself running through active TV studio sets and interrupts various programs and performances in progress');
INSERT INTO movies VALUES (38404, 'Bela Lugosi Meets a Brooklyn Gorilla', '1952-09-04', NULL, 74, 0, 'Two goofy entertainers meet a mad scientist on a jungle island.');
INSERT INTO movies VALUES (38417, 'The Thief', '1952-10-15', NULL, 85, 0, '1952 black and white Cold War spy film, entirely without dialog');
INSERT INTO movies VALUES (38688, 'Pandora and the Flying Dutchman', '1951-02-15', NULL, 122, 0, 'Albert Lewin''s interpretation of the legend of the Flying Dutchman. In a little spanish seaport named Esperanza, during the 30s, appears Hendrick van der Zee, the mysterious captain of a yacht (he is the only one aboard). Pandora is a beautiful woman (who men kill and die for). She''s never really fallen in love with any man, but she feels very attracted by Hendrick... We are soon taught that Hendrick is the Flying Dutchman, this sailor of the 17th century that has been cursed by God to wander over the seas until the Doomsday... unless a woman is ready to die for him...');
INSERT INTO movies VALUES (38732, 'Bend of the River', '1952-02-13', NULL, 91, 0, 'Two men with questionable pasts, Glyn McLyntock and his friend Cole, lead a wagon-train load of homesteaders from Missouri to the Oregon territory...');
INSERT INTO movies VALUES (38751, 'The Man Who Cheated Himself', '1950-12-26', NULL, 81, 0, 'A veteran homicide detective who has witnessed his socialite girlfriend kill her husband sees his inexperienced brother assigned to the case.');
INSERT INTO movies VALUES (38766, 'Halls of Montezuma', '1951-01-04', NULL, 113, 0, 'Richard Widmark leads an all star cast of marine leathernecks including Jack Palance, Robert Wagner, Karl Malden, Richard Boone and Jack Webb into battle on a heavily fortified island. This action-packed story follows the squad as they pick their way through enemy-infested jungles on a time sensitive mission to find the source of the enemy rockets. As the mission progresses, the squad and leader overcome many challenges as they are transformed into an effective and efficient fighting unit.');
INSERT INTO movies VALUES (38808, 'The Man from the Alamo', '1953-08-07', NULL, 79, 0, 'During the war for Texas independence, one man leaves the Alamo before the end (chosen by lot to help others'' families) but is too late to accomplish his mission, and is branded a coward. Since he cannot now expose a gang of turncoats, he infiltrates them instead. Can he save a wagon train of refugees from Wade''s Guerillas?');
INSERT INTO movies VALUES (38962, 'Murder by Proxy', '1954-03-19', NULL, 87, 0, 'When a beautiful girl offers Casey Morrow a lot of money for a mystery job, Morrow doesn''t ask too many questions. But when the girl''s father is found murdered the following day and Morrow''s coat is soaked with blood perhaps a little more caution should have been exercised. An intriguing story of deception, greed and immorality.');
INSERT INTO movies VALUES (38964, 'Stolen Face', '1952-05-01', NULL, 72, 0, 'A doctor changes a woman''s face to match the one that broke his heart. Trouble starts when his love returns.');
INSERT INTO movies VALUES (39015, 'Sailor Beware', '1952-02-08', NULL, 108, 0, 'Meeting in a navy recruiting line, Al Crowthers (Dean Martin) and Melvin Jones (Jerry Lewis) become friends. Al has tried to enlist before, but was always rejected. He keeps trying so that he can impress women. Melvin, is allergic to women''s cosmetics and his doctor prescribed ocean travel, so he decided to join the navy.');
INSERT INTO movies VALUES (39016, 'Living It Up', '1954-07-15', NULL, 95, 0, 'Homer Flagg (Lewis) is a railroad worker in the small town of Desert Hole, New Mexico. One day he finds an abandoned automobile at an old atomic proving ground. His doctor and best friend, Steve Harris (Martin), diagnoses him with radiation poisoning and gives Homer three weeks to live. A reporter for a New York newspaper, hears of Homer''s plight and convinces her editor, to provide an all-expenses paid trip to New York.');
INSERT INTO movies VALUES (39284, 'Till glädje', '1950-02-20', NULL, 98, 25, 'To Joy (Swedish: Till glädje) is a 1950 Swedish film directed by Ingmar Bergman about a young married couple who play together in a Swedish orchestra.');
INSERT INTO movies VALUES (39288, 'Morning Departure', '1950-02-21', NULL, 97, 0, 'The crew of a submarine is trapped on the sea floor when it sinks. How can they be rescued before they run out of air?');
INSERT INTO movies VALUES (39306, 'The 13th Letter', '1951-02-21', NULL, 85, 0, 'The English-language remake of the French classic Le corbeau. Michael Rennie plays a doctor at a Canadian hospital who receives a series of poison pen letters. Soon these letters are sent to others which leads to tension amongst the inhabitants of the small Canadian town.');
INSERT INTO movies VALUES (39409, 'The Strange Door', '1951-06-21', NULL, 81, 0, 'The wicked Alain plots an elaborate revenge against his younger brother Edmund, leading to a deadly confrontation in his dungeon deathtrap.');
INSERT INTO movies VALUES (39485, 'Hotel Sahara', '1951-12-31', NULL, 96, 0, 'World War II farce about the hotel of the title');
INSERT INTO movies VALUES (39834, 'Violent Saturday', '1955-04-01', NULL, 90, 0, 'Three men case a small town very carefully, with plans to rob the bank on the upcoming Saturday, which turns violent and deadly.');
INSERT INTO movies VALUES (39940, 'Picnic', '1955-11-18', NULL, 115, 0, 'The morning of a small town Labor Day picnic, a drifter (Hal Carter) blows into town to visit an old fraternity buddy (Alan Benson) who also happens to be the son of the richest man in town. Hal is an egocentric braggart - all potential and no accomplishment. He meets up with Madge Owens, the town beauty queen and girlfriend of Alan Benson.');
INSERT INTO movies VALUES (39946, 'The Browning Version', '1951-04-06', NULL, 90, 0, 'On the last day of term at a boys private school, a new master arrives to familiarise himself. His predecessor, Crocker-Harris, is much hated in the school, but his younger wife seems more popular, and not only with the pupils. Tensions erupt making this a day nobody in the school will ever forget...');
INSERT INTO movies VALUES (40165, 'Salome', '1953-03-24', NULL, 103, 0, 'In the reign of emperor Tiberius, Gallilean prophet John the Baptist preaches against King Herod and Queen Herodias. The latter wants John dead, but Herod fears to harm him due to a prophecy. Enter beautiful Princess Salome, Herod''s long-absent stepdaughter. Herodias sees the king''s dawning lust for Salome as her means of bending the king to her will. But Salome and her lover Claudius are (contrary to Scripture) nearing conversion to the new religion. And the famous climactic dance turns out to have unexpected implications...');
INSERT INTO movies VALUES (40577, 'Island in the Sky', '1953-09-05', NULL, 109, 0, 'A C-47 transport plane, named the Corsair, makes a forced landing in the frozen wastes of Labrador, and the plane''s pilot, Captain Dooley, must keep his men alive in deadly conditions while waiting for rescue.');
INSERT INTO movies VALUES (40578, 'The Sea Chase', '1955-06-04', NULL, 117, 0, 'As the Second World War breaks out, German freighter captain Karl Ehrlich is about to leave Sydney, Australia with his vessel, the Ergenstrasse. Ehrlich, an anti-Nazi but proud German, hopes to outrun or out-maneuver the British warship pursuing him. Aboard his vessel is Elsa Keller, a woman Ehrlich has been ordered to return to Germany safely along with whatever secrets she carries. When Ehrlich''s fiercely Nazi chief officer Kirchner commits an atrocity, the British pursuit becomes deadly.');
INSERT INTO movies VALUES (40633, 'Love Me or Leave Me', '1955-06-10', NULL, 122, 0, 'Story of torch singer Ruth Etting''s rise from 1920s taxi dancer to movie star, simultaneously aided and frustrated by Chicago mobster Marty Sydney''s headstrong ways and pressure tactics');
INSERT INTO movies VALUES (40683, 'Operation Pacific', '1951-01-27', NULL, 111, 0, 'During WWII, Duke E. Gifford is second in command of the USS Thunderfish, a submarine which is firing off torpedoes that either explode too early or never explode at all. It''s a dilemma that he''ll eventually take up personally. Even more personal is his quest to win back his ex-wife, a nurse; but he''ll have to win her back from a navy flier who also happens to be his commander''s little brother.');
INSERT INTO movies VALUES (40693, 'April in Paris', '1952-12-24', NULL, 94, 0, 'In search of an emissary to represent the American theater at an arts expo in Paris, a State Department bureaucrat (Ray Bolger) invites Ethel Barrymore to appear -- too bad her invitation is sent to chorus girl Ethel "Dynamite" Jackson (Doris Day) instead! Not one to look a gift horse in the mouth, Miss Jackson hightails it to Paris -- with the bureaucrat in pursuit. A plethora of song-and-dance numbers ensues in this Sammy Cahn-scored musical.');
INSERT INTO movies VALUES (40715, 'Big Jim McLain', '1952-08-30', NULL, 90, 0, 'House Un-American Activities Committee investigators Jim McLain and Mal Baxter come to post war Hawaii to track Communist Party activities even though belonging to the party was legal at the time. They are interested in everything from insurance fraud to the sabotage of a U.S. naval vessel.');
INSERT INTO movies VALUES (40744, 'Wicked Woman', '1953-12-09', NULL, 77, 0, 'A trashy blonde lures a saloon owner away from his wife.');
INSERT INTO movies VALUES (40761, 'Revenge of the Creature', '1955-07-22', NULL, 82, 0, 'Men capture the creature from the Black Lagoon and make him an aquarium attraction, from which he escapes.');
INSERT INTO movies VALUES (40767, 'No Man of Her Own', '1950-02-21', NULL, 98, 0, 'A penniless pregnant woman takes over the identity of a rich woman killed in a train crash.');
INSERT INTO movies VALUES (40790, 'Secret of the Incas', '1954-06-06', NULL, 100, 0, 'A daring adventurer searches Peruvian jungles for ancient treasure.  Before Indiana Jones there was Harry Steele (Charlton Heston), an idealistic archaeologist determined to return an ancient Incan mask to the society from which it came. A greedy con-artist (Robert Young) has other ideas, though, and the two men race to fund an expedition to find the treasure, which has reportedly been buried by Spanish conquistadores somewhere in Machu Picchu. The con-artist (Young) seduces a beautiful tourist in order to reach his goal, leaving Steele (Heston) to locate the site through more honorable means.  Twenty-seven years before directors George Lucas and Steven Spielburg collaborated to create Indiana Jones: Raiders of the Lost Ark, Jerry Hopper directed Secret of the Incas.');
INSERT INTO movies VALUES (40858, 'The Underworld Story', '1950-07-26', NULL, 91, 0, 'A blacklisted reporter brings his shady ways to a small-town newspaper after being fired from a big city daily.');
INSERT INTO movies VALUES (41018, 'Man in the Attic', '1953-12-23', NULL, 82, 0, 'London, 1888: on the night of the third Jack the Ripper killing, soft-spoken Mr. Slade, a research pathologist, takes lodgings with the Harleys, including a gloomy attic room for "experiments." Mrs. Harley finds Slade odd and increasingly suspects the worst; her niece Lily (star of a decidedly Parisian stage revue) finds him interesting and increasingly attractive. Is Lily in danger, or are her mother''s suspicions merely a red herring?');
INSERT INTO movies VALUES (41030, 'The Snow Creature', '1954-11-01', NULL, 71, 0, 'A botanical expedition to the Himalayas captures a Yeti and brings it back alive to Los Angeles, where it escapes and runs amok, seeking food.');
INSERT INTO movies VALUES (41084, 'Champagne For Caesar', '1950-05-11', NULL, 99, 0, 'What happens when the man who knows everything goes on a quiz show that doubles your cash prize every time a you answer a question correctly? Beauregard Bottomly is that man &amp; what happens is you end up with 40 million dollars at stake.');
INSERT INTO movies VALUES (41204, 'On Moonlight Bay', '1951-07-26', NULL, 95, 0, 'The Winfield family moves into a new house in a small town in Indiana. Tomboy Marjorie Winfield begins a romance with William Sherman who lives across the street. Marjorie has to learn how to dance and act like a proper young lady. Unfortunately William Sherman has unconventional ideas for the time. His ideas include not believing in marriage or money, which causes friction with Marjorie''s father, who is the local bank vice president');
INSERT INTO movies VALUES (41312, 'Angels One Five', '1952-03-19', NULL, 98, 0, 'The summer of 1940, Pilot Officer T.B. Baird arrives straight out of flight school to join a front line RAF squadron at the height of the Battle of Britain. After an unfortunate start and a drumming down from his commanding officer, Baird (nicknamed ''Septic'' due to his initials) must balance the struggle to impress his Group Captain, regain his pride, fit in with his fellow squadron mates, and survive one of the most intense air battles in history. This is the story of just one of "The Few" and how they managed to fight off the might of the Luftwaffe, despite overwhelming German air power.');
INSERT INTO movies VALUES (41462, 'The Hitch-Hiker', '1953-10-16', NULL, 71, 0, 'Two fishermen pick up a psychotic escaped convict who tells them that he intends to murder them when the ride is over.');
INSERT INTO movies VALUES (41468, 'Last of the Comanches', '1953-02-01', NULL, 85, 0, 'It''s 1876 and all the Indians are at peace except the Comanches lead by Black Cloud. When Black Cloud wipes out a town, only six soldiers are left and they head for the nearest fort. In the desert they are reinforced by members of a stagecoach and find some water at a deserted mission. Pinned down by Black Cloud they send an Indian boy who was Black Cloud''s prisoner on to the fort while they try to bargain with Black Cloud whom they learn is without water.');
INSERT INTO movies VALUES (41503, 'Three Coins in the Fountain', '1954-05-01', NULL, 102, 0, 'American girls dream of finding romance in Rome, but there is none for secretaries, Anita tells her replacement at the USDA. But Maria soon meets Prince Dino de Cessi at a party at her boss''s home who invites her to fly to Venice in his private plane. Frances, who has been in Rome for 15 years as the secretary of a successful American writer who talks a lot like George Bernard Shaw and is just as elusive as Professor Henry Higgins in "My Fair Lady," tells her at first to say "no" and then decides that together they can handle the man nicknamed the predatory prince. Coins tossed in the Trevi Fountain can indeed work magic.');
INSERT INTO movies VALUES (41552, 'Black Hand', '1950-03-12', NULL, 92, 0, 'In turn-of-the-century New York, an Italian seeks vengeance on the mobsters who killed his father.');
INSERT INTO movies VALUES (41591, 'The Scarf', '1951-04-06', NULL, 93, 0, 'John Ireland stars in this thriller as a man who breaks out of an asylum for the criminally insane, where he has been committed for strangling a girl with a scarf.');
INSERT INTO movies VALUES (41611, 'Jeopardy', '1953-03-30', NULL, 69, 0, 'A woman is kidnapped when she goes to get help for her husband who is trapped on a beach with the tide coming in to surely drown him.');
INSERT INTO movies VALUES (136336, 'The Long Dark Hall', '1951-02-06', NULL, 86, 0, 'A devoted family man tries to help a beautiful alcoholic showgirl with her life, and becomes the the only suspect when someone else murders her.');
INSERT INTO movies VALUES (41800, 'Superman and the Mole-Men', '1951-11-23', 275000, 58, 0, 'Reporters Clark Kent and Lois Lane arrive in the small town of Silsby to witness the drilling of the world''s deepest oil well. The drill, however, has penetrated the underground home of a race of small, furry people who then come to the surface at night to look around. The fact that they glow in the dark scares the townfolk, who form a mob, led by the vicious Luke Benson, intent on killing the strange people. Only Superman has a chance to prevent this tragedy.');
INSERT INTO movies VALUES (42328, 'Broken Lance', '1954-09-25', NULL, 96, 0, 'Cattle baron Matt Devereaux raids a copper smelter that is polluting his water, then divides his property among his sons. Son Joe takes responsibility for the raid and gets three years in prison. Matt dies from a stroke partly caused by his rebellious sons and when Joe gets out he plans revenge.');
INSERT INTO movies VALUES (42343, 'Geordie', '1955-09-02', NULL, 95, 0, 'Concerned about his small stature, a young Scottish boy applies for a mail-order body building course, successfully gaining both height and strength. The film was released as "Wee Geordie" in the USA.');
INSERT INTO movies VALUES (42502, 'El bruto', '1953-02-05', NULL, 81, 2, 'A tough young man, who helps to kick poor people out of their houses, falls in love with a girl. She lives with her father in the building about to be demolished.');
INSERT INTO movies VALUES (42564, 'Land of the Pharaohs', '1955-07-24', NULL, 105, 0, 'In ancient Egypt the Pharaoh Khufu is obsessed with acquiring gold and plans to take it all with him into the "second life." To this end he enlists the aid of Vashtar, an architect whose people are enslaved in Egypt. The deal: build a robbery-proof tomb and the enslaved people will be freed. During the years that the pyramid is being built a Cyprian princess becomes the pharaoh''s second wife, and she plots to prevent Khufu from taking his treasure with him when he dies .. as well as helping him make the journey early.');
INSERT INTO movies VALUES (42567, 'David and Bathsheba', '1951-08-10', NULL, 123, 0, 'David and Bathsheba is a 1951 historical epic film about King David made by 20th Century Fox. It was directed by Henry King, produced by Darryl F. Zanuck, from a screenplay by Philip Dunne. The music score was by Alfred Newman and the cinematography by Leon Shamroy. King David was the second king of Israel and this film is based on the second Old Testament book of Samuel from the Bible. Gregory Peck stars as King David and the film follows King David''s life as he adjusts to ruling as a King, and about his relationship with Uriah''s wife Bathsheba (Susan Hayward). It was shot entirely in Nogales, Arizona. Goliath of Gath was portrayed by a Polish wrestler named Wladyslaw Talun.');
INSERT INTO movies VALUES (42767, 'Three Little Words', '1950-07-12', NULL, 102, 0, 'Song-and-dance man Bert Kalmar can''t continue his stage career after an injury for while, so he has to earn his money as a lyricst. Per chance he meets composer Harry Ruby and their first song is a hit. Ruby gets Kalmar to marry is former partner Jessie Brown, and Kalmar and Jessie prevent Ruby from getting married to the wrong girls. But due to the fact, that Ruby has caused a backer''s withdrawal for a Kalmar play, they end their relation.');
INSERT INTO movies VALUES (43188, 'The Pride of St. Louis', '1952-01-01', NULL, 93, 0, 'The story of Jerome "Dizzy" Dean, a major-league baseball pitcher for the St. Louis Cardinals and Chicago Cubs in the 1930s and 1940s.');
INSERT INTO movies VALUES (43189, 'Million Dollar Mermaid', '1952-12-04', NULL, 115, 0, 'Biopic of Australian swimming champ and entertainer Annette Kellerman. After overcoming polio, Kellerman achieves fame and creates a scandal when her one-piece bathing suit is considered indecent.');
INSERT INTO movies VALUES (43191, 'Beware, My Lovely', '1952-08-07', NULL, 77, 0, 'A psychopath takes a job as a handyman at the house of a lonely widow.');
INSERT INTO movies VALUES (43192, 'Houdini', '1953-07-02', NULL, 106, 0, 'By the early 1900s, the extraordinary Houdini earned an international reputation for his theatrical tricks and daring feats of extrication from shackles, ropes, handcuffs, and Scotland Yard''s jails... The film depicts Houdini''s memorable escape from any pair of handcuffs produced by the audience; the outdoor exhibition, when he allows himself to be hanged upside down from his ankles, suspended from the roof of a high building, in a strait jacket; and, the dramatic act, when he accepts to be shackled with irons and placed in a box that is locked, roped, and submerged in frozen waters...');
INSERT INTO movies VALUES (43193, 'Dangerous When Wet', '1953-07-03', NULL, 95, 0, 'The health conscious, dairy-farming Higgins family begin each day with an invigorating swim. One day, traveling health-tonic salesman, Windy Weebe, comes to town and suggests they could swim the English Channel. Sponsored by "Liquapep" and coached by Windy, the family arrive in Europe. There it is decided that daughter Katie is the only one strong enough to enter the contest. But while she should be focused on the difficult and risky task ahead, Katie is pursed by dashing Frenchman, André Lanet... This comedic musical is well remembered for the scene when Katie dreams she is swimming with cartoon characters Tom &amp; Jerry!');
INSERT INTO movies VALUES (43194, 'Ulisse', '1954-10-06', NULL, 100, 0, 'A movie adaptation of Homer''s second epic, that talks about Ulysses'' efforts to return to his home after the end of ten years of war.');
INSERT INTO movies VALUES (43314, 'A Lawless Street', '1955-11-15', NULL, 78, 0, 'A Marshal must face unpleasant facts about his past when he attempts to run a criminal gang out of town.');
INSERT INTO movies VALUES (43316, 'All That Heaven Allows', '1955-12-25', NULL, 89, 0, 'Friends and family want a rich widow to end her romance with a tree surgeon about 15 years her junior.');
INSERT INTO movies VALUES (43317, 'Artists and Models', '1955-11-07', 1500000, 109, 0, 'Eugene and Rick are two struggling artists who share apartment. However, Rick has problems with that, because Eugene is obsessed with pulp fiction comic books and has nightmares because of that. However, Rick soon finds that those nightmares could be excellent material for writing his own comic books.');
INSERT INTO movies VALUES (43318, 'Interrupted Melody', '1955-07-01', NULL, 106, 0, 'Interrupted Melody is the inspirational filmed biography of world-renowned Australian soprano Marjorie Lawrence. She’s a foremost Wagnerian, equal to the vocal and physical demands of the composer’s oeuvre. And she’s a beacon of triumph to anyone who fights back when personal tragedy strikes.');
INSERT INTO movies VALUES (43319, 'Man Without a Star', '1955-03-24', NULL, 89, 0, 'Man Without a Star is a 1955 western film starring Kirk Douglas as a wanderer who gets dragged into a range war. It was based on the novel of the same name by Dee Linford.');
INSERT INTO movies VALUES (43321, 'Pete Kelly''s Blues', '1955-07-31', NULL, 95, 0, 'In 1927 Kansas City Pete Kelly and his jazz band play nightly at a speakeasy. A local gangster starts to move in on them and when their drummer is killed Kelly gives in...');
INSERT INTO movies VALUES (43322, 'Pokolenie', '1955-01-26', NULL, 83, 32, 'A Generation is set in Wola, a working-class section of Warsaw, in 1942 and tells the stories of two young men at odds with the Nazi occupation of Poland.');
INSERT INTO movies VALUES (43323, 'Richard III', '1955-12-13', NULL, 161, 0, 'Shakespeare''s powerful tale of the wicked deformed king and his conquests, both on the battlefield and in the boudoir.');
INSERT INTO movies VALUES (43326, 'The Tender Trap', '1955-11-04', NULL, 111, 0, 'Charlie Reader is a successful theater agent. He is also successful with young ladies. One day he is visited by his old friend Joe, married with three children. Joe falls in love with Charlie''s girl Sylvia while Charlie spends his time with young actress Julie. Written by Mattias Thuresson');
INSERT INTO movies VALUES (43327, 'The Virgin Queen', '1955-07-22', NULL, 92, 0, 'Sir Walter Raleigh overcomes court intrigue to win favor with the Queen in order to get financing for a proposed voyage to the New World.');
INSERT INTO movies VALUES (43329, 'Apache', '1954-07-09', NULL, 91, 0, 'Following the surrender of Geronimo, Massai, the last Apache warrior is captured and scheduled for transportation to a Florida reservation. On the way he manages to escape and heads for his homeland to win back his girl and settle down to grow crops. His pursuers have other ideas though.');
INSERT INTO movies VALUES (43332, 'Demetrius and the Gladiators', '1954-06-16', 4500000, 101, 0, 'The story picks up at the point where "The Robe" ends, following the martyrdom of Diana and Marcellus. Christ''s robe is conveyed to Peter for safe-keeping, but the emperor Caligula wants it back to benefit from its powers. Marcellus'' former slave Demetrius seeks to prevent this, and catches the eye of Messalina, wife to Caligula''s uncle Claudius. Messalina tempts Demetrius, he winds up fighting in the arena, and wavers in his faith.');
INSERT INTO movies VALUES (43336, 'Executive Suite', '1954-05-06', NULL, 104, 0, 'When the head of a large manufacturing firm dies suddenly from a stroke, his vice-presidents vie to see who will replace him.');
INSERT INTO movies VALUES (43337, 'Inauguration of the Pleasure Dome', '1954-01-01', NULL, 38, 0, 'Inauguration of the Pleasure Dome is a short 38 minute film by Kenneth Anger, filmed in 1954. Anger created two other versions of this film in 1966 and the late 1970s. According to Anger, the film takes the name "pleasure dome" from Samuel Taylor Coleridge''s atmospheric poem Kubla Khan. Anger was inspired to make the film after attending a Halloween party called "Come as your Madness."');
INSERT INTO movies VALUES (43340, 'Young at Heart', '1954-12-01', NULL, 117, 0, 'When Alex enters the lives of the musical Tuttle family, each of the three daughters falls for him. He is charming, good looking and personable. Laurie and Alex seem made for each other and become engaged. When Barney comes into the picture to help Alex with some musical arrangements matters become complicated. He is seen as a challenge by Laurie, who can''t believe anyone could be as cynical, and she is more than a match for his gloomy outlook on life.');
INSERT INTO movies VALUES (43341, 'Cat-Women of the Moon', '1953-09-03', NULL, 64, 0, 'Astronauts travel to the moon where they discover it is inhabited by attractive young women in black tights.');
INSERT INTO movies VALUES (43342, 'Donovan''s Brain', '1953-09-30', NULL, 83, 0, 'A scientist takes a the brain of dead man and revives it via electrodes as it lays suspended in a tank of liquid. Soon, the brain grows to possess enormous psychic powers and inflicts its personality upon the doctor who saved creating a "Jekyll and Hyde" paradigm.');
INSERT INTO movies VALUES (43343, 'Easy to Love', '1953-12-25', NULL, 96, 0, 'Two men vie for the heart of a Cypress Gardens swimming star.');
INSERT INTO movies VALUES (43346, 'Genevieve', '1953-05-28', NULL, 86, 0, 'Two friends driving in the London to Brighton vintage car rally bet on which of them will be the first to arrive back home.');
INSERT INTO movies VALUES (43348, 'Gun Fury', '1953-10-30', NULL, 83, 0, 'After a stagecoach holdup, Frank Slayton''s notorious gang leave Ben Warren for deasd and head off with his fiancée. Warren follows, and although none of the townspeople he comes across are prepared to help, he recruits two others who have sworn revenge on the ruthless Slayton.');
INSERT INTO movies VALUES (43350, 'Lili', '1953-07-10', NULL, 81, 0, 'Members of a circus troupe "adopt" Lili Daurier when she finds herself stranded in a strange town. The magician who first comes to her rescue already has romantic entanglements and thinks of her as a little girl. Who can she turn to but the puppets, singing to them her troubles, forgetting that there are puppeteers. A crowd gathers around Lili as she sings. The circus has a new act. She now has a job. Will she get her heart''s desire?');
INSERT INTO movies VALUES (43351, 'Pony Express', '1953-01-01', NULL, 101, 0, 'Buffalo Bill and Wild Bill Hickok join forces to establish a mail route that can get mail from St. Joseph, Missouri, to Sacramento, California, in ten days. Along the way they must battle bad weather, hostile Indians and outlaws intent on robbing the mail and shutting down the entire operation.');
INSERT INTO movies VALUES (43353, 'Robot Monster', '1953-06-25', 16000, 66, 0, 'Ro-Man, an alien robot who greatly resembles a gorilla in a diving helmet, is sent to earth to destroy all human life. Ro-Man falls in love with one of the last six remaining humans, and struggles to understand how his programming can instruct him to kill her while his heart demands that he can''t.');
INSERT INTO movies VALUES (43354, 'The Captain''s Paradise', '1953-09-28', NULL, 94, 0, 'Mediterranean ferryboat captain Henry St James has things well organized - a loving and very English wife Maud in Gibraltar, and the loving if rather more hot-blooded Mistress, Nita in Tangiers. A perfect life. As long as neither woman decides to follow him to the other port.');
INSERT INTO movies VALUES (43355, 'The Master of Ballantrae', '1953-01-01', NULL, 90, 0, 'Buckle on your swashes for this swashbuckling adventure with a highlander who fought for Bonnie Prince Charlie who, after various escapades, becomes a pirate.');
INSERT INTO movies VALUES (43357, 'The Twonky', '1953-01-01', NULL, 84, 0, 'A college professor, left alone by his wife for the weekend, discovers his new TV set is not only alive, but determined to take control of his entire life.');
INSERT INTO movies VALUES (43358, 'Carrie', '1952-07-17', NULL, 118, 0, 'Carrie''s dreams of adventure in the big city are quickly squashed as she discovers all that awaits her there is a bleak life of grueling and poorly-paid factory work. That is, until a traveling salesman named Drouet steps into her life and changes her outlook...');
INSERT INTO movies VALUES (43360, 'Le Plaisir', '1952-02-29', NULL, 97, 0, 'Three stories about the pleasure. The first one is about a man hiding his age behind a mask to keep going to balls and fancying women - pleasure and youth. Then comes the long tale of Mme Tellier taking her girls (whores) to the country for attending her niece''s communion - pleasure and purity. And lastly, Jean the painter falling in love with his model - pleasure and death.');
INSERT INTO movies VALUES (43362, 'Love Is Better Than Ever', '1952-02-23', NULL, 81, 0, 'The dancing teacher Anastasia falls in love with the smart theatre agent Jud. He likes her, too, but does not want to give up his solo life at all. Thus she plans a trap for him...');
INSERT INTO movies VALUES (46995, 'Madeleine', '1950-02-14', NULL, 114, 0, 'The middle-class family of a young woman cannot understand why she delays in marrying a respectable young man. They know nothing about her long-standing affair with a Frenchman.');
INSERT INTO movies VALUES (43363, 'Lovely to Look At', '1952-07-01', NULL, 103, 0, 'Al Marsh, Tony Naylor and Jerry Ralby, Broadway producers, are desperately looking for backers. Al is one of the heirs of a dress salon in Paris, but this is almost bankrupt. The two other heiresses, Stephanie and Clarisse and the three producers are able to convince the creditors to back a fashion show there. Things become complicated, when Al and Tony fall in love with Stephanie and Al''s New York girl friend Bubbles arrives');
INSERT INTO movies VALUES (43365, 'Stars and Stripes Forever', '1952-01-01', NULL, 90, 0, 'Marine bandmaster John Philip Sousa (Clifton Webb) becomes famous for his marches and inspires the sousaphone.');
INSERT INTO movies VALUES (43367, 'The Big Sky', '1952-08-19', 140, 140, 0, 'Kirk Douglas stars as the determined leader of a band of Tennessee fur trappers who set out to explore the uncharted Missouri river in 1830 and find them selves battling American Indians.');
INSERT INTO movies VALUES (43368, 'The Big Trees', '1952-02-05', NULL, 89, 0, 'In 1900, unscrupulous timber baron Jim Fallon plans to take advantage of a new law and make millions off California redwood. Much of the land he hopes to grab has been homesteaded by a Quaker colony, who try to persuade him to spare the giant sequoias...but these are the very trees he wants most. Expert at manipulating others, Fallon finds that other sharks are at his own heels, and forms an unlikely alliance.');
INSERT INTO movies VALUES (43369, 'The Card', '1952-02-25', NULL, 85, 0, 'A charming and ambitious young man finds many ways to raise himself through the ranks in business and social standing - some honest, some not quite so. If he can just manage to avoid a certain very predatory woman...');
INSERT INTO movies VALUES (43370, 'The Lusty Men', '1952-10-24', NULL, 113, 0, 'Retired rodeo champion Jeff McCloud agrees to mentor novice rodeo contestant Wes Merritt against the wishes of Merritt''s wife who fears the dangers of this rough sport.');
INSERT INTO movies VALUES (43371, 'Bedtime for Bonzo', '1951-04-05', NULL, 83, 0, 'College prof Peter Boyd tries to salvage his professional and personal reputation by using a lab chimp to prove that environment trumps heredity in behavioral development.');
INSERT INTO movies VALUES (43373, 'Chained for Life', '1952-01-01', NULL, 81, 0, 'A Siamese twin kills the husband who left her. The courts have to decide if she is convicted of murder, how can they punish her sister, who had nothing to do with the crime?');
INSERT INTO movies VALUES (43378, 'Man in the Saddle', '1951-12-02', NULL, 87, 0, 'A small farmer and rancher is being harassed by his mighty and powerfull neighbour. When the neighbour even hires gunmen to intimidate him he has to defend himself and his property by means of violence.');
INSERT INTO movies VALUES (43380, 'Rawhide', '1951-03-25', NULL, 89, 0, 'Not a Rowdy Yates in sight in this western set in a stop over for the California to St Louis mail stagecoach run. The two staff are warned that four dangerous outlaws are in the area, and together with a female stage passenger and her baby they wait patiently for the word to go round that these men have been caught. Can you guess where the outlaws decide to hide out while they plan a large gold robbery? What follows is a film that concentrates on small details (like attempts to slip a warning note to a passing stage, or to reach a hidden gun that the bad guys don''t know about) as the captives try anything to get away from the outlaws.');
INSERT INTO movies VALUES (43381, 'Texas Carnival', '1951-10-05', NULL, 77, 0, 'A Texas carnival showmen team is mistaken for a cattle baron and his sister.');
INSERT INTO movies VALUES (43384, 'Vengeance Valley', '1951-02-06', NULL, 83, 0, 'A cattle baron takes in an orphaned boy and raises him, causing his own son to resent the boy. As they get older the resentment festers into hatred, and eventually the real son frames his stepbrother for fathering an illegitimate child that is actually his, seeing it as an opportunity to get his half-brother out of the way so he can have his father''s empire all to himself.');
INSERT INTO movies VALUES (43385, 'Born to Be Bad', '1950-09-28', NULL, 94, 0, 'A manipulative woman plots to seduce her cousin''s rich fiance, but is also in love with the only man who can see her selfish true nature. Based on the 1928 bestseller "All Kneeling" by Anne Parrish.');
INSERT INTO movies VALUES (43386, 'Cyrano de Bergerac', '1950-11-14', NULL, 112, 0, 'José Ferrer won the Oscar for Best Actor for his portayal of the swordsman-poet using his silver tongue to woo the woman he loves for another man.  Cyrano de Bergerac is a play written in 1897 by Edmond Rostand. Although there was a real Cyrano de Bergerac, the play is a fictionalization of his life that follows the broad outlines of it. The entire play is written in verse, in rhyming couplets of twelve syllables per line, very close to the Alexandrine format, but the verses sometimes lack a caesura. It is also meticulously researched, down to the names of the members of the Académie française and the dames précieuses glimpsed before the performance in the first scene. The play has been translated and performed many times, and is responsible for introducing the word "panache" into the English language.');
INSERT INTO movies VALUES (43387, 'Francis', '1950-01-01', NULL, 91, 0, 'The truthful soldier Stirling didn''t know how to lie about his source of information, the talking army Mule, Francis, so he was treated as a lunatic and led to one after another hilarious situations, where the mule was the only one that appeared in his right mind. In the process of all this, the mule assisted in uncovering a spy, Mareen, who pretended to be lost among the jungles, but was actually...');
INSERT INTO movies VALUES (43388, 'King Solomon''s Mines', '1950-11-09', NULL, 103, 0, 'Adventurer Allan Quartermain leads an expedition into uncharted African territory in an attempt to locate an explorer who went missing during his search for the fabled diamond mines of King Solomon.');
INSERT INTO movies VALUES (43390, 'Summer Stock', '1950-08-31', NULL, 108, 0, 'To Jane Falbury''s New England farm comes a troup of actors to put up a show, invited by Jane''s sister. At first reluctant she has them do farm chores in exchange for food. Her reluctance becomes attraction when she falls in love with the director, Joe, who happens to be her sister''s fiance.');
INSERT INTO movies VALUES (43391, 'The Flying Saucer', '1950-01-04', NULL, 69, 0, 'The CIA sends playboy Mike Trent to Alaska with agent Vee Langley, posing as his "nurse," to investigate flying saucer sightings. At first, installed in a hunting lodge, the two play in the wilderness. But then they sight a saucer. Investigating, our heroes clash with an inept gang of Soviet spies, also after the saucer secret.');
INSERT INTO movies VALUES (43392, 'The Jackie Robinson Story', '1950-05-16', NULL, 76, 0, 'Biography of Jackie Robinson, the first black major league baseball player in the 20th century. Traces his career in the negro leagues and the major leagues');
INSERT INTO movies VALUES (43394, 'Three Secrets', '1950-10-20', NULL, 98, 0, 'A five-year-old boy is the sole survivor of a devastating plane crash in the mountains of California. When the newspapers reveal the boy was adopted and that the crash occurred on his birthday, three women begin to ponder if it''s the son each gave up for adoption. As the three await news of his rescue at a mountain cabin, they recall incidents from five years earlier and why they were forced to give up their son.');
INSERT INTO movies VALUES (43395, 'Two Weeks with Love', '1950-01-01', NULL, 92, 0, 'The Robinson family are spending two weeks of summer vacation at a resort in the Catskills. Older daughter Patti vies with her friend, Valeria, for the affections of Demi Armendez but Patti is at a disadvantage because her parents think she is too young for boys. But with Patti singing at an amateur show and a dance, her adventures in quest of Armendez ends happily.');
INSERT INTO movies VALUES (43396, 'Union Station', '1950-10-04', NULL, 81, 0, 'Police catch a break when suspected kidnappers are spotted on a train heading towards Union Station. Police, train station security and a witness try to piece together the crime and get back the blind daughter of a rich business man.');
INSERT INTO movies VALUES (43562, 'Along the Great Divide', '1951-06-02', NULL, 88, 0, 'New Federal marshal Len Merrick saves Tim Keith from lynching at the hands of the Roden clan, and hopes to get him to Santa Loma for trial. Vindictive Ned Roden, whose son Ed was killed, still wants personal revenge, and Tim would like to escape before Ned catches up with him again. Can the marshal make it across the desert with Tim and his daughter? Even if he makes it, will justice be served?');
INSERT INTO movies VALUES (43608, 'The Night Holds Terror', '1955-07-13', NULL, 86, 0, 'A group of escaped convicts holds a household prisoner as the police close in.');
INSERT INTO movies VALUES (43882, 'No Highway in the Sky', '1951-09-21', NULL, 98, 0, 'James Stewart plays aeronautical engineer Theodore Honey, the quintessential absent-minded professor: eccentric, forgetful, but brilliant. His studies show that the aircraft being manufactured by his employer has a subtle but deadly design flaw that manifests itself only after the aircraft has flown a certain number of hours. En route to a crash site to prove his theory, Honey discovers that he is aboard a plane rapidly approaching his predicted deadline.');
INSERT INTO movies VALUES (43961, 'Carbine Williams', '1952-05-01', NULL, 92, 0, 'This is the story of David Marshall ''Marsh'' Williams, the real life inventor of the world famous M-1 Carbine automatic rifle used in WWII. It all started when Marsh, who was one to do things his way, was caught distilling moonshine, and was accused and convicted of shooting a federal officer in the process. This at first placed him in the chain gang which labeled him as a hard case. Later, to make room for those more deserving, he was moved to a prison farm, where he came under the direction of Captain H.T. Peoples. The Captain was a mild mannered warden, who did not shy from discipline when necessary, but also believed that given the opportunity, most men will respond to good. Believing that Marsh was just such a person, the Captain gave him every opportunity to reform, so much so, that he eventually allowed Marsh to work in the tool shop on his spare time to develop and build by hand, a working riffle, inside the prison farm itself.');
INSERT INTO movies VALUES (44025, 'Mr. Denning Drives North', '1952-09-02', NULL, 93, 0, 'When well-off aircraft designer Denning finds his daughter''s current boyfriend is a nasty character he tries to buy him off, ending up hitting him and causing his death when he falls. Instead of calling the police he dumps the body in a lonely spot on the road to the North, making it look like a hit-and-run accident. Weeks later there is still no report of the body being found, and Denning starts to go to pieces. When he lets his wife into his secret the two start making enquiries, possibly making things worse.');
INSERT INTO movies VALUES (44026, 'Mr. Arkadin', '1955-03-01', NULL, 93, 0, 'Orson Welles’s "Mr. Arkadin" tells the story of an elusive billionaire who hires an American smuggler to investigate his past.  Welles missed the editing deadline, so the producer handed over the editing to others. Following two Spanish-dubbed versions, released in Madrid in March 1955, the first English-language version was released in London in August 1955 as "Confidential Report" but was never released in the US. The fourth version, called "the Corinth version", was discovered in 1961 and was released in the US in 1962. Finally, in 2006, "the Criterion edit" was released; likely to remain the one closest to Welles'' intentions.');
INSERT INTO movies VALUES (44052, 'Black Widow', '1954-10-28', NULL, 95, 0, 'Ginger Rogers steals the show as a selfish, snide Broadway superstar in Nunnally Johnson''s Black Widow, preening, snooping, gossiping, and bestowing air kisses in equal abundance. Rogers is Carlotta Marin, a grande dame of the thea-tah, married, it would seem happily, to Brian Mullen (Reginald Gardiner). Yet at the heart of Black Widow is something grim, the death of a young, ambitious writer named Nancy (Peggy Ann Garner), who gloms onto a theater producer (Van Hefflin), who''s in love with his wife, Iris (Gene Tierney, heartbreakingly lovely). Nancy''s death appears to be self-inflicted, and yet as each piece of evidence--a weird suicide note, a threatening letter received in the mail--piles up, things begin to point to murder.');
INSERT INTO movies VALUES (44140, 'Miss Sadie Thompson', '1953-12-23', NULL, 91, 0, 'Sadie Thompson winds up stranded on an island and while her boat is being quarantined, she manages to stir up the blood of every marine on the base.');
INSERT INTO movies VALUES (44334, 'The Tales of Hoffmann', '1951-04-04', NULL, 128, 0, 'Hoffmann is a lovelorn young man in Nuremberg who is watching his latest love, Stella, dance in the ballet. In the interval he goes to the tavern where he tells his friends the tales of the three major loves of his life. Each story forms a separate act of this filmic version of the Offenbach opera.');
INSERT INTO movies VALUES (44398, 'The Black Rose', '1950-09-01', NULL, 116, 0, 'In the time of the crusades, a Saxon youth is forced to run away from England. He goes with his loyal retainer who brings along a British long bow. The two go all the way to China where they become involved in intrigues in the court of Kubla Kahn.');
INSERT INTO movies VALUES (44536, 'Sailor of the King', '1953-06-11', NULL, 83, 0, 'A British naval officer has a brief affair with a woman in England and never knows that she bears him a son. 20 years later the boy is on a ship under his command when he is tracking a German Raider. When the boy is captured after his ship is sunk, he finds a way to slow the German''s progress while a lethal hunt for him goes on.');
INSERT INTO movies VALUES (44592, 'Lost Continent', '1951-08-17', NULL, 83, 0, 'It''s Cesar Romero versus dinosaurs in this classic 1950s B movie, with Hillary Brooke as the jungle goddess love interest.');
INSERT INTO movies VALUES (44631, 'Against All Flags', '1952-12-24', NULL, 83, 0, 'British Naval Officer (Errol Flynn) fights pirates on Madagascar.');
INSERT INTO movies VALUES (44655, 'Susana', '1951-04-11', NULL, 86, 2, 'The story of a girl of questionable mental stability who escapes from incarceration and ends up at a plantation where she disrupts a working family''s daily routines and chemistry.');
INSERT INTO movies VALUES (44692, 'The Magnetic Monster', '1953-02-18', NULL, 76, 0, 'A young scientist''s experiment goes awry when he creates a monster from a radioactive isotope and finds that the creature consumes energy to grow in size and terrorize the nearby town.');
INSERT INTO movies VALUES (44711, 'Young Bess', '1953-05-29', NULL, 112, 0, 'The mother died under the executioner''s axe; the daughter rose to become England''s greatest monarch -- the brilliant and cunning Queen Elizabeth I. Jean Simmons portrays young Bess in this rich tapestry of a film that traces the tumultuous, danger-fraught years from Elizabeth''s birth to her unexpected ascension to the throne at a mere 25. Charles Laughton reprises his Academy Award®-winning* role as her formidable father Henry VIII. Deborah Kerr plays her last stepmother (and Henry''s last of six wives), gentle Catherine Parr. And Simmons'' then real-life husband, Stewart Granger, adds heroics as Lord Admiral Thomas Seymour. In a resplendent world of adventure, romance and court intrigue, Young Bess reigns.');
INSERT INTO movies VALUES (44747, 'The Caddy', '1953-08-10', NULL, 95, 0, 'The origin of Anthony and Miller, a wildly successful comedy team, can be traced back several years to Harvey Miller''s stage fright on the golf links. Although the son of a skilled golfer and an outstanding player in his one right, Miller is too nervous to golf in front of a gallery. He becomes coach and caddy for Joe Anthony, his girlfriend''s brother, who must convince his fisherman father that hitting a little ball into a hole can be more lucrative than trawling the Pacific Ocean. While on the PGA tour, their natural comedic abilities are recognized by a shrewd agent who senses their talent and potential, and a new comedy team is born.');
INSERT INTO movies VALUES (68191, 'The Student Prince', '1954-06-15', NULL, 107, 0, 'A prince goes to University &amp; learns how to become more human. An added bonus is the quite wonderful music.');
INSERT INTO movies VALUES (44804, 'Subida al cielo', '1952-01-01', NULL, 80, 2, 'Newlywed Oliverio receives disturbing news that his mother is on her deathbed. He travels to a remote part of Mexico to fetch a lawyer who can sort out her will. Leaving his wife behind, he embarks on a bus ride that’s interrupted by an increasingly absurd series of episodes, including an impromptu birthday celebration; a one-legged man writhing in the mud; come-ons from an insatiable small-town belle, Raquel; and Oliverio’s frequent, Freudian nightmares.');
INSERT INTO movies VALUES (44888, 'Soldier of Fortune', '1955-01-01', NULL, 96, 0, 'An American woman arrives in Hong Kong to unravel the mystery of her missing photographer husband. After getting nowhere with the authorities, she is led by some underground characters to an American soldier of fortune working in the area against the Communists. He promises to help find her husband.');
INSERT INTO movies VALUES (44890, 'The Frogmen', '1951-01-25', NULL, 96, 0, 'The new commander of a Navy Underwater Demolition Team--nicknamed "Frogmen"--must earn the respect of the men in his unit, who are still grieving over the death of their former commander and resentful of the new one.');
INSERT INTO movies VALUES (44902, 'Footsteps in the Fog', '1955-09-14', NULL, 90, 0, 'A Victorian-era murder mystery about a parlour maid that discovers that her employer may have killed his first wife.');
INSERT INTO movies VALUES (45136, 'A Man Called Peter', '1955-03-31', NULL, 119, 0, 'Based on the true story of a young Scottish lad, Peter Marshall, who dreams of only going to sea but finds out there is a different future for him when he receives a "calling" from God to be a minister. He leaves Scotland and goes to America where after a few small congregations he lands the position of pastor of the Church of the Presidents in Washington, D.C. and eventually he becomes Chaplain of the U.S. Senate.');
INSERT INTO movies VALUES (45218, 'The River', '1951-09-10', NULL, 99, 0, 'Based on the novel by Rumer Godden, Jean Renoir’s entrancing first color feature—shot entirely on location in India—eloquently contrasts the growing pains of three young women with the immutability of the Bengal river around which their daily lives unfold. Enriched by Renoir’s subtle understanding and appreciation for India and its people, The River gracefully explores the fragile connections between transitory emotions and everlasting creation.');
INSERT INTO movies VALUES (45314, 'The Seafarers', '1953-10-15', NULL, 29, 0, 'Acclaimed director Stanley Kubrick''s first film made in color. The documentary focuses on the benefits of membership to the Seafarers International Union.');
INSERT INTO movies VALUES (45577, 'Three Cases of Murder', '1955-03-15', NULL, 99, 0, 'Three stories of murder and the supernatural: A museum worker is introduced to a world behind the pictures he sees every day. When two lifelong friends fall in love with the same woman and she is killed, they are obvious suspects. Is their friendship strong enough for them to alibi each other? When a young politician is hurt by the arrogant Secretary for Foreign Affairs Lord Mountdrago, he uses Mountdrago''s dreams to get revenge.');
INSERT INTO movies VALUES (45588, 'Angels in the Outfield', '1951-10-19', NULL, 99, 0, 'Paul Douglas, stars with Janet Leigh, as the hot-tempered Pittsburgh Pirates manager whose hard-luck team goes on a wining streak thanks to some heavenly intervention.');
INSERT INTO movies VALUES (45627, 'This Side of the Law', '1950-06-17', NULL, 74, 0, 'A man - trapped in a cistern - reflects on the dark events that lead to his lonely entrapment.');
INSERT INTO movies VALUES (45679, 'The System', '1953-04-18', NULL, 90, 0, 'A gambling boss is pressured by the law and press when a crusade is started against him after one of his collectors becomes a killer.');
INSERT INTO movies VALUES (45692, 'Paid in Full', '1950-02-15', NULL, 98, 0, 'Two sisters fall in love with the same man. After the wedding, the new husband realizes he may have married the wrong sister.');
INSERT INTO movies VALUES (45966, 'Day of the Fight', '1951-04-26', 3900, 13, 0, 'American short subject documentary film in black-and-white, which is notable as the first picture directed by Stanley Kubrick. Kubrick financed the film himself, and it is based on an earlier photo feature he had done as a photographer for Look magazine in 1949. ''Day of the Fight'' shows Irish-American middleweight boxer Walter Cartier during the height of his career, on the day of a fight with black middleweight Bobby James, which took place on April 17, 1950.');
INSERT INTO movies VALUES (45970, 'Flying Padre', '1951-03-23', NULL, 9, 0, 'Two days in the life of priest Father Fred Stadtmuller whose New Mexico parish is so large he can only spread goodness and light among his flock with the aid of a mono-plane. The priestly pilot is seen dashing from one province to the next at the helm of his trusty Piper Club administering guidance (his plane, the Flying Padre) to unruly children, sermonizing at funerals and flying a sickly child and its mother to a hospital.');
INSERT INTO movies VALUES (46011, 'Call Me Madam', '1953-03-25', NULL, 114, 0, 'Washington hostess Sally Adams becomes a Truman-era US ambassador to a European grand duchy.');
INSERT INTO movies VALUES (46014, 'Just for You', '1952-09-27', NULL, 104, 0, 'Jordan Blake (a widower) is a successful Broadway Producer who has always been to busy for his children, Barbara and Jerry. Girlfriend, Carolina a musical comedy star, urges Jordan to take his kids on a vacation and get to know them before they are all grown up. Is Jordan already too late?');
INSERT INTO movies VALUES (46145, 'Invasion, U.S.A.', '1952-12-10', NULL, 73, 0, 'A group of American witness the deadly invasion of the United States by the Soviet Union.');
INSERT INTO movies VALUES (46193, 'Ride, Vaquero!', '1953-07-17', NULL, 90, 0, 'Ranchers in New Mexico have to face Indians and bandits.');
INSERT INTO movies VALUES (46196, 'Hollywood Story', '1951-06-01', NULL, 76, 0, 'A producer takes over a small film studio and - sensing that it''ll be a good movie- begins investigating an old murder of a silent film star shot in his office years ago. He finds that his life is threatened as he digs deeper into the mystery.');
INSERT INTO movies VALUES (46258, 'Das Haus in Montevideo', '1951-11-08', NULL, 106, 3, 'A great Comedy which handles its delicate subject between money and moral with humor. It apeals to humanity, wit and goodness. Its great quality is the enchanting use of speech by one of the leading Comedians of postwar Germany. Often copied, never reached!');
INSERT INTO movies VALUES (46531, 'Borderline', '1950-03-01', NULL, 88, 0, 'Two undercover agents infiltrate a drug-smuggling ring in Mexico, thee find them selves falling in love with each other. Neither is aware of the other''s identity As they decide to make a run for the border.');
INSERT INTO movies VALUES (46586, 'The Gambler and the Lady', '1952-12-26', NULL, 72, 0, 'A greedy but successful professional gambler wants to join the British Establishment when he falls in love with a blue-blooded lady. But first he must mend his ways and then dump his nightclub singer girl friend. She''s not so easy to get rid of, neither is his past.');
INSERT INTO movies VALUES (46626, 'Gang Busters', '1955-06-17', NULL, 74, 0, 'A life-long criminal continues his practice of breaking out of Oregon State Prison - much to the frustration of the police.');
INSERT INTO movies VALUES (46872, 'The Steel Helmet', '1951-02-02', NULL, 85, 0, 'A ragtag group of American stragglers battles against superior Communist troops in an abandoned Buddhist temple during the Korean War.');
INSERT INTO movies VALUES (46875, 'Fixed Bayonets!', '1951-11-21', NULL, 92, 0, 'The story of a platoon during the Korean War. One by one, Corporal Denno''s superiors are killed until it comes to the point where he must try to take command responsibility.');
INSERT INTO movies VALUES (46932, 'Seven Days to Noon', '1950-10-30', NULL, 94, 0, 'An English scientist runs away from a research center with an atomic bomb. In a letter sent to the British Prime Minister he threatens to blow up the center of London if the Government don''t announce the end of any research in this field within a week. Special agents from Scotland Yard try to stop him, with help from the scientist''s assistant future son-in-law to find and stop the mad man.');
INSERT INTO movies VALUES (47149, 'Highway Dragnet', '1954-01-27', NULL, 70, 0, 'An ex-Marine on the lam from a murder charge. He hitches a ride from glamor-magazine photographer, who is travelling cross-country with her principal model. Tensions rise when the woman realize the man with them may be a killer.');
INSERT INTO movies VALUES (47256, 'The Hoodlum', '1951-07-05', NULL, 61, 0, 'Vincent Lubeck is a vicious ex-convict. His criminal activities are despised by his family, but he uses and abuses them in the course of his crimes. Eventually his own brother must stand up to him.');
INSERT INTO movies VALUES (47312, 'The Good Die Young', '1954-03-02', NULL, 100, 0, '1954 British crime thriller by Lewis Gilbert, based on a novel by American novelist Richard Macaulay. Four men  in post-war London, two Brits and two Americans, feel forced to turn to crime by their financial problems, and decide to rob a mail van together.');
INSERT INTO movies VALUES (47473, 'Sommarlek', '1951-10-01', NULL, 96, 25, 'Ballet dancer Marie reminisce of a summer 13 years ago when she was a teenager and met Henrik on vacation in the archipelago.');
INSERT INTO movies VALUES (47555, 'Flying Leathernecks', '1951-08-28', NULL, 102, 0, 'Major Daniel Kirby takes command of a squadron of Marine fliers just before they are about to go into combat. While the men are well meaning, he finds them undisciplined and prone to always finding excuses to do what is easy rather than what is necessary. The root of the problem is the second in command, Capt. Carl ''Griff'' Griffin. Griff is the best flier in the group but Kirby finds him a poor commander who is not prepared to the difficult decision that all commanders have to make - to put men in harm''s way knowing that they may be killed.');
INSERT INTO movies VALUES (47675, 'The Kidnappers', '1953-12-01', NULL, 93, 0, 'A Scotsman, Jim MacKenzie, living on a primitive homestead in Nova Scotia, is raising his two grandsons, Harry and Davy, following the death of their father in the Boer War. His son''s death has developed antagonism by MacKenzie toward all Dutchmen, which leads to Harry brawling at school with the son of a Dutchman. Harry falls down a cliff and is helped home by the community doctor, Willem Bloem, a Dutchman in love with MacKenzie''s daughter, Kirsty. Due to the old man''s feelings, they must carry on a clandestine romance. Forbidden by their grandfather to have a dog, Harry and Davy "kidnap" an unattended baby and care for the child in a lean-to shack. When found, the baby proves to be the child of MacKenzie''s most-bitter Dutch enemy.');
INSERT INTO movies VALUES (47697, 'Othello', '1951-11-27', NULL, 90, 0, 'Desdemona, daughter of a Venetian aristocrat, elopes with Moorish military hero Othello, to the great resentment of Othello''s envious underling Iago. Alas, Iago knows Othello''s weakness, and with chilling malice works on him with but too good effect...');
INSERT INTO movies VALUES (47721, 'Gycklarnas afton', '1953-09-14', NULL, 93, 25, 'On a gray morning, a circus caravan arrives in the town where Albert the ringmaster''s family lives. He hasn''t seen them for three years and has taken a mistress, the young and buxom Anne. Albert calls on his wife; Anne, jealous and wanting out, visits a theatrical troupe and lets an actor, Frans, seduce her in exchange for a necklace he says is valuable. Anne finds out it''s worthless at about the same time Albert''s wife declines to let him live with the family. Albert and Anne are stuck with the circus and each other; there''s a show tonight, Frans will be there smirking and sardonic, the bear is mangy, the clown is as sour as they come, and suicide offers an exit.');
INSERT INTO movies VALUES (47735, 'Sommaren med Monika', '1953-02-09', NULL, 96, 25, 'Monika from Stockholm falls in love with Harry, a young man on holiday. When she becomes pregnant they are forced into a marriage, which begins to fall apart soon after they take up residence in a cramped little flat.');
INSERT INTO movies VALUES (47739, 'Illegal', '1955-10-28', NULL, 88, 0, 'A hugely successful DA goes into private practice after sending a man to the chair -- only to find out later he was innocent. Now the drunken attorney only seems to represent criminals and low lifes.');
INSERT INTO movies VALUES (47745, 'Southside 1-1000', '1950-11-16', NULL, 73, 0, 'The U.S. Secret Service goes after a counterfeiting ring by placing one of it''s agents in a criminal mob.');
INSERT INTO movies VALUES (48035, 'Ordet', '1955-01-09', NULL, 126, 14, 'How do we understand faith and prayer, and what of miracles? August 1925 on a Danish farm. Patriarch Borgan has three sons: Mikkel, a good-hearted agnostic whose wife Inger is pregnant, Johannes, who believes he is Jesus, and Anders, young, slight, in love with the tailor''s daughter. The fundamentalist sect of the girl''s father is anathema to Borgan''s traditional Lutheranism; he opposes the marriage until the tailor forbids it, then Borgan''s pride demands that it happen. Unexpectedly, Inger, who is the family''s sweetness and light, has problems with her pregnancy. The rational doctor arrives, and a long night brings sharp focus to at least four views of faith.');
INSERT INTO movies VALUES (48155, 'The Big Knife', '1955-10-25', NULL, 111, 0, 'An unscrupulous movie producer blackmails an unhappy star - who opted for box-office success over art- into signing a new contract.');
INSERT INTO movies VALUES (48407, 'The Last Page', '1952-01-25', NULL, 84, 0, 'A married bookstore owner is blackmailed after he makes a pass at his new sexy blonde clerk.');
INSERT INTO movies VALUES (48481, 'Five', '1951-04-25', NULL, 93, 0, 'The world is destroyed in a nuclear holocaust. Only five Americans survive, including a pregnant woman, a neo-Nazi, a black man and a bank clerk. The five fight each other, fall in love, and act really depressed a lot.');
INSERT INTO movies VALUES (48627, 'Room for One More', '1952-01-10', NULL, 98, 0, 'Anne and "Poppy" Rose are the average American family, with three quirky kids. Anne has a good heart and gives lost cats and dogs a home - and one day also the orphan Jane, a problem child who already tried to kill herself once. At first Poppy is worried and wants to get rid of her, but with love and patience they finally manage to integrate her into the family. Just then Anne invites another orphan, the aggressive handicapped Jimmy-John, to their summer vacation.');
INSERT INTO movies VALUES (48645, 'Pagan Love Song', '1950-12-26', NULL, 76, 0, 'Island girl Mimi (Esther Williams) plans to leave Tahiti, but maybe she''ll have a reason to stay when Mr. Endicott (Howard Keel) arrives. Gorgeous, frothy fun with pristine Hawaiian locations filling in for Tahiti.');
INSERT INTO movies VALUES (48646, 'Androcles and the Lion', '1952-12-01', NULL, 98, 0, 'George Bernard Shaw’s breezy, delightful dramatization of this classic fable—about a Christian slave who pulls a thorn from a lion’s paw and is spared from death in the Colosseum as a result of his kind act—was written as a meditation on modern Christian values. And Pascal’s final Shaw production plays it broadly, casting comic character actor Alan Young as the titular naif. He’s ably supported by Jean Simmons, Victor Mature, Robert Newton, and Elsa Lanchester.');
INSERT INTO movies VALUES (48954, 'The ''Maggie''', '1954-02-25', NULL, 92, 0, 'The poor, elderly,.....and wily when it comes to parting those who can afford it from their money.....Scottish skipper of a broken-down old ''puffer'' boat (Alex Mackenzie) tricks an American tycoon into paying him to transport his personal cargo. When the aforementioned tycoon (Paul Douglas) learns of the trick, he attempts to track down the boat and remove his possessions.  Released in the United States as "High and Dry".');
INSERT INTO movies VALUES (49498, 'The Crooked Web', '1955-11-30', NULL, 77, 0, 'Undercover agents investigate a murderer in Chicago.');
INSERT INTO movies VALUES (49508, 'I Was a Communist for the FBI', '1951-05-05', NULL, 83, 0, 'A fact-based story about a man who posed as an American Communist for years as part of a secret plan to infiltrate their organization.');
INSERT INTO movies VALUES (72823, 'The Miami Story', '1954-05-03', NULL, 75, 0, 'A crime story taking place in the famous Florida city...');
INSERT INTO movies VALUES (136966, 'Barbed Wire', '1952-07-25', NULL, 61, 0, 'A cattle buyer (Gene Autry), a federal agent (Pat Buttram) and a newswoman (Anne James) snip a railroad plot.');
INSERT INTO movies VALUES (49616, 'The Miracle of Our Lady of Fatima', '1952-08-20', NULL, 102, 0, 'In 1917, three shepherd children living just outside Fatima, Portugal have visions of a lovely lady in a cloud. The anticlerical government wishes to squelch the Church; reports of religious experiences are cause for serious concern. Yet the children stand by their story, and the message of peace and hope the Lady brings. In the last vision, attended by thousands of people, the Lady proves her reality with a spectacular miracle that is seen by everyone present. Based on actual events at Fatima in the summer of 1917.');
INSERT INTO movies VALUES (50085, 'Ruby Gentry', '1952-12-25', 525000, 82, 0, 'A sexy but poor young girl marries a rich man she doesn''t love, but carries a torch for another man.');
INSERT INTO movies VALUES (50153, 'The Man from Planet X', '1951-04-27', 50000, 70, 0, 'While watching for a planet that may collide with earth, scientists stationed in Scotland are approached by a visitor from outer space.');
INSERT INTO movies VALUES (50356, 'Susan Slept Here', '1954-07-14', NULL, 98, 0, 'Suffering from a case of writer''s block, screenwriter Dick Powell and his witty gofer, Alvy Moore, get an unexpected visit from his cop friend on Christmas Eve. Knowing Powell is working on an upcoming juvenile delinquent script, his cop friend brings by his latest juvenile delinquent, Debbie Reynolds, to entrust with Powell for the holidays thinking she will inspire several new story lines for Powell''s script in the process as well as providing a place for Reynolds to spend the holidays outside of juvie hall. All plans go awry when Reynolds inserts herself between Powell and his fiance, Anne Frances, stealing him away all for herself in this May-December comedic love affair.');
INSERT INTO movies VALUES (50363, 'Summertime', '1955-01-01', NULL, 99, 0, 'Middle-aged Ohio secretary Jane Hudson has never found love and has nearly resigned herself to spending the rest of her life alone. But before she does, she uses her savings to finance a summer in romantic Venice, where she finally meets the man of her dreams, the elegant Renato Di Rossi. But when she learns that her new paramour is leading a double life, she must decide whether her happiness can come at the expense of others.');
INSERT INTO movies VALUES (50549, 'Belles on their Toes', '1952-05-01', NULL, 89, 0, 'The "Cheaper by the Dozen" crew is back, sans Clifton Webb. Lillian is struggling to make ends meet without her husband''s income, while Anne, Martha, and even Ernestine find romance.');
INSERT INTO movies VALUES (50926, 'The Great Rupert', '1950-03-01', NULL, 88, 0, 'A Christmas Wish is a heartwarming holiday classic about a family led by (Jimmy Durante) who is down on their luck at Christmas time.Shortly before Christmas, they move into an apartment where Rupert the squirrel lives in the attic rafters. Just as it seems that the holiday will come and go without so much as a Christmas tree, Rupert acts as the family''s guardian angel - not only saving Christmas, but changing their lives forever.');
INSERT INTO movies VALUES (51044, 'Carmen Jones', '1954-10-27', 750000, 105, 0, 'Version of the Bizet opera set in World War II, with new lyrics and an African-American cast.');
INSERT INTO movies VALUES (51136, 'Five Days', '1954-06-25', NULL, 75, 0, 'A man pays a hitman to kill him. Circumstances change and he tries to call off the hit but he has trouble getting the deal killed.');
INSERT INTO movies VALUES (51227, 'King Richard And The Crusaders', '1954-08-07', NULL, 114, 0, 'Based on Sir Walter Scott''s The Talisman, this is the story of the romantic adventures of Christians and Muslims during the battle for the Holy Land in the time of King Richard the Lionheart.');
INSERT INTO movies VALUES (51389, 'Excuse My Dust', '1951-06-29', NULL, 82, 0, 'Joe, inventor in an American Small town of 1895 has problems with his new invention, a car, driven with a gasoline motor. Everybody is making fun about his "crazy invention", only his girl friend believes in him. When he''s halfway successful, another woman tries to win his heart, and his girl-friend thinks he has quit with her. But on a race for those new horse-less vehicles, he gets in trouble and only his former girl friend is able to help him.');
INSERT INTO movies VALUES (51406, 'Neighbours', '1952-01-01', NULL, 8, 0, 'This film, shot in pixilation (a kind of stop-motion animation with actors), is about two neighbours who come to barbaric blows over a flower that straddles the property line.');
INSERT INTO movies VALUES (51411, 'Ma and Pa Kettle Go to Town', '1950-01-04', NULL, 79, 0, 'When Pa wins a jingle-writing contest, he and Ma head for New York City. They they get in trouble with gangsters when they lose some stolen money which they had already agreed to deliver to one of the thugs.');
INSERT INTO movies VALUES (51426, 'Battle Cry', '1955-02-02', NULL, 149, 0, 'The dramatic story of US marines in training, in combat and in love during World War II. The story centres on a major who guides the raw recruits from their training to combat. Based on the novel by Leon Uris.');
INSERT INTO movies VALUES (51572, 'I Love Lucy: The Movie', '1953-01-01', NULL, 80, 0, 'The film plays out, with three first-season episodes edited together into a single story: "The Benefit", "Breaking the Lease", and "The Ballet", with new footage included between episodes to help transition the episodes into one coherent storyline. As the series routinely took the format of filming scenes in chronological order, this adds to the "show within a show within a show" format of the film, as viewers watch the cast perform the episodes live. The film itself ends with a "curtain call", as the cast comes out and Arnaz thanks the audience for their support.');
INSERT INTO movies VALUES (51619, 'The Sound Barrier', '1952-12-21', NULL, 118, 0, 'Fictionalized story of British aerospace engineers solving the problem of supersonic flight.');
INSERT INTO movies VALUES (52364, 'Crisis', '1950-07-07', NULL, 95, 0, 'An American doctor gets caught in the middle of a revolution when he''s forced to operate on a South American dictator.');
INSERT INTO movies VALUES (52365, 'Dream Wife', '1953-06-19', NULL, 100, 0, 'Clemson Reade, a business tycoon with marriage on his mind, and Effie, a U.S. diplomat, are a modern couple. Unfortunately there seems to be too much business and not enough pleasure on the part of Effie. When Clemson meets Tarji, a princess trained in all the arts of pleasing men, he decides he wants an old fashioned girl. Princess Tarji''s father is king of oil-rich Bukistan. Because of the oil situation and to maintain good political relations during the courtship between Clemson &amp; Tarji, the State Department assigns a diplomat to maintain protocol until the wedding - Effie!');
INSERT INTO movies VALUES (52620, 'Little Fugitive', '1953-10-06', 30000, 80, 0, 'Joey Norton, seven years old, lives with his older brother Lennie in a lower middle class neighborhood of Brooklyn. Joey is too small to be taken seriously by Lennie and Lennie''s friends. One day, while their mother is away visiting her sick mother, Lennie and his friends play a joke on Joey. They stage an incident so that Joey thinks he has shot and killed his brother. Francois Truffault credits this classic with inspiring the French New Wave.');
INSERT INTO movies VALUES (52847, 'The Toast of New Orleans', '1950-08-24', NULL, 97, 0, 'Snooty opera singer meets a rough-and-tumble fisherman in the Louisiana bayous, but this fisherman can sing! Her agent lures him away to New Orleans to teach him to sing opera, but comes to regret this rash decision when the singers fall in love.');
INSERT INTO movies VALUES (52848, 'The West Point Story', '1950-11-25', NULL, 107, 0, 'A Broadway director helps the West Point cadets put on a show, aided by two lovely ladies and assorted complications.');
INSERT INTO movies VALUES (73307, 'No Man''s Woman', '1955-10-27', NULL, 70, 0, 'A greedy, scheming woman is found murdered in her studio, and the police find that there is no shortage of suspects who wanted to see her dead--among them a rich husband she wouldn''t divorce unless he paid her a huge settlement, a lover she caused to be fired from his job and an assistant whose fiancé she tried to seduce.');
INSERT INTO movies VALUES (73313, 'No Questions Asked', '1951-06-15', NULL, 80, 0, 'A young lawyer''s primrose path to success gets him framed for murder.');
INSERT INTO movies VALUES (52857, 'The Prisoner', '1955-04-19', NULL, 95, 0, 'A cardinal is arrested for treason against the state. As a prince of his church, and a popular hero of this people, for his resistance against the Nazis during the war and afterward his resistance when his country again fell to a totalitarian conqueror. In prison, his interrogator is determined to get a confession of guilt against the state from the strong willed man, and thus destroy his power over his people. The verbal and psychological battles are gripping and powerful - not even the increasing pressures put upon the Cardinal can force him to weaken; not even solitary confinement, continuous blazing light in his cell, sleeplessness, efforts to persuade him he is going mad. And yet, in the deepening conflict, the superb indomitable prisoner, creates a tremendous pity on his tormentor, the interrogator. Written by alfiehitchie');
INSERT INTO movies VALUES (52954, 'Rabbit Seasoning', '1952-09-20', NULL, 7, 0, 'The cartoon finds a row of signs saying it''s rabbit season ("If you''re looking for fun, you don''t need a reason. All you need is a gun, it''s Rabbit Season!"). Bugs Bunny and Daffy Duck again are arguing over which of them is “in season” (it is really Duck Season, as Daffy says in the beginning), while a befuddled Elmer Fudd tries to figure out which animal is telling the truth. Between using sneaky plays-on-words, and dressing himself in women''s clothing (including a Lana Turner-style sweater), Bugs manages to escape unscathed, while Daffy repeatedly has his beak blown off, upside-down, and sideways by Elmer.');
INSERT INTO movies VALUES (52991, 'My Son John', '1952-04-08', NULL, 122, 0, 'In this Cold War drama, a woman suspects her son is a Communist spy.');
INSERT INTO movies VALUES (53210, 'Duck Amuck', '1953-02-28', NULL, 7, 0, 'The short-tempered Daffy Duck must improvise madly as the backgrounds, his costumes, the soundtrack, even his physical form, shifts and changes at the whim of the animator.');
INSERT INTO movies VALUES (53211, 'One Froggy Evening', '1955-12-30', NULL, 7, 0, 'A workman finds a singing frog in the cornerstone of an old building being demolished. But when he tries to cash in on his discovery, he finds the frog will sing only for him, and just croak for the talent agent and the audience in the theater he''s spent his life savings on.');
INSERT INTO movies VALUES (53220, 'Rabbit Fire', '1951-05-19', NULL, 7, 0, 'Daffy Duck and Bugs argue back and forth whether it is duck season or rabbit season. The object of their arguments is hunter Elmer Fudd.');
INSERT INTO movies VALUES (53441, 'You''re Never Too Young', '1955-08-25', NULL, 102, 0, 'When an aspiring barber becomes inadvertently involved in the theft of a valuable diamond, necessity forces him to masquerade as a 12 year-old child - with humorous consequences.');
INSERT INTO movies VALUES (53651, 'Hangman''s Knot', '1952-11-15', NULL, 81, 0, 'In 1865, a troop of Confederate soldiers led by Major Matt Stewart attack the wagon of gold escorted by Union cavalry and the soldiers are killed. The only wounded survivor tells that the war ended one month ago, and the group decides to take the gold and meet their liaison that knew that the war ended but did not inform the troop. The harsh Rolph Bainter kills the greedy man and the soldiers flee in his wagon driven by Major Stewart. When they meet a posse chasing them, Stewart gives wrong information to misguide the group; however, they have an accident with the wagon and lose the horses. They decide to stop a stagecoach and force the driver to transport them, but the posse returns and they are trapped in the station with the passenger. They realize that the men are not deputies and have no intention to bring them to justice but take the stolen gold.');
INSERT INTO movies VALUES (53714, 'Another Man''s Poison', '1951-11-20', NULL, 90, 0, 'Novelist Janet Frobisher, lives in an isolated house, having been separated for years from her criminal husband. She has fallen in love with her secretary''s fiancé and when her estranged husband unexpectedly appears, Janet poisons him, but just as she''s about to dispose of the body, one of her husband''s criminal cohorts also shows up.');
INSERT INTO movies VALUES (53879, 'Love Is a Many-Splendored Thing', '1955-08-18', NULL, 102, 0, 'A widowed doctor of both Chinese and European descent falls in love with a married American correspondent in Hong Kong during China''s Communist revolution.');
INSERT INTO movies VALUES (54139, 'Fourteen Hours', '1951-04-01', NULL, 92, 0, 'A young man, morally destroyed by his parents not loving him and by the fear of being not capable to make his girlfriend happy, rises on the ledge of a building with the intention of committing suicide. A policeman makes every effort to argue him out of it.');
INSERT INTO movies VALUES (54392, 'The Blue Lamp', '1950-01-19', NULL, 84, 0, 'P.C. George Dixon (Warner) a long-serving traditional "copper" who is due to retire shortly, takes a new recruit, Andy Mitchell (Hanley), under his aegis, introducing him to the easy-going night beat. Dixon is a classic Ealing ''ordinary'' hero, but also anachronistic, unprepared and unable to answer the violence of Tom Riley (Bogarde). Called to the scene of a robbery at a local cinema, Dixon finds himself face-to-face with Riley, a desperate youth armed with a revolver. Dixon initially tries to talk Riley into surrendering the weapon, but Riley panics and fires. Dixon walks to his own death almost uncomprehending. Dixon is taken to hospital, but dies some hours later. The ending is another Ealing quirk, with ordinary decent society, including ''professional'' criminals used to violence, banding together to track down and catch the murderer, who is trapped in the crowd at White City greyhound track in west London. To Andy Mitchell falls the honour of arresting Riley.');
INSERT INTO movies VALUES (54615, 'When Willie Comes Marching Home', '1950-02-01', NULL, 82, 0, 'When Willie leaves home to join the war effort he is all ready to become a hero, but he is only frustrated when his posting ends up to be in his home town, and he is recruited into training, keeping him from the action. However, when he finds himself accidently behind enemy lines he unexpectedly becomes a hero after all.');
INSERT INTO movies VALUES (54979, 'Robinson Crusoe', '1954-08-05', 350000, 90, 0, 'Luis Bunuel made this adaptation of one of the world’s most famous shipwreck novels, Robinson Crusoe by Daniel Defoe, during his Mexican period. Despite the fact that the film veers from Bunuel’s “usual” style, for most it is considered the best film version of Defoe’s book, since the director left his personal touch on the story, and when that director is Bunuel, there’s little room for mediocrity..');
INSERT INTO movies VALUES (55441, 'Fancy Pants', '1950-07-19', NULL, 92, 0, 'An American actor impersonating an English butler is hired by a nouveau riche woman from New Mexico to refine her husband and headstrong daughter. The complications increase when the town believes the actor/butler to be an Ear and President Roosevelt decides to pay a visit.');
INSERT INTO movies VALUES (55472, 'Colt .45', '1950-07-20', NULL, 74, 0, 'Scott plays Steve Farrell, a Colt .45 salesman who has two of the prized guns stolen by Jason Brett (Zachary Scott). Armed with the guns, Brett begins a reign of terror, leading a gang of robbers and murderers.');
INSERT INTO movies VALUES (55531, 'Radio tekee murron', '1951-04-06', NULL, 91, 55, 'Eager young radio reporter Teräsvuori stages a one-man burglary into the Helsinki Art Museum, recorded on tape for a later broadcast by his friend Laakso. Things go awry when a gang of real criminals overhear their plans and book their heist to coincide. Teräsvuori gets caught but escapes from police custody to start his private investigations together with female radio colleague Eila.');
INSERT INTO movies VALUES (86608, 'Track of the Cat', '1954-11-27', NULL, 102, 0, 'A family saga: In a stunning mountain valley ranch setting near Aspen, complex and dangerous family dynamics play out against the backdrop of the first big snowstorm of winter and an enormous panther with seemingly mythical qualities which is killing cattle.');
INSERT INTO movies VALUES (54769, 'Drei Manner im Schnee', '1955-07-14', NULL, NULL, 3, 'nan');
INSERT INTO movies VALUES (55859, 'Knock On Wood', '1954-04-06', NULL, 103, 0, 'Ventriloquist Jerry Morgan has failed with another love affair. The reason: when the relationship reaches the point when it is time to discuss marriage, his doll Clarence becomes mean and jealous. His fiancée Audrey leaves him and Jerry smashes his two dolls, Clarence and Terrence. Morgan''s dollmaker Papinek is member of a spy ring who has stolen the secret plans to the top secret Lafayette airplane. Since Morgan is leaving for Zurich the same night, he decides to use Morgan''s dolls as a mailbox and hides the secret plan in the heads of the dolls. Another secret spy ring also wants to get their hands on Jerry''s luggage and they *also* follow him. Eventually, Jerry is chased by both these organizations as well as the police, who suspects him of murder.');
INSERT INTO movies VALUES (56122, 'L''oro di Napoli', '1954-12-03', NULL, 131, 0, 'Tribute to Naples, where director De Sica spent his first years, this is a collection of 6 Napolitean episodes : a clown exploited by a gangster ; an inconstant pizza seller (Sofia) loosing her husband''s ring ; the funeral of a dead child ; the gambler Count Prospero B. defeated by a kid ; the unexpected and unusual wedding of Teresa, a prostitute ; the "professor" Ersilio Micci, a "wisdom seller".');
INSERT INTO movies VALUES (56290, 'Attila', '1954-05-18', NULL, 79, 0, 'Attila, the leader of the barbarian Huns and called by the Romans "The Scourge of God", sweeps onto the Italian peninsula, defeating all of the armies of Rome, until he and his men reach the gates of the city itself.');
INSERT INTO movies VALUES (57258, 'The Indian Fighter', '1955-12-21', NULL, 88, 0, 'A scout leading a wagon train through hostile Indian country unwittingly gets involved with a Sioux chief''s daughter');
INSERT INTO movies VALUES (57575, 'The Last Time I Saw Paris', '1954-01-01', NULL, 116, 0, 'Charles returns to Paris to reminisce about the life he led in Paris after it was liberated. He worked on "Stars and Stripes" when he met Marion and Helen. He would marry and be happy staying in Paris after his discharge and working for a news organization. He would try to write his great novel and that would come between Charlie, his wife and his daughter');
INSERT INTO movies VALUES (57849, 'Casanova''s Big Night', '1954-04-07', NULL, 86, 0, 'Italy 1757, Pippo Popolino, a lowly tailor, disguises himself as the great Casanova in order to romance the attractive widow Francesca. He little suspects what awaits him... Locked into the incongruous role by the desperation of the real Casanova''s creditors, Pippo must journey to Venice on a delicate mission far beyond his capabilities.');
INSERT INTO movies VALUES (58182, 'The Stooge', '1952-12-31', NULL, 100, 0, 'Bill Miller is an unsuccessful Broadway performer until his handlers convince him to enhance his act with a stooge - Ted Rogers, a guy positioned in the audience to be the butt of Bill''s jokes. But Ted begins to steal the show. Bill''s girlfriend and his pals tell him to make Ted an equal partner. Complications occur, while Bill sings and Ted gets the laughs.');
INSERT INTO movies VALUES (58757, 'Heidi', '1952-11-13', NULL, 100, 3, 'nan');
INSERT INTO movies VALUES (59087, '5 Fingers', '1952-02-22', NULL, 108, 0, 'During WWII the valet to the British Ambassador to Ankara sells British secrets to the Germans while trying to romance a refugee Polish countess.');
INSERT INTO movies VALUES (59401, 'The Red Badge of Courage', '1951-03-16', 1640000, 69, 0, 'Truncated adaptation of Stephen Crane''s novel about a Civil War Union soldier who stuggles to find the courage to fight in the heat of battle.');
INSERT INTO movies VALUES (59895, 'Sudden Danger', '1955-12-14', NULL, 85, 0, 'Det Andy Doyle (Bill Elliott) suspects that a suicide is actually a murder. He suspects the victim''s son, Wallace (Tom Drake) who is blind and he pursues him until he gets to the truth..');
INSERT INTO movies VALUES (60539, 'The Cimarron Kid', '1952-01-13', NULL, 84, 0, 'Audie Murphy comes into his own as a Western star in this story. Wrongly accused by crooked railroad officials of aiding a train heist by his old friends the Daltons, he joins their gang and becomes an active participant in other robberies. Betrayed by a fellow gang member, Murphy becomes a fugitive in the end. Seeking refuge at the ranch of a reformed gang member, he hopes to flee with the man''s daughter to South America, but he''s captured in the end and led off to jail. The girl promises to wait.');
INSERT INTO movies VALUES (60547, 'The Duel at Silver Creek', '1952-08-01', NULL, 77, 0, 'A gang of claim jumpers is infesting the territory, gaining ownership of undermanned mining operations through extortion...and leaving no live witnesses. But one victim, quick-drawing gambler Luke Cromwell, escapes. Meanwhille, Marshal Lightnin'' Tyrone is also after the gang; recovering from one raid, he meets femme fatale Opal Lacy, who may not be healthy for him to know. When Luke, now calling himself the Silver Kid, joins forces with Marshal Tyrone, the gang had better watch out ...unless something drives a wedge between the new allies.');
INSERT INTO movies VALUES (60551, 'War Arrow', '1954-01-01', NULL, 78, 0, 'A thrilling Cavalry-versus-Indians adventure starring Jeff Chandler as an Army official recruiting Seminole allies, against his superior''s wishes, to stop a planned Kiowa attack.');
INSERT INTO movies VALUES (60643, 'The Violent Men', '1955-01-26', NULL, 96, 0, 'A former Union Army officer plans to sell out to Anchor Ranch and move east with his fiancée, but the low price offered by Anchor''s crippled owner and the outfit''s bullying tactics make him reconsider. When one of his hands is murdered he decides to stay and fight, utilizing his war experience. Not all is well at Anchor with the owner''s wife carrying on with his brother who also has a Mexican woman in town.');
INSERT INTO movies VALUES (60853, 'Jim Thorpe – All-American', '1951-08-24', NULL, 107, 0, 'The triumph and tragedy of Native Anerican Jim Thorpe, who, after winning both the pentathlon and decathlon in the same Olympics, is stripped of his medals on a technicality.');
INSERT INTO movies VALUES (60908, 'Breakthrough', '1950-11-17', NULL, 91, 0, 'Filmed with the full cooperation of the U.S. Army, Breakthrough is a lean, no-nonsense war film set during the 1944 invasion of the continent.');
INSERT INTO movies VALUES (60966, 'My Sister Eileen', '1955-09-22', NULL, 108, 0, 'Ruth and her beautiful sister Eileen come to New York''s Greenwich Village looking for "fame, fortune and a ''For Rent'' sign on Barrow Street". They find an apartment, but fame and fortune are a lot more elusive. Ruth gets the attention of playboy publisher Bob Baker when she submits a story about her gorgeous sister Eileen. She tries to keep his attention by convincing him that she and the gorgeous, man-getting Eileen are one and the same person.');
INSERT INTO movies VALUES (61002, 'For Better, for Worse', '1954-06-20', NULL, 85, 2, 'In postwar London a young graduate and his girlfriend decide to marry. Her well-to-do parents are not convinced, but they agree once he has got a L5.10.0 job and a 30/- a week single-room flat. The newly-weds find money fearfully tight, the flat cramped, the neighbours a trial, and her parents always hovering. Can faith conquer all? Is there some way of getting rid of tea-leaves except down the sink?');
INSERT INTO movies VALUES (61049, 'Arrowhead', '1953-08-03', NULL, 105, 0, 'Director Charles Marquis Warren''s 1953 western stars Charlton Heston and Jack Palance.');
INSERT INTO movies VALUES (61080, 'Pluto''s Christmas Tree', '1952-11-21', NULL, 7, 0, 'Pluto comes bounding outside to help Mickey get a Christmas tree. Chip ''n Dale see him and make fun of him, but the tree they take refuge in is the one Mickey chops down. They like the decorations, especially the candy canes and Mickey''s bowl of mixed nuts. But Pluto spots them and goes after them long before Mickey spots them. Minnie, Donald, and Goofy drop by to sing carols.');
INSERT INTO movies VALUES (93775, 'The Member of the Wedding', '1952-12-25', NULL, 93, 0, 'Carson  McCullers stage hit brought to the screen by Fred Zinnemann starring Ethel Waters and Julie Harris. Tomboy Julie Harris dreams of running away with her brother and new fiancee away from the Deep South.');
INSERT INTO movies VALUES (61095, 'The Turning Point', '1952-11-15', NULL, 85, 0, 'Special prosecutor John Conroy hopes to combat organized crime in his city, and appoints his cop father Matt as chief investigator. John doesn''t understand why Matt is reluctant, but cynical reporter Jerry McKibbon thinks he knows: he''s seen Matt with mob lieutenant Harrigan. Jerry''s friendship for John is tested by the question of what to do about Matt, and by his attraction to John''s girl Amanda. Meanwhile, the threatened racketeers adopt increasingly violent means of defense.');
INSERT INTO movies VALUES (61138, 'The Whip Hand', '1951-10-01', NULL, 82, 0, 'A small-town reporter investigates a mysterious group holed up in a country lodge.');
INSERT INTO movies VALUES (61391, 'Distant Drums', '1951-12-25', NULL, 101, 0, 'After destroying a Seminole fort, American soldiers and their rescued companions must face the dangerous Everglades and hostile Indians in order to reach safety');
INSERT INTO movies VALUES (61430, 'Affair in Trinidad', '1952-07-29', NULL, 98, 0, 'A nightclub singer enlists her brother-in-law to track down her husband''s killer.');
INSERT INTO movies VALUES (61501, 'Between Midnight and Dawn', '1950-10-01', NULL, 89, 0, 'Rocky and Dan, war buddies, are prowl car cops on night duty. Dan is a cynic who views all lawbreakers as scum; Rocky feels more lenient. Both are attracted to the radio voice of communicator Kate Mallory; but in person, Kate proves reluctant to get involved with men who just might stop a bullet. By lucky chance, Rocky and Dan cause big trouble for murderous racketeer Ritchie Garris; but when he swears vengeance, Kate''s fears may prove justified.');
INSERT INTO movies VALUES (61502, 'Stolen Identity', '1953-01-01', NULL, 88, 0, 'A jealous musician kills his wife and frames a cab driver.');
INSERT INTO movies VALUES (61855, 'The Painted Hills', '1951-05-04', NULL, 68, 0, 'After years of prospecting, Jonathan finally strikes gold. He returns to town only to discover that his partner has since died and left Tommy fatherless. He decides to leave Shep (played by Lassie) with Tommy to cheer him up. Meanwhile, Jonathan''s new partner, Lin, isn''t interested in sharing the gold, and lures Jonathan to his death. Lassie immediately deduces what''s happened, so Lin poisons Lassie. Lassie barely pulls through and pursues Lin to a climactic confrontation where, due to an off-screen accident with some liquid nitrogen, Lin''s gun jams.');
INSERT INTO movies VALUES (61880, 'Strategic Air Command', '1955-07-12', NULL, 112, 0, 'Air Force reservist Lt. Col. Robert (Dutch) Holland is recalled into active duty at the peak of his baseball career.');
INSERT INTO movies VALUES (61934, 'The Long Gray Line', '1955-02-09', NULL, 138, 0, 'The life story of a salt-of-the-earth Irish immigrant, who becomes an Army Noncommissioned Officer and spends his 50 year career at the United States Military Academy at West Point. This includes his job-related experiences as well as his family life and the relationships he develops with young cadets with whom he befriends. Based on the life of a real person.');
INSERT INTO movies VALUES (61936, 'The Reformer and the Redhead', '1950-05-05', NULL, 90, 0, 'A small-town politician falls for an idealistic zookeeper.');
INSERT INTO movies VALUES (61988, 'The Naked Jungle', '1954-03-03', NULL, 95, 0, 'The Leiningen South American cocoa plantation is threatened by a 2-mile-wide, 20-mile-long column of army ants.');
INSERT INTO movies VALUES (62006, 'The Captive City', '1952-03-26', NULL, 91, 0, 'A small-town newspaper editor defies threats to expose the mob.');
INSERT INTO movies VALUES (62188, 'The Next Voice You Hear....', '1950-06-29', NULL, 83, 0, 'The Next Voice You Hear... (1950) is a drama film in which a voice claiming to be that of God preempts all radio programs for days all over the world. It stars James Whitmore and Nancy Davis as Joe and Mary Smith, a typical American couple. It was based on a short story of the same name by George Sumner Albee.');
INSERT INTO movies VALUES (62395, 'Marcelino pan y vino', '1954-02-24', NULL, 91, 2, 'Left on the doorstep of a monastery as an infant, Marcelino was raised by the monks. He was well-cared for but lonely and missed having a mother. One day he found a special friend in the forbidden attic, hanging on a cross. A friend that would repay Marcelino''s kindness by granting him one heart-felt wish.');
INSERT INTO movies VALUES (62396, '3 Ring Circus', '1954-12-22', NULL, 103, 0, 'Jerry and Pete are two friends with no money and are looking for a job. They finally find employment working in a circus, but Jerry has different dreams. He wants to become a clown...');
INSERT INTO movies VALUES (62661, 'The Second Woman', '1950-07-07', NULL, 91, 0, 'In flashback from a ''Rebecca''-style beginning: Ellen Foster, visiting her aunt on the California coast, meets neighbor Jeff Cohalan and his ultramodern clifftop house. Ellen is strongly attracted to Jeff, who''s being plagued by unexplainable accidents, major and minor. Bad luck, persecution...or paranoia? Warned that Jeff could be dangerous, Ellen fears that he''s in danger, as the menacing atmosphere darkens.');
INSERT INTO movies VALUES (62722, 'The Green Glove', '1952-02-28', NULL, 89, 0, 'In World War II France, American soldier Michael Blake captures, then loses Nazi-collaborator art thief Paul Rona, who leaves behind a gem studded gauntlet (a stolen religious relic). Years later, financial reverses lead Mike to return in search of the object. In Paris, he must dodge mysterious followers and a corpse that''s hard to explain; so he and attractive tour guide Christine decamp on a cross-country pursuit that becomes love on the run...then takes yet another turn.');
INSERT INTO movies VALUES (62753, 'Beachhead', '1954-02-05', NULL, 90, 0, 'On a Japanese-occupied island during World War II, only two soldiers remain alive after a mission attempt goes horribly wrong. Trapped on the island, they must escort a scientist and his daughter to the other side of the island where their ship awaits. They must battle nature, hard terrain, and advancing Japanese troops.');
INSERT INTO movies VALUES (63333, 'Gog', '1954-06-04', 250000, 85, 0, 'A mechanical brain is programmed to sabotage the government''s secret lab while working on the first space station.');
INSERT INTO movies VALUES (63618, 'The Left Hand of God', '1955-09-02', NULL, 87, 0, 'A man in priestly robes, seemingly the long-awaited Father O''Shea, arrives at a little-frequented Catholic mission in 1947 China. Though the man seems curiously uncomfortable with his priestly duties, his tough tactics prove very successful in the Seven Villages, as around them China disintegrates in civil war and revolution. But he has a secret, and his friendship with mission nurse Anne (an attractive war widow) seems to be taking on an unpriestly tone.');
INSERT INTO movies VALUES (63795, 'Abbott and Costello Meet Captain Kidd', '1952-12-27', 450, 70, 0, 'Two hapless waiters in a tavern on the Spanish Main play cupid between aristocratic Lady Jane and tavern co-worker Bruce Martindale, but the two bumpkins mix-up a love letter with Captain Kidd''s treasure map of Skull Island, leading to them being kidnapped and taken off to the notorious pirate''s island.');
INSERT INTO movies VALUES (63858, 'All I Desire', '1953-06-25', NULL, 79, 0, 'In 1910, a wayward mother re-visits the family she deserted.');
INSERT INTO movies VALUES (64071, 'Tobor the Great', '1954-09-01', NULL, 77, 0, 'To avoid the life-threatening dangers of manned space exploration, Professor Nordstrom creates highly advanced form of artificial intelligence capable of piloting a starship to other worlds. In order to transmit alien data, the extraordinary robot is infused with a powerful telepathic device that enables it to instantly read and even feel emotions. Danger strikes when a sinister band of covert agents kidnaps Gadge, the professor''s 10-year-old grandson. But Gadge has a powerful ally. For he has developed a psychic, emotional bond with his grandfather''s robot. And now Gadge''s captors must suffer the wrath of his protective friend. They must face a mechanical monstrosity bent on a killing rampage of revenge and destruction.');
INSERT INTO movies VALUES (64456, 'The Lawless', '1950-06-01', NULL, 83, 0, 'A newspaper editor takes on the cause of oppressed migrant Mexican fruit pickers..');
INSERT INTO movies VALUES (64851, 'The Sword and the Rose', '1953-07-23', NULL, 92, 0, 'Tells the story of Mary Tudor and her troubled path to true love. Henry VIII, for political reasons, determines to wed her to the King of France. She tries to flee to America with her love but is captured when she is "un-hatted" on board ship. In return for her consent to the marriage with France, Henry agrees to let her choose her second husband. When King Louis of France dies, Mary is kidnaped by the Duke of Buckingham. He tries to force her to marry him but she is rescued by her love in an exciting battle on the beach.');
INSERT INTO movies VALUES (65014, 'Female on the Beach', '1955-08-19', NULL, 97, 0, 'Lynn Markham moves into her late husband''s beach house...the morning after former tenant Eloise Crandall fell (or was pushed) from the cliff. To her annoyance, Lynn finds both her real estate agent and Drummond Hall, her muscular beachcomber neighbor, making themselves quite at home. Lynn soon has no doubts of what her scheming neighbors are up to, but she finds Drummond''s physical charms hard to resist. And she still doesn''t know what really happened to Eloise.');
INSERT INTO movies VALUES (65114, 'The Cockleshell Heroes', '1955-11-16', NULL, 97, 0, 'During WW2, German ships are "safely" docked upriver at Bordeaux, but the British send a team of kayakers to attack them.');
INSERT INTO movies VALUES (65212, 'The Silver Chalice', '1954-12-20', 4500000, 142, 0, 'A Greek artisan is commissioned to cast the cup of Christ in silver and sculpt around its rim the faces of the disciples and Jesus himself. He travels to Jerusalem and eventually to Rome to complete the task. Meanwhile, a nefarious interloper is trying to convince the crowds that he is the new Messiah by using nothing more than cheap parlor tricks.');
INSERT INTO movies VALUES (65282, 'Gambling House', '1950-12-27', NULL, 80, 0, 'A gambler faces deportation when he gets mixed up with murder.');
INSERT INTO movies VALUES (65283, 'Les Orgueilleux', '1953-11-25', NULL, NULL, 0, 'The first to die in an epidemic of meningitis in Vera Cruz is a French tourist. His wife Nellie, detached and indifferent, feels little grief and realizes that her coldness is her own doom. Over the next two days, she is attracted to George, a local drunk who does odd jobs for brothels and dances grotesquely for tourists in exchange for drinks. George has his own dark secret, a tragedy he caused that leaves him with a death wish. In assisting the local doctor to cope with the epidemic, these two emotional cripples enable each other to rediscover reasons to live and to love.');
INSERT INTO movies VALUES (65421, 'Eaux d''artifice', '1953-01-01', NULL, 12, 0, 'A woman dressed elegantly walks purposely through the water gardens at the Villa d''Este in Tivoli, as the music of Vivaldi''s Winter movement of The Four Seasons plays. Heavy red filters give a blue cast to the light; water plays across stone, and fountains send it into the air. No words are spoken. Baroque statuary and the sensuous flow of water are back lit. Anger calls it water games.');
INSERT INTO movies VALUES (65489, 'Malta Story', '1953-06-01', NULL, 97, 0, 'In 1942 Britain was clinging to the island of Malta since it was critical to keeping Allied supply lines open. The Axis also wanted it for their own supply lines. Plenty of realistic reenactments and archival combat footage as the British are beseiged and try to fight off the Luftwaffe. Against this background, a RAF reconnaissance photographer''s romance with a local girl is endangered as he tries to plot enemy movements.');
INSERT INTO movies VALUES (65550, 'The Rose Tattoo', '1955-12-12', NULL, 117, 0, 'A grieving widow embarks on a new romance when she discovers her late husband had been cheating on her.');
INSERT INTO movies VALUES (65586, 'Davy Crockett, Indian Scout', '1950-01-06', NULL, 71, 0, 'It''s 1848 and a wagon train with an Army escort is heading west through Indian territory, It''s scout is Davy Crockett, nephew of his more famous namesake. There is spy amongst them informing the Indians. They survive the first Indian attack and then push on. They have a choice of two passes through the mountains. Learing of the pass to be defended by the Indians, they head for the other. But upon ariving, the Indians attack. Somehow they have been informed.');
INSERT INTO movies VALUES (65787, 'With a Song in My Heart', '1952-04-03', NULL, 117, 0, 'Jane Froman (Susan Hayward), an aspiring songstress, lands a job in radio with help from pianist Don Ross (David Wayne), whom she later marries. Jane''s popularity soars, and she leaves on a European tour... but her plane crashes in Lisbon, and she is partially crippled. Unable to walk without crutches, Jane nevertheless goes on to entertain the Allied troops in World War II.');
INSERT INTO movies VALUES (65799, 'The Sea Shall Not Have Them', '1954-06-01', NULL, 91, 0, 'During autumn of 1944, an RAF Hudson carrying a VIP passenger in possession of highly secret information is shot down and ditches in the North Sea. Fighting the elements and trying to keep up morale, the occupants of the aircraft''s dinghy talk about their lives awaiting the rescue they hope will come. The film''s title reflects the motto of the RAF''s Air Sea Rescue Service, one of whose high speed launches battles against its own mechanical problems, enemy action, time and the weather to locate and rescue the downed crew and the vital secret papers they carry.');
INSERT INTO movies VALUES (65994, 'Prince Valiant', '1954-04-05', 2970000, 100, 0, 'A young Viking prince strives to become a knight in King Arthur"s Court and restore his exiled father to his rightful throne.');
INSERT INTO movies VALUES (66035, 'The Kentuckian', '1955-08-01', NULL, 104, 0, 'A frontiersman and his son fight to build a new home in Texas.');
INSERT INTO movies VALUES (66175, 'I Was a Shoplifter', '1950-05-13', NULL, 74, 0, 'A police detective uses any means possible to trap a gang of shoplifters.');
INSERT INTO movies VALUES (66878, 'Home Made Home', '1951-03-23', NULL, 7, 0, 'Goofy''s building a house, and struggling with the blueprints, the window glass, the paint, and finally the house-warming guests.');
INSERT INTO movies VALUES (67145, 'No Smoking', '1951-11-23', NULL, 6, 0, 'Goofy (again playing George Geef) is a nicotine addict to the extreme. He smokes while doing income tax, before going to bed, after waking up in the morning, and at work. Finally, he decides to quit. He soon learns it''s not as easy as that and everywhere he looks, he is tempted to start again until he finally cracks. He runs everywhere yelling, "Smoke! Smoke! Smoke!" but with no luck. Finally, he asks a man for a cigar and the man gladly gives him one...an exploding cigar which finally has Goofy vowing, "I quit!".');
INSERT INTO movies VALUES (67313, 'One Wild Oat', '1951-05-16', NULL, 77, 0, 'A barrister (Robertson Hare) attempts to discourage his daughter''s infatuation for a philanderer by revealing his past. The plan backfires when the daughter''s would-be father-in-law (Stanley Holloway) threatens to reveal the barrister''s shady background.');
INSERT INTO movies VALUES (67409, 'Duck Dodgers in the 241th Century', '1953-07-25', NULL, 7, 0, 'Space hero Daffy battles Marvin the Martian for control of Planet X.');
INSERT INTO movies VALUES (67699, 'Trick or Treat', '1952-10-10', NULL, 8, 0, 'Donald''s nephews come by for halloween and  plays tricks on them. But Witch Hazel was watching, and offers to help the boys get even. She brews up a potion that animates inanimate objects and sics them on . He initially agrees to treat the boys, until he hears the witch call him a "pushover". She animates his feet to get him to cough up the key to his pantry.');
INSERT INTO movies VALUES (131074, 'Hunted', '1952-03-17', NULL, 84, 0, 'Violent fugitive and mistreated small boy team up to flee from authority.');
INSERT INTO movies VALUES (68242, 'Doctor in the House', '1954-03-23', NULL, 92, 0, 'The first of the seven "Doctor" films, based on Richard Gordon''s novels and released between 1954 and 1970.  Simon Sparrow is a newly arrived medical student at St Swithin''s hospital in London. Falling in with three longer-serving hopefuls he is soon immersed in the wooing, imbibing and fast sports-car driving that constitute 1950''s medical training. There is, however, always the looming and formidable figure of chief surgeon Sir Lancelot Spratt to remind them of their real purpose.');
INSERT INTO movies VALUES (68309, 'The Wooden Horse', '1950-10-16', NULL, 101, 0, 'True story of three British POWs and their attempt to escape from Nazi Germany');
INSERT INTO movies VALUES (68339, 'Doctor at Sea', '1955-01-01', NULL, 93, 0, 'The second of the seven "Doctor" films, based on Richard Gordon''s novels and released between 1954 and 1970. A bachelor doctor goes to sea to escape the boredom of shore practice, but studies the nurses more than medicine, and Brigitte Bardot is around.');
INSERT INTO movies VALUES (68443, 'The Glass Menagerie', '1950-09-28', NULL, 107, 0, 'An aging Southern Belle makes life horrible for her ambitious son and crippled daughter because of her dreams of what life should be.');
INSERT INTO movies VALUES (68976, 'The Unknown Man', '1951-11-16', NULL, 86, 0, 'A scrupulously honest lawyer discovers that the client he"s gotten off was really guilty.');
INSERT INTO movies VALUES (68977, 'So Big', '1953-10-21', NULL, 101, 0, 'After the death of her father and the loss of his fortune, Selina takes a job teaching school in the Dutch community of New Holland. She stays with the Pools and teaches young Roelf piano. He has a crush on her, but it is Pervus she marries. Dirk is their only child. After a few years Pervus dies. With a young child and only the farm, Selina begins her quest to grow high quality vegetables. She wants more for Dirk and guides his life until he graduates from college as an architect. As her vegetable label prospers, she sees Paula control Dirk''s life as he moves away from creating and into sales, which is not where he wants to go.');
INSERT INTO movies VALUES (69592, 'Iron Man', '1951-08-18', NULL, 81, 0, 'In Coaltown, Pennsylvania, miner Coke Mason hopes to better himself, buy a radio store, and marry Rose Warren. His gambler brother George thinks Coke can be more successful as a boxer, knowing that when he fights he''s consumed with a murderous rage that makes him an "iron man." Seeing dollar signs in Rose''s eyes, Coke reluctantly agrees, though he''s fearful of the "killer instinct" that makes him a knockout success in the ring...and brings him the booing hatred of the fans. Will Coke throw off his personal demon before he kills someone?');
INSERT INTO movies VALUES (69784, 'Anne of the Indies', '1951-10-18', NULL, 81, 0, 'After seizing an English ship, buccaneer captain Anne Providence spares Pierre LaRochelle from walking the plank - as he''s in irons he is presumably no friend of England. He signs on as a pirate and she is increasingly drawn to him, a feeling that seems to be reciprocated. When fearsome Captain Blackbeard, her teacher in the ways of pirating, sets eyes on LaRochelle he recalls him as a French navy officer. Anne sticks by her man but the truth, when it is uncovered, is even more painful.');
INSERT INTO movies VALUES (70192, 'Count Three and Pray', '1955-10-01', NULL, 102, 0, 'A pastor with a shady past moves into a rural town just after the Civil War.');
INSERT INTO movies VALUES (70313, 'Bowery to Bagdad', '1955-01-07', NULL, 64, 0, 'The Bowery Boys find a lamp that has strange magic powers.');
INSERT INTO movies VALUES (71243, 'Flat Top', '1952-10-26', NULL, 83, 0, 'A rock hard commander trains Navy Carrier Pilots during the Second World War');
INSERT INTO movies VALUES (71839, 'The Moon Is Blue', '1953-07-08', NULL, 99, 0, 'Two aging playboys are both after the same attractive young woman, but she fends them off by claiming that she plans to remain a virgin until her wedding night. Both men determine to find a way around her objections.');
INSERT INTO movies VALUES (72083, 'Muerte de un ciclista', '1955-05-08', NULL, 88, 2, 'A couple having an affair strike a bicyclist with their car and do not offer aid out of fear of their relationship being exposed.');
INSERT INTO movies VALUES (72313, 'Gorilla at Large', '1954-05-01', NULL, 83, 0, 'At a carnival called the Garden of Evil, a man is murdered, apparently by a gorilla...or someone in a gorilla suit.');
INSERT INTO movies VALUES (72471, 'Thunder Over the Plains', '1953-10-27', NULL, 82, 0, 'Set in 1869, after the Civil War, Texas had not yet been readmitted to the Union and carpetbaggers, hiding behind the legal protection of the Union Army of occupation, had taken over the state. Federal Captain Porter (Randolph Scott), a Texan, has to carry out orders against his own people. He brings in the rebel leader Ben Westman, (Charles McGraw), whom he knows is innocent of a murder that he is accused of. In trying to prove his innocence, Porter himself becomes a wanted man.');
INSERT INTO movies VALUES (72472, 'Carson City', '1952-06-13', NULL, 87, 0, 'Mine owner William Sharon (Larry Keating) keeps having his gold shipments held up by a gang of bandits. Sharon hires banker Charles Crocker (Thurston Hall), who happens to have connections in the Central Pacific Railroad, to build a spur line from Virginia City to Carson City, so that the gold can be shipped by railroad. Silent Jeff Kincaid (Randolph Scott) is the railroad engineer. However there is opposition to the railroad, chiefly from another mine owner, Big Jack Davis (Raymond Massey).');
INSERT INTO movies VALUES (72474, 'Fort Worth', '1951-07-14', NULL, 80, 0, 'Former gunfighter Ned Britt (Randolph Scott) sets up shop in Fort Worth, Texas as a newspaper man. He falls in love with Flora Talbot (Phyllis Thaxter), who is the fiancée of a former friend, Blair Lunsford (David Brian). Britt tries to expose the crooked cattle baron Gabe Clevinger (Ray Teal) in his newspaper. Clevinger resorts to violence in order to prevent the arrival of the railroad at Fort Worth and Britt has to rethink his journalistic methods to stop him and resort to violence himself.');
INSERT INTO movies VALUES (72479, 'Lightning Strikes Twice', '1951-04-12', NULL, 91, 0, 'Richard Trevelyan (Richard Todd) was convicted of murdering his wife, given an 11th-hour Death Row reprieve and freed under unusual circumstances after retrial. But his past does not matter to Shelley Carnes (Ruth Roman), an actress visiting the Texas ranchland that Richard calls home. She’s fallen in love with him. But after she becomes the second Mrs. Trevelyan, Shelley is beset by doubts and fear. The director and screenwriter of Bette Davis’s Beyond the Forest – King Vidor (The Fountainhead) and Lenore Coffee (The End of the Affair) – reteam in a richly atmospheric mix of mystery, romance and murder sparked by a luminous cast that also includes Mercedes McCambridge and Zachary Scott.');
INSERT INTO movies VALUES (72613, 'What Price Glory', '1952-08-22', NULL, 110, 2, 'This remake of the 1926 silent film classic and play follows the adventures of a group of Marines stationed in France during World War I. Two military men, Captain Flagg (James Cagney) and Sergeant Quirt (Dan Dailey), who are rivals to begin with, grow more at odds with each other when Quirt is made Flagg''s top sergeant. And when a local beauty (Corinne Calvet) comes between them, their rivalry escalates even further. But when they discover that the woman has marriage in mind, they now compete to try to avoid marching down the aisle - that is, until they are called upon to march into battle - in this compelling film that also stars Robert Wagner and William Demarest.');
INSERT INTO movies VALUES (73369, 'Shakedown', '1950-09-01', NULL, 80, 0, 'In "Shakedown," Howard Duff plays a photographer who will stop at nothing to climb his way to the very top of the success ladder. On the strength of his sheer tenacity, he gets a job with a major newspaper, and it''s not long before he''s made a name for himself by charming a notorious crime boss (Brian Donlevy) into allowing himself to be photographed. Donlevy takes him under his wing, but Duff decides to bite the hand that feeds him and sets Donlevy and another crime boss, Lawrence Tierney, against one another. He uses photos to blackmail Tierney into providing him with a steady income while he sidles up to Donlevy''s wife on the sly, all the while romancing the photo editor of the paper at which he works.');
INSERT INTO movies VALUES (73492, 'Outrage', '1950-09-27', NULL, 75, 0, 'A young woman who has just become engaged has her life completely shattered when she is raped while on her way home from work.');
INSERT INTO movies VALUES (73551, 'Tarzan''s Savage Fury', '1952-03-14', NULL, 81, 0, 'The jungle king''s cousin tries to get him to help find a diamond treasure.');
INSERT INTO movies VALUES (73896, 'Apache Drums', '1951-04-01', NULL, 75, 0, 'A gambler is thrown out of a western town, but returns when the town is suddenly threatened by a band of marauding Apaches.');
INSERT INTO movies VALUES (73907, 'The Purple Plain', '1954-11-25', NULL, 100, 0, 'After losing his bride in a Luftwaffe air raid, bomber pilot Forrester becomes a solitary killing machine, who doesn''t care whether he dies. The reckless Canadian pilot is both admired and feared by the rest of his squadron in World War II Burma. The squadron physician is assigned to determine the embittered Bill Forrester''s fitness for duty. To break through the nightmare-haunted man''s wall of silence, the physician drives Forrester to visit an outpost of English-speaking refugees, which includes an alluring young Burmese woman.');
INSERT INTO movies VALUES (74074, 'The Raid', '1954-08-04', NULL, 83, 0, 'A group of confederate prisoners escape to Canada and plan to rob the banks and set fire to the small town of Saint Albans in Vermont. To get the lie of the land, their leader spends a few days in the town and finds he is getting drawn into its life and especially into that of an attractive widow and her son.');
INSERT INTO movies VALUES (74122, 'The Bigamist', '1953-12-03', NULL, 80, 0, 'Mr Graham, a travelling salesman, is married to two women, Eve and Phyllis. Eventually, the truth comes out.');
INSERT INTO movies VALUES (74436, 'The World in His Arms', '1952-10-09', NULL, 104, 0, 'Gregory Peck is a boisterous sea captain in the Pacific Coast, circa 1850, who has a plan to buy Alaska from the Russians… if they don’t kill him first.');
INSERT INTO movies VALUES (74437, 'The Secret Fury', '1950-02-21', NULL, 85, 0, 'A mysterious figure tries to stop a woman''s marriage by driving her mad.');
INSERT INTO movies VALUES (74753, 'The Sleeping Tiger', '1954-06-21', NULL, 89, 0, 'A petty thief breaks into the home of a psychiatrist and gets caught in a web of a doctor who wishes to experiment on him and a doctor''s wife who wishes to seduce him.');
INSERT INTO movies VALUES (75710, 'Imbarco a mezzanotte', '1952-03-12', NULL, 90, 0, 'Essentially a two-person character study, the film stars Paul Muni as a down-and-out crook on the lam. Muni befriends a young street urchin (Vittorio Mazzunchelli, billed as "Manunta" in many prints) in an Italian port city. At first amused that the boy is a sneak thief, Muni tries to deflects the kid from a life of crime. Tipped off by a woman anxious to collect the reward for Muni (who is wanted for murder), the police pursue the two lost souls.');
INSERT INTO movies VALUES (75901, 'The Conquest of Everest', '1953-12-09', NULL, 78, 0, 'A documentary of the first successful expedition to the summit of Mount Everest. New Zealand''s Edmund Hillary and Sherpa Tenzing Norgay climb Mount Everest in 1953.');
INSERT INTO movies VALUES (76011, 'My Blue Heaven', '1950-09-15', NULL, 95, 0, 'Radio star Kitty Moran, long married to partner Jack, finds she''s pregnant, but miscarries. For a change, the couple turn their act into a series on early TV and try to adopt a baby. Finally they acquiring a girl in a somewhat back alley manner.');
INSERT INTO movies VALUES (76117, 'Not as a Stranger', '1955-07-01', NULL, 135, 0, 'Lucas Marsh, an intern bent upon becoming a first-class doctor, not merely a successful one. He courts and marries the warm-hearted Kristina, not out of love but because she is highly knowledgeable in the skills of the operating room and because she has frugally put aside her savings through the years. She will be, as he shrewdly knows, a supportive wife in every way. She helps make him the success he wants to be and cheerfully moves with him to the small town in which he starts his practice. But as much as he tries to be a good husband to the undemanding Kristina, Marsh easily falls into the arms of a local siren and the patience of the long-sorrowing Kristina wears thin.');
INSERT INTO movies VALUES (76121, 'Tight Spot', '1955-03-19', NULL, 97, 0, 'A former model, serving time in prison, becomes a key witness in a trial against a notorious gangster. She is put under protective watch by the District Attorney in a posh hotel, but the crime kingpin makes attempts to get to her.');
INSERT INTO movies VALUES (76229, 'Phone Call from a Stranger', '1952-02-01', NULL, 105, 0, 'Four strangers board a plane and become fast friends, but a catastrophic crash leaves only one survivor. He then sets off on a journey to discover who these people were, but ultimately discovers the devastating truth about himself.');
INSERT INTO movies VALUES (76372, 'Night People', '1954-03-11', NULL, 93, 0, 'A US intelligence officer, stationed in Germany, is caught in a political dilemma when the Russians kidnap a young Army private, the son of prominent American businessman. In exchange for the soldier''s return, the Russians attempt to barter a trade for an elderly German couple who they want for treason.');
INSERT INTO movies VALUES (77645, 'The Redhead from Wyoming', '1953-01-08', NULL, 77, 0, 'In Wyoming Territory, a range war is brewing between entrenched cattle barons and new settlers. Cattle king Reece Duncan is opposed by ambitious gambler Jim Averell...');
INSERT INTO movies VALUES (77650, 'Bullfighter and the Lady', '1951-04-26', NULL, 87, 0, 'An American takes up bullfighting to impress the ladies but learns to respect the sport.');
INSERT INTO movies VALUES (77678, 'Talk About a Stranger', '1952-04-18', NULL, 65, 0, 'Small-town gossips rage over the arrival of a mysterious stranger.');
INSERT INTO movies VALUES (78256, 'The End of the Affair', '1955-02-23', NULL, 105, 0, 'A civil servant''s wife (Deborah Kerr) in wartime London vows to leave her injured lover (Van Johnson) if he recovers.');
INSERT INTO movies VALUES (78265, 'This Woman Is Dangerous', '1952-02-09', NULL, 100, 0, 'Elizabeth is losing her sight, so while her lover go into hiding, she checks in to the hospital for extensive surgery to recover her eyesight. There she is treated by a handsome young doctor, Ben Hellack (Dennis Morgan). As expected not only the doctor successfully open her eyes, he also opened her heart for him.');
INSERT INTO movies VALUES (79363, 'Dementia', '1955-12-22', NULL, 56, 0, 'Shot entirely without dialogue and filled with suggestive violence and psycho-sexual imagery, it''s like a skid row expressionist thriller following the nocturnal prowling of a young woman haunted by homicidal guilt.');
INSERT INTO movies VALUES (79401, 'Gone to Earth', '1950-11-06', NULL, 110, 0, 'Jennifer Jones plays Hazel Woods, a beautiful young English Gypsey girl who loves animals and in particular her pet fox. She is hotly desired by Jack Reddin (David Farrar) a fox hunting squire who vies for her affection and pursues her even after her marriage to the local pastor.');
INSERT INTO movies VALUES (79964, 'The Good Humor Man', '1950-06-01', NULL, 80, 0, 'Biff Jones is a driver/salesman for the Good Humor ice-cream company. He hopes to marry his girl Margie, who works as a secretary for Stuart Nagel, an insurance investigator. Margie won''t marry Biff, though, because she is the sole support of her kid brother, Johnny. Biff gets involved with Bonnie, a young woman he tries to rescue from gangsters. But Biff''s attempts to help her only get him accused of murder. When the police refuse to believe his story, it''s up to Biff and Johnny to prove Biff''s innocence and solve the crime.');
INSERT INTO movies VALUES (80031, 'The Magnet', '1950-10-01', NULL, 79, 0, 'A classic Ealing comedy in which a young boy steals a magnet and becomes a hero.');
INSERT INTO movies VALUES (80032, 'I Love Melvin', '1953-03-20', NULL, 77, 0, 'Melvin Hoover, a budding photographer for Look magazine, accidentally bumps into a young actress named Judy LeRoy in the park. They start to talk and Melvin soon offers to do a photo spread of her. His boss, however, has no intention of using the photos. Melvin wants to marry Judy, but her father would rather she marry dull and dependable Harry Black. As a last resort, Melvin promises to get Judy''s photo on the cover of the next issue of Look, a task easier said than done.');
INSERT INTO movies VALUES (80241, 'Green Fire', '1954-12-29', NULL, 100, 0, 'Set in the coffee fields of Colombia, Green Fires stars Stewart Granger and Grace Kelly. Granger plays emerald prospector Rian X. Mitchell, who intends to explore an old deserted mine despite the protests of his partner Vic Leonard Paul Douglas and the threat of death at the hands of local bandit El Moro Murvyn Vye. Ms. Kelly costars as Catherine Knowland, whose coffee plantation lies at the foot of the mine where Mitchell labors away. Such natural disasters as rain and flood, coupled with such man-made weapons of destruction as guns and dynamite, continually thwart Mitchell''s search for riches.');
INSERT INTO movies VALUES (80596, 'The Magic Box', '1951-01-01', NULL, 118, 0, 'Now old, ill, poor, and largely forgotten, William Freise-Greene was once very different. As young and handsome William Green he changed his name to include his first wife''s so that it sounded more impressive for the photographic portrait work he was so good at. But he was also an inventor and his search for a way to project moving pictures became an obsession that ultimately changed the life of all those he loved.');
INSERT INTO movies VALUES (80746, 'La edad del amor', '1954-01-09', NULL, 105, 0, 'Many years ago, a young aristocrat wanted to marry a famous singer, but his father destroyed the marriage before twediing, believing that singer is not suitable wife for future diplomat. After several years their adult children now met in the theater of Buenos Aires.');
INSERT INTO movies VALUES (80806, 'Above and Beyond', '1952-12-31', NULL, 122, 0, 'The story of Colonel Paul Tibbets, the pilot of the Enola Gay, the bomber that dropped the atomic bomb on Hiroshima. Although unaware of the full potential of this new weapon, he knows that it is capable of doing tremendously more damage than any other weapon used before, and that the death toll resulting from it will be enormous. He is reluctant to be the person who will end so many lives, but if using it may bring an end to the war, then not doing so may result in even more lives being lost in continued ground assaults as the fighting goes on. At the same time, the intense secrecy surrounding this mission leaves him with no one he can express his thoughts and doubts to, not even his wife. As time goes on, the pressure upon him only increase.');
INSERT INTO movies VALUES (81512, 'Many Rivers to Cross', '1955-02-04', NULL, 95, 0, 'Packaged and sold as an outdoor actioner, Many Rivers to Cross is as much a comedy as anything else. Robert Taylor stars as 18th century trapper Bushrod Gentry, who is himself entrapped into marriage by the spunky Mary Stuart Cherne (Eleanor Parker). Escaping his marital responsibilities (which were impressed upon him on threat of death), Gentry heads into the North Country, with Mary in hot pursuit. Hero and heroine spend the rest of the picture taking turns rescuing each other from hostile Indians. Some of the humor is predicated upon the wholesale slaughter of the "redskins", and as such is a bit hard to take when seen today. Supporting Taylor and Parker are Victor McLaglen as the heroine''s burly father, and TV-stars-to be James Arness (Gunsmoke) and Russell Johnson and Alan Hale Jr. (Gilligan''s Island).');
INSERT INTO movies VALUES (81724, 'Laughter in Paradise', '1951-01-10', NULL, 93, 0, 'When an eccentric practical joker dies, he divides his fortune among four heirs. But before they can collect the cash they must each do something which goes completely against their nature.');
INSERT INTO movies VALUES (81981, 'Flicka och hyacinter', '1950-03-06', NULL, 89, 25, 'Dagmar Brink, a young female pianist, commits suicide in her Stockholm apartment. She leaves all her belongings to her next-door neighbours, an author and his wife. Perplexed and curious, they investigate the girl''s reasons for taking her life. As they visit Dagmar''s friends, acquaintances and former boyfriends, her story unfolds.  She stands out as loner, a woman no one could really grasp, always in want of something that nobody she met could make out.');
INSERT INTO movies VALUES (82113, 'Un Giorno in pretura', '1953-06-06', NULL, 88, 0, 'Magistrate (Judge) Del Russo presides over four cases brough before him during a period of one day. "Adultery in 16mm" focus on Elena who brings her salesman husband to court on charges of abandonment where he springs surprise evidence involving her affair with her lawyer. In "The Priest and the Prostitute," Don Michele, a young priest, is charged with wrecking a pool room who claims he was robbed by Anna, a prostitute, and beaten by her pimp. In "Indecent Exposure," Meniconi is a man arrested for indecent exposure who claims he was swimming in the nude and his clothes where stolen. The last case "Lustful Lieutenant," involves Gloriana, a middle-aged prostitute, who''s brought before Del Russo on charges of soliciting and who apparently knew Del Russo from a time years ago.');
INSERT INTO movies VALUES (82203, 'The Girl in the Red Velvet Swing', '1955-10-01', NULL, 109, 0, 'Broadway showgirl Evelyn Nesbit (Joan Collins) is the object of affection of two men: playboy architect Stanford White (Ray Milland) and wealthy but unstable Harry Thaw (Farley Granger). She marries Thaw, but White’s continued pursuit puts him in the path of Thaw’s volatile temper. Inspired by true events that occurred at the turn of the 20th century. Originally intended to star Marilyn Monroe.');
INSERT INTO movies VALUES (83015, 'The Happiest Days of Your Life', '1950-01-01', NULL, 81, 0, 'Nutbourne College, an old established, all-boys, boarding school is told that another school is to be billeted with due to wartime restrictions. The shock is that it''s an all-girls school that has been sent. The two head teachers are soon battling for the upper hand with each other and the Ministry. But a crisis (or two) forces them to work together.');
INSERT INTO movies VALUES (83119, 'I Am a Camera', '1955-07-21', NULL, 98, 0, 'In the early thirties, aspiring writer Christopher Isherwood, living in Berlin, meets the vivacious, penniless singer Sally Bowles. They develop a platonic relationship while Sally has a wild time spending other peoples money.');
INSERT INTO movies VALUES (83664, 'The Man with a Cloak', '1951-11-27', NULL, 84, 0, 'Set in 19th-century New York, this mystery begins when a Frenchwoman shows up at the home of one of Napoleon''s former marshals. The alcoholic man is badly crippled and slowly dying, but this doesn''t stop the forthright lady from pushing him to change his will to include his estranged grandson so that he can help out the struggling French Re Unfortunately, the dying man''s conniving housekeeper and butler, already planning murder to get the money themselves, overhear her and begin plotting her demise.');
INSERT INTO movies VALUES (131781, 'Rich, Young and Pretty', '1951-07-09', NULL, 95, 0, 'A rancher''s daughter visits Paris to meet her mother and find love.');
INSERT INTO movies VALUES (83665, 'Betrayed', '1954-09-07', NULL, 108, 0, 'Screen superstars Clark Gable ("Gone With The Wind," "It Happened One Night") and sultry bombshell Lana Turner ("Peyton Place," "The Postman Always Rings Twice") team-up in this intriguing WWII drama. Suspected of being a Nazi spy, Dutch-resistance member Turner is given a last chance mission to redeem herself. Gable is an American colonel who falls in love with her. Co-starring Victor Mature ("My Darling Clementine") and Oscar-nominee Louis Calhern ("The Asphalt Jungle").');
INSERT INTO movies VALUES (83667, 'Payment on Demand', '1951-02-03', NULL, 90, 0, 'Screen legend and Academy Award-winner Bette Davis ("All About Eve," "Dark Victory") stars with Emmy-nominee Barry Sullivan ("Rich Man, Poor Man") in this compelling look at why people drift apart in marriage and seek divorce, with all its consequences.');
INSERT INTO movies VALUES (83670, 'Hard, Fast and Beautiful', '1951-05-23', NULL, 78, 0, 'When most people look at Florence Farley, they see a pretty teenager. But when Milly Farley looks at her daughter she sees something else: a tennis prodigy who could be Milly’s ticket to money and fame. Released in 1951, Hard, Fast and Beautiful foresaw our modern era of big-time women’s sports – and of driven parents who would stop at nothing to “help” their daughters grab the golden ring. Sally Forrest plays Florence, who finds athletic success but not happiness. Claire Trevor seethes with barely concealed malice and greed as Milly. And behind the camera is movie star Ida Lupino, guiding one of a series of low-budget, big-concept films that established her as a rarity in mid-century Hollywood: a successful and stylish female director.');
INSERT INTO movies VALUES (83683, 'I Can Get it For You Wholesale', '1951-04-05', NULL, 91, 0, 'A ruthless fashion designer steps on everyone in her way in order to reach the top of her profession. Eventually she is forced to choose between her ambition and the man she loves.');
INSERT INTO movies VALUES (83750, 'Devil May Hare', '1954-06-19', NULL, 7, 0, 'The Tasmanian Devil is on the loose. Bugs offers to help him find his dinner.');
INSERT INTO movies VALUES (83765, 'Feed the Kitty', '1952-02-02', NULL, 7, 0, 'A bulldog adopts a small cat, but he can''t let his owners know.');
INSERT INTO movies VALUES (84214, 'Come Back, Little Sheba', '1952-12-24', NULL, 96, 0, 'An emotionally remote recovering alcoholic and his dowdy, unambitious wife face a personal crisis when they take in an attractive lodger.  Doc Delaney (Burt Lancaster) and wife Lola (Shirley Booth) had an indiscreet affair, she became pregnant and, compelled to marry her, he gave up his medical studies, forfeited his future and settled down to a life of quiet desperation with the simple, frumpy Lola, who lost the child but has remained Doc''s steadfast if slatternly wife.  Now a chiropractor, recovering alcoholic, and active member of his town''s AA chapter, Doc''s sobriety is severely tested when Marie (Terry Moore), a young college student becomes their boarder, bringing new life and long-dormant hostilities to the surface of Doc and Lola''s troubled marriage.');
INSERT INTO movies VALUES (84397, 'Double Dynamite', '1951-12-25', NULL, 80, 0, 'An innocent bank teller, suspected of embezzlement, is aided by an eccentric, wisecracking waiter.');
INSERT INTO movies VALUES (84540, 'A Girl in Every Port', '1952-02-13', NULL, 86, 0, 'After two sailors are conned into buying a lame race-horse, they go ashore to sort out the problem, but when they realize that the horse is one of a pair of identical twins, their plan for revenge becomes more complicated.');
INSERT INTO movies VALUES (84601, 'The Wearing of the Grin', '1951-07-28', NULL, 7, 0, 'Porky Pig spends the night at an Irish castle after being caught in a storm, and gets in trouble with the two leprechauns who live there.');
INSERT INTO movies VALUES (84734, 'Venetian Bird', '1952-10-01', NULL, 94, 0, 'Private eye Edward Mercer (Richard Todd) travels to Venice to locate a man due a reward for his aid in the war. Shortly after arriving, he becomes the prime suspect in the murder of his local contact. In his quest to clear his name, Mercer uncovers a conspiracy. Even the local magistrate (George Coulouris) seems to be working against him, and Mercer begins to suspect the man he came to find is behind it all.');
INSERT INTO movies VALUES (84903, 'The Marrying Kind', '1952-02-01', NULL, 92, 0, 'Florence and Chet Keefer have had a troublesome marriage. Whilst in the middle of a divorce hearing the judge encourages them to remember the good times they have had hoping that the marriage can be saved.');
INSERT INTO movies VALUES (84944, 'Valkoinen peura', '1952-07-25', NULL, 74, 55, 'Pirita and Aslak are newly married. However, Aslak is a shepherd and his work takes him away from home for long periods of time, leaving his wife lonely and heartbroken. In an effort to tempt him back, Pirita visits the local shaman, with unexpected and deadly results.');
INSERT INTO movies VALUES (85293, 'Harriet Craig', '1950-11-02', NULL, 90, 0, 'Domineering Harriet Craig holds more regard for her home and its possessions than she does for any person in her life. Among those she treats like household objects are her kind husband Walter, whom she has lied to about her inability to have children; her cousin Claire, whom she treats like a secretary; and her servants whom she treats like slaves. Summary written by Daniel Bubbeo.');
INSERT INTO movies VALUES (85367, 'Vice Squad', '1953-07-31', NULL, 87, 0, 'A Los Angeles police captain (Edward G. Robinson) ties the case of a slain policeman to a bank robbery, all in a day.');
INSERT INTO movies VALUES (85494, 'Captive Women', '1952-10-10', NULL, 64, 0, 'In a post-apocalyptic New York City, three tribes of mutants (the Norms, the Mutates and the Upriver people) battle each other to survive.');
INSERT INTO movies VALUES (85498, 'The Maze', '1953-07-26', NULL, 80, 0, 'A Scotsman abruptly breaks off his engagement to pretty Kitty and moves to his uncle''s castle in the Scottish highlands. Kitty and her aunt follow Gerald a few weeks later, and discover he has suddenly aged. Some mysterious things happen in a maze made from the hedges adjoining the castle.');
INSERT INTO movies VALUES (85518, 'Confidence Girl', '1952-06-20', NULL, 81, 0, 'After successfully swindling thousands of dollars from hapless victims, conflicted con artist Mary (Hillary Brooke) decides to go straight, but her greedy boyfriend and partner, Roger (Tom Conway), convinces her to pull off one final scam before they get married. Written and directed by Andrew L. Stone, this classic crime film finds the police struggling to keep up with the deceptive duo''s exceedingly complicated schemes.');
INSERT INTO movies VALUES (85639, 'Run for Cover', '1955-04-29', NULL, 93, 0, 'Western that starts when a man (Matt Dow) is mistaken as a train robber. After the town''s sheriff shoots the kid he''s riding with, Dow clears his name and ends up as the new sheriff. He romances a Swedish woman and settles in to a peaceful life only to find that the boy has a few secrets of his own.');
INSERT INTO movies VALUES (85783, 'The Star', '1952-12-11', NULL, 89, 0, 'A washed-up movie queen finds romance, but continues to desire a comeback.');
INSERT INTO movies VALUES (85840, 'Little Boy Lost', '1953-09-21', NULL, 95, 0, 'A war correspondent who was stationed in Paris during WW II married a French girl who was murdered by the Nazis. After the war he returns to to try to find his son, whom he lost during a bombing raid but has been told is living in an orphanage in Paris.');
INSERT INTO movies VALUES (85841, 'The Glory Brigade', '1953-05-20', 850000, 82, 0, 'During the Korean War Lt. Sam Pryor volunteers his platoon to escort Greek troops to perform a reconnaissance mission behind Communist lines. Due to his Greek heritage Pryor is initially proud to accompany the Greek contingent but his feelings change to scorn and mistrust when what he believes is cowardice shown by the Greek soldiers and their leaders results in the near annihiliation of his own platoon. An uneasy alliance is maintained between the US and Greek troops as the enemy''s true objective is learned.');
INSERT INTO movies VALUES (86258, 'The Brave Bulls', '1951-04-18', NULL, 106, 0, 'nan');
INSERT INTO movies VALUES (87349, 'Outcast of the Islands', '1951-11-15', NULL, 102, 0, 'After financial improprieties are discovered at the Eastern trading company where he works, Peter Willems flees the resulting disgrace and criminal charges. He persuades the man who gave him his start in life, the merchant ship captain Lingard, to bring him to a trading post on a remote Indonesian island where he can hide out.');
INSERT INTO movies VALUES (87588, 'Highly Dangerous', '1950-12-06', NULL, 90, 0, 'A U.S. newsman (Dane Clark) and a British entomologist (Margaret Lockwood) spy on germ-warfare research in a mythical country.');
INSERT INTO movies VALUES (87621, 'Chain Lightning', '1950-02-18', NULL, 94, 0, 'Matt Brennan runs into Jo Holloway, the Red Cross girl he romanced in Europe when he was a flyer in World War II, when he is offered a job by jet manufacturer Leland Willis as a test pilot. Carl Troxell, wants to sell an escape cockpit to the Air Force. He wants Matt to stall the presentation of JA-3 the prototype that doesn''t include the ejection seat, to give him more time for the experimental JA-4. But Matt doesn''t believe it is yet safe enough to try.');
INSERT INTO movies VALUES (87936, 'Beautiful Stranger', '1954-07-13', NULL, 89, 0, 'An ex-chorus girl (Ginger Rogers) lives on the Riviera, supported by a married man (Stanley Baker) she doesn''t know is a crook.');
INSERT INTO movies VALUES (87983, 'The Clown', '1953-01-16', NULL, 91, 0, 'Once a famous Ziegfeld star, Dodo Delwyn, is reduced to playing clowns in burlesque and amusement parks as a result of his drinking. His son Little Dink idolizes Dodo and faithfully believes in a comeback. He persuades "Uncle" Goldie, Dodo''s agent in the good old days, to find a booking for Dodo. He can''t, and Dink is sent to live with his remarried-and-wealthy mother, Paula. The unhappy Dink runs back to his father. His welcome return gives Dodo the courage needed to try a knockabout TV show offered by Goldie');
INSERT INTO movies VALUES (88075, 'Walk Softly, Stranger', '1950-10-14', NULL, 81, 0, 'A petty crook (Joseph Cotten) moves to an Ohio town and courts a factory owner''s disabled daughter (Valli).');
INSERT INTO movies VALUES (88176, 'Der Verlorene', '1951-09-07', NULL, 98, 3, 'A German scientist murders his fiancée during World War II when he learns that she has been selling the results of his secret research to the enemy.');
INSERT INTO movies VALUES (89158, 'The President''s Lady', '1953-05-21', NULL, 96, 0, 'The story of president Andrew Jackson from his early years, through his meeting with and subsequent marriage to Rachel Donelson Robards. The plot concentrates on the later scandal concerning the legality of their marriage and how they overcame the difficulties.');
INSERT INTO movies VALUES (89547, 'Bright Road', '1953-04-17', NULL, 68, 0, 'Based on the story, "See How They Run," which ran in the June, 1951 issue of "The Ladies'' Home Journal" and subsequently won that year''s Christopher Award. The story was written by Mary Elizabeth Vroman, a fourth-generation school teacher from the British West Indies. "Bright Road" has only one white actor in the cast, Robert Horton. Jane Richards is a young 4th-grade teacher in the South who has a problem in her classroom with 11-year-old C.T. Young, a backward boy whose pride has made him a stubborn rebel and an exalted liar.');
INSERT INTO movies VALUES (89702, 'The Yellow Cab Man', '1950-04-07', NULL, 85, 0, 'Pirdy is accident prone. He has been denied insurance from every company in town because he is always getting hit or hurt in some way. On the day that he meets the lovely Ellen of the Yellow Cab Co., he also meets the crooked lawyer named Creavy. Pirdy is an inventor and when Creavy learns about elastic-glass, his new invention, he makes plans to steal the process. With the help of another con man named Doksteader, and the boys, he will steal this million dollar invention no matter who gets hurt.');
INSERT INTO movies VALUES (89993, 'Racket Girls', '1951-03-05', NULL, 70, 0, 'Scalli is a gangster who manages women wrestlers as a front for his bookmaking, drug, and prostitution rackets. He trusts the wrong people and ends up trying to run away from both the police and mysterious mob boss Mr. Big, to whom he owes $35,000.');
INSERT INTO movies VALUES (89998, 'Crash of Moons', '1954-07-10', NULL, 78, 0, 'A three-part episode from the TV series Rocky Jones, Space Ranger edited together and released as a feature for 16mm rental only. Season 1 episodes 21, 22, 23.  Episode 21: Rocky saves a space station and his friends when they are trapped between gypsy moons. Episode 22: Cleolanthe tries to destroy one of the gypsy moons with a barrage of missiles. Episode 23: Rocky evacuates the gypsy moon Posetta and stops Cleolanthe''s missile barrage.');
INSERT INTO movies VALUES (90770, 'I Vinti', '1953-09-04', NULL, 110, 0, 'A film by Michelangelo Antonioni composed of three episodes: a French episode set in Paris, an Italian episode set in Rome and an English episode set in London. Three stories of well-off youths who commit murders.');
INSERT INTO movies VALUES (90968, 'Plymouth Adventure', '1952-11-28', NULL, 105, 0, 'The story of the voyage of the "Mayflower" in its historic voyage across the Atlantic to the New World. The passenger list includes John Alden and Priscilla Mullins among those who made the 96-day storm-filled crossing. Along the way the Captain has an ill-starred romance with the wife of a religious fanatic that ends in a sudden, dramatic way off the coast of Cape Cod.');
INSERT INTO movies VALUES (91245, 'Battle Circus', '1953-03-06', NULL, 90, 0, 'A young Army nurse, Lt Ruth McGara (June Allyson), newly assigned to the 66th MASH during the Korean War, attracts the sexual attention of the unit''s commander Dr. (MAJ) Jed Webbe (Humphrey Bogart). Webbe, who has a drinking problem, at first wants a "no strings" relationship. McGara is warned by the other nurses of Webbe''s womanizing ways. Despite these initial handicaps, their love flourishes against a background of war, enemy attacks, death and injury. The relationship deepens and uplifts both characters.');
INSERT INTO movies VALUES (91343, 'It''s a Small World', '1950-06-24', NULL, 74, 0, 'Harry Musk is one in a million. That means that he''s the one out of a million children who is perfectly proportioned but will never grow larger than a typical six-year-old. Adult, pint-sized Harry longs to be part of the big world.');
INSERT INTO movies VALUES (91419, 'All the Brothers Were Valiant', '1953-11-13', NULL, 101, 0, 'Sea-faring saga of two brothers (Robert Taylor, Stewart Granger) and the woman they both love.');
INSERT INTO movies VALUES (91456, 'Top Banana', '1954-02-22', NULL, 100, 0, 'Jerry Biffle (Phil Silvers) is the star of the Blendo Soap Program. He has been invited to participate in an autograph-signing party for his new book at an important department store. Jerry meets Sally Peters (Judy Lynn), one of the department store models, and makes her part of his TV troupe. As part of his campaign to court Sally, Jerry gets Cliff Lane (Danny Scholl), the tenor of his TV company, to sing to her over the phone. When Sally and Cliff meet, they fall in love, with Biffle ignorant of the complications.');
INSERT INTO movies VALUES (91477, 'Men of the Fighting Lady', '1954-05-07', NULL, 79, 0, 'M-G-M presents the heroic story of what happened to the MEN OF THE FIGHTING LADY');
INSERT INTO movies VALUES (92401, 'The Red Beret', '1953-08-11', NULL, 88, 0, 'Alan Ladd as Canadian is the focus of this British story based on the wartime raid on the German radar station at Bruneval. The raid was a combined services operation and the 2nd Battalion of the 1st Parachute Brigade was led by Major ''John Frost'' (Major Snow). An RAF radar expert, Flight Sergeant C.W.H. Cox (Sergeant Box) accompanied the raiders to tell them what to take back to England.  The film was titled "Paratrooper" in the US.');
INSERT INTO movies VALUES (92728, 'Teen-Age Crime Wave', '1955-11-01', NULL, 77, 0, 'A delinquent girl involves an innocent friend in an armed robbery followed by a jail-break and hostage-taking with her equally delinquent boyfriend.');
INSERT INTO movies VALUES (93562, 'Law and Order', '1953-05-13', NULL, 80, 0, 'Frame Johnson''s attempt to settle down in Tombstone is interrupted when a mob tries to mete out some frontier justice.');
INSERT INTO movies VALUES (94123, 'The Cobweb', '1955-06-07', NULL, 134, 0, 'At an exclusive psychiatric clinic, the doctors and staff are about as crazy as the patients. The clinic head, Dr. Stewart McIver, thinks that it would be good therapy for his patients to design and make new drapes for the library. Mrs. Karen McIver, who is neglected by her hardworking husband (and a bit unbalanced herself), wants to make her mark on the clinic, so she orders new drapes. Miss Inch, the business manager, who has been with the clinic longer than anyone, sees this as an intrusion into her territory, and she too orders drapes. All this puts everyone in a dither, as they fight over drapes and clinic politics.');
INSERT INTO movies VALUES (94176, 'Destry', '1954-12-01', NULL, 95, 0, 'Western remake of "Destry Rides Again", starring Audie Murphy, Mari Blanchard, Thomas Mitchell, Lori Nelson and Lyle Bettger.');
INSERT INTO movies VALUES (94228, 'Das doppelte Lottchen', '1950-12-01', NULL, 105, 3, 'Two nine-year-old girls—rude Luise Palfy and respectful shy Lotte Körner—meet on a summer camp. Apart from their different hair-do, they look alike. They have never seen each other before, but soon find out that they are identical twins. It turns out that their parents divorced, each keeping one of the girls. They decide to trade places at the end of the summer. Lottie curls her hair, Lisa braids hers, and both go off to where they have never been before. The adventure begins.');
INSERT INTO movies VALUES (94405, 'The Far Horizons', '1955-05-20', NULL, 108, 0, 'United States has just acquired Louisiana from France. An expedition led by Lewis and Clark is sent to survey the territory and go where no white man has gone before. Are they able to overcome the dangers with the help of Sacajawea?');
INSERT INTO movies VALUES (94529, 'My Cousin Rachel', '1952-12-25', NULL, 98, 0, 'Olivia de Havilland and Richard Burton star in this adaptation of Daphne du Maurier''s gothic novel. In a reversal of Jane Eyre, it is the hero who arrives at the home of a mysterious woman. Rachel (de Havilland) is the widow of a Cornish man of property (John Sutton), who died in suspicious circumstances. Philip Ashley Burton is the dead man''s cousin, who in probing his relative''s demise immediately suspects Rachel -- and goes on suspecting her even after he falls in love with her.');
INSERT INTO movies VALUES (94618, 'Dreamboat', '1952-07-26', NULL, 83, 0, 'Thornton Sayre (Clifton Webb), a respected college professor - secretly formerly a Silent films romantic action hero - is disturbed, feeling his privacy has been violated, and his professional credibility as a scholar jeopardized, when he learns his old movies have been resurrected and are being aired on TV. He sets out to demand this cease. However, his former co-star (Ginger Rogers) is the hostess of the TV show playing the films, and she has other plans.');
INSERT INTO movies VALUES (94831, 'The Fuller Brush Girl', '1950-09-15', NULL, 85, 0, 'A daffy door-to-door saleswoman blunders into a murder investigation.');
INSERT INTO movies VALUES (95012, 'The Iron Mistress', '1952-11-19', NULL, 110, 0, 'Barely historical presentation of the life of Jim Bowie. Here he goes to New Orleans to sell lumber but falls in love with Judalon. To match his rivals he must become sophisticated and does so. By the time he sells the mill, starts a plantation and tries to wed Jedualon the woman has wed playboy Phillipe. Along the way to true wisdom he designs a special knife made from part of a meteorite.');
INSERT INTO movies VALUES (95949, 'The Strip', '1951-08-01', NULL, 85, 0, 'Drummer Stanley Maxton moves to Los Angeles with dreams of opening his own club, but falls in with a gangster and a nightclub dancer and ends up accused of murder.');
INSERT INTO movies VALUES (95977, 'The Man Behind The Gun', '1953-01-31', NULL, 82, 0, 'This 1952 western stars Randolph Scott as an army investigator who poses as a schoolteacher while working undercover to expose a group of secessionists. Also starring Patrice Wymore, Roy Roberts, Alan Hale Jr., Lina Romay, Morris Ankrum, Dick Wesson and Philip Carey.');
INSERT INTO movies VALUES (96255, 'Three Came Home', '1950-02-20', NULL, 106, 0, 'The true story of Agnes Newton Keith''s imprisonment in several Japanese prisoner-of-war camps from 1941 to the end of WWII. Separated from her husband and with a young son to care for she has many difficulties to face.');
INSERT INTO movies VALUES (96433, 'My Friend Irma Goes West', '1950-06-25', NULL, 91, 0, 'Singer Steve, friend Seymour and fiance Jane, along with her dizzy blonde room mate Irma, have a series of misadventures on a California-bound train and end up involved with a gang of murderous gangsters in Las Vegas.');
INSERT INTO movies VALUES (97421, 'Kansas Raiders', '1950-08-19', NULL, 80, 0, 'Outraged by Redleg atrocities, the James and Younger Brothers along with Kit Dalton join Quantrill''s Raiders and find themselves participating in even worse war crimes.');
INSERT INTO movies VALUES (98328, 'The Great Caruso', '1951-04-16', NULL, 109, 0, 'Loosely traces the life of tenor Enrico Caruso (1873-1921). He loves Musetta, in his home town of Naples, and then Dorothy, the daughter of one of the Metropolitan Opera''s patrons. Caruso is unacceptable to both women''s fathers: to one, because he sings; to Dorothy''s, because he is a peasant. To New York patricians, Caruso is short, barrel chested, loud, emotional, unrefined. Their appreciation comes slowly. The film depicts Caruso''s lament that "the man does not have the voice, the voice has the man": he cannot be places he wants to be, because he must be elsewhere singing, including the day his mother dies. Throughout, Mario Lanza and stars from the Met sing.');
INSERT INTO movies VALUES (98364, 'The Actress', '1953-09-25', NULL, 90, 0, 'The true story of Ruth Gordon''s early struggles on the road to stage stardom.');
INSERT INTO movies VALUES (99004, 'Carne de horca', '1953-10-08', NULL, 93, 0, 'On the XIX Century in Sierra Morena in Serranía de Ronda spread bandits thant cause panic in the cities robbing and killing travellers.');
INSERT INTO movies VALUES (99224, 'The Lawless Breed', '1953-01-03', NULL, 83, 0, 'After being released from prison, ex-gunfighter John Wesley Hardin hopes to have his autobiography published in order to rehabilitate his tarnished reputation.');
INSERT INTO movies VALUES (99898, 'Man on a Tightrope', '1953-04-01', NULL, 105, 0, 'Elia Kazan''s 1953 film stars Fredric March as the owner of an impoverished circus in Communist-ruled Czechoslovokia who plots to flee across the border to freedom, taking his entire troupe of performers and wild animals with him. The cast also includes Gloria Grahame, Terry Moore, Cameron Mitchell, Richard Boone and Adolphe Menjou.');
INSERT INTO movies VALUES (100656, 'Four Sided Triangle', '1953-06-15', NULL, 81, 0, 'A young man, in love with a woman who can never be his, discovers a way to fulfil his dreams. In their childhood the three were the best of friends, the perfect triangle. But years later when Lena returns to her sleepy home the tone of the relationship changes and it is Robin she loves. Bill has discovered a method of duplication and decides to make an exact replica of the woman he cannot have... .with disastrous consequences for them all.');
INSERT INTO movies VALUES (101030, 'The Golden Blade', '1953-08-11', NULL, 81, 3, 'Harum is a fearless man of the people who comes to Bagdad to avenge the murder of his father and meets Krairuzan, a princess disguised as a commoner, working against a plot by a band of evil schemers trying to do away with her father, the Caliph. She gives Harum a golden sword which, in his hands, makes him invincible. Harum uses the sword in the name of justice and is doing quite well until a duplicate sword is placed in his scabbard during one of his off-guard moments, and he winds up in chains.');
INSERT INTO movies VALUES (101557, 'Westward the Women', '1951-12-31', NULL, 118, 0, 'In a time when "The West" pretty much ends in Texas and only California is slowly being populated by the white men, there''s a severe lack of women among the workers on Roy Whitman''s farm in the California Valley. So he goes back east to Chicago to recruit 150 women willing to become wives for his employees. From the candidates he selects 138 who seem able to survive a months long journey across "The Great American Desert" and the Rocky Mountains. Written by Tom Zoerner');
INSERT INTO movies VALUES (101653, 'The Magnificent Yankee', '1950-12-20', NULL, 80, 0, 'Director John Sturges'' 1950 film biography of Oliver Wendell Holmes stars Louis Calhern, Ann Harding.and Richard Anderson.');
INSERT INTO movies VALUES (102091, 'Take the High Ground!', '1953-10-30', NULL, 101, 0, 'Sgt. Thorne Ryan, who once fought bravely in Korea, now serves as a hard-nosed drill instructor to new Army recruits at Fort Bliss, Texas. But is he really the man he is often described as? His fellow instructor, and friend helps him to face the ghosts of his past experiences in Korea. One night in a bar across the border in Juarez, Mexico, Sgt. Ryan meets a lady who begins to turn his life around. Will this be enough to help him deal with the past? Or will he continue to be so hard on his troops?');
INSERT INTO movies VALUES (102144, 'Mister 880', '1950-09-29', NULL, 90, 2, 'The Skipper is a charming old man loved by all his neighbors. What they don''t know is that he is also Mr. 880, an amateurish counterfeiter who has amazingly managed to elude the Secret Service for 20 years.');
INSERT INTO movies VALUES (102161, 'Operation: Rabbit', '1952-01-19', NULL, 7, 0, 'Wile E. Coyote, genius, announces to Bugs Bunny that he is going to catch him and eat him, and then employs a variety of gadgets and plans in an attempt to do so.');
INSERT INTO movies VALUES (102289, 'Montana Belle', '1952-11-07', NULL, 82, 0, 'Oklahoma outlaw Belle Starr meets the Dalton gang when rescued from lynching by Bob Dalton, who falls for her. So do gang member Mac and wealthy saloon owner Tom Bradfield, who''s enlisted in a bankers'' scheme to trap the Daltons. Dissension among the gang and Bradfield''s ambivalence complicate the plot, as Belle demonstrates her prowess with shootin'' irons, horses, and as a surprisingly racy saloon entertainer. Written by Rod Crawford');
INSERT INTO movies VALUES (102295, 'Underwater!', '1955-02-09', 3500000, 99, 0, 'Dominic Quesada and Johnny Gray, two SCUBA divers searching for sunken treasure off the coast of Cuba, think they''ve hit the jackpot when they find a 17th century ship on the sea floor. They need working capital however and Johnny is ready to hock his boat but his wife Theresa think their off on another wild scheme that will leave them all poorer than when they started. She comes around however and are soon joined by Gloria, whose boat they will use and Father Cannon, a university professor and archaeologist. Although Dominic hasn''t been completely honest with his partners, hey may in fact be in the area of a major treasure ship. When they do find it, the ship is teetering on the edge of a 300 foot cliff and dangerous for even the most experienced divers. Written by garykmcd');
INSERT INTO movies VALUES (102597, 'Big Leaguer', '1953-08-19', NULL, 71, 0, 'John Lobert runs a training camp in Florida for the New York Giants. Every year, he evaluates the 18-22 year old hopefuls to pick the best for a minor league contract.');
INSERT INTO movies VALUES (103119, 'Two Flags West', '1950-10-12', NULL, 92, 0, 'A group of confedarate prisoners is sent to a unionist fort in the west to help the local garrison to fight the indians.');
INSERT INTO movies VALUES (103164, 'Copper Canyon', '1950-11-15', NULL, 84, 0, 'A group of copper miners, Southern veterans, are terrorized by local rebel-haters, led by deputy Lane Travis. The miners ask stage sharpshooter Johnny Carter to help them, under the impression that he is the legendary Colonel Desmond. It seems they''re wrong; but Johnny''s show comes to Coppertown and Johnny romances lovely gambler Lisa Roselle, whom the miners believe is at the center of their troubles.');
INSERT INTO movies VALUES (103168, 'Apache Country', '1952-05-30', NULL, 62, 0, 'A criminal gang provokes the local Apaches in order to divert the authorities'' attention from their own activities.');
INSERT INTO movies VALUES (103934, 'Too Young To Kiss', '1951-11-22', NULL, 91, 0, 'Eric Wainwright (Van Johnson), a busy impresario, is besieged by hordes of wannabe concert stars, eager for their big break. One of them is Cynthia Potter (June Allyson), a talented pianist... but she can''t get in to see him. When she learns that Wainwright is auditioning young musicians for a children''s concert tour, Cynthia dons braces and bobby sox and passes herself off as a child prodigy.');
INSERT INTO movies VALUES (104394, 'Death of a Salesman', '1951-12-20', NULL, 115, 0, 'Based on Arthur Miller''s famous play. Willy Loman is an over-the-hill salesman who faces a personal turning point when he loses his job and attempts to make peace with his family: Willy''s long-suffering wife Linda, and Biff and Happy, his troubled sons and his life.');
INSERT INTO movies VALUES (104989, 'The Sea Around Us', '1953-06-30', NULL, 62, 0, 'Irwin Allen explores the mysteries of the deep blue sea in this Technicolor documentary. Based on Rachel L. Carson''s famous study, this Oscar winning project investigates everything under the sea, from sharks, whales and octopuses to microscopical creatures and their coexistence in this vast underwater world.');
INSERT INTO movies VALUES (105536, 'Sitting Bull', '1954-10-06', NULL, 105, 0, 'Chief Sitting Bull of the Sioux tribe is forced by the Indian-hating General Custer to react with violence, resulting in the famous Last Stand at Little Bighorn. Parrish, a friend to the Sioux, tries to prevent the bloodshed, but is court- martialed for "collaborating" with the enemy. Sitting Bull, however, manages to intercede with President Grant on Parrish''s behalf. Written by Jim Beaver');
INSERT INTO movies VALUES (106016, 'My Forbidden Past', '1951-04-25', NULL, 70, 0, 'An 1890s New Orleans heiress tries to buy a married doctor''s love with her tainted family fortune.');
INSERT INTO movies VALUES (106196, 'Aguaespejo granadino', '1955-01-01', NULL, 21, 2, 'Experimental, cinematic symphony of Granada, José Val del Omar''s birthplace.');
INSERT INTO movies VALUES (106358, 'Atom Man vs Superman', '1950-07-20', NULL, 252, 0, 'Serial - sequel to Superman (1948); Superman faces off against Lex Luthor.');
INSERT INTO movies VALUES (107427, 'Drums Across the River', '1954-06-01', NULL, 78, 0, 'When whites hunger after the gold on Ute Indian land, a bigoted young man finds himself forced into a peacekeeping role.');
INSERT INTO movies VALUES (107966, 'Loose in London', '1953-05-24', NULL, 62, 0, 'The Bowery Boys take on British crooks when one of them thinks he''s inherited a title.');
INSERT INTO movies VALUES (108232, 'The Mating Season', '1951-01-12', NULL, 101, 0, 'Ellen McNulty leaves her New Jersey hamburger stand and heads west to pay a surprise visit to her son and his new bride. When Ellen arrives, her daughter-in-law mistakes her for the maid she has hired for a big party they are throwing. Rather than cause any embarrassment, Ellen goes along with the charade, which leads to many complications.');
INSERT INTO movies VALUES (108345, 'The Command', '1954-02-13', NULL, 94, 0, 'Once the commanding officer of a cavalry patrol is killed, the ranking officer who must take command is an army doctor.');
INSERT INTO movies VALUES (108582, 'Go Man Go', '1954-01-27', NULL, 82, 0, 'The story of Abe Saperstein and the creation of the Harlem Globetrotters.');
INSERT INTO movies VALUES (108668, 'The Adventures of Hajji Baba', '1954-10-01', NULL, 94, 0, 'In Ispahan, Persia, Hajji Baba is leaving his father''s shop to seek a greater fortune, while the Princess Fawzia is trying to talk her father, the Caliph into giving her in marriage to Nur-El-Din, a rival prince known far and wide as mean and fickle. Her father intends Fawzia for Fawzia to marry a friend and ally, and makes plans to send her to him.');
INSERT INTO movies VALUES (108844, 'The Winning Team', '1952-06-20', NULL, 98, 0, 'Poor health and alcoholism force Grover Cleveland Alexander out of baseball, but through his wife''s faithful efforts, he gets a chance for a comeback and redemption.');
INSERT INTO movies VALUES (109018, 'Athena', '1954-11-04', NULL, 95, 0, 'A stuffy young lawyer''s outlook on life drastically changes when he meets a perky health food enthusiast and her wacky family. This 1954 MGM musical, directed by Richard Thorpe, stars Jane Powell, Edmund Purdom, Debbie Reynolds, Vic Damone, Louis Calhern, Evelyn Varden, Linda Christian and Steve Reeves.');
INSERT INTO movies VALUES (109020, 'Rough Shoot', '1953-05-15', NULL, 88, 0, 'An American military officer (Joel McCrea) and his wife (Evelyn Keyes) move to a cottage in what they think is the peaceful English countryside, only to discover the area is a hotbed of spies and secret agents. Director Robert Parrish''s 1952 British espionage thriller--with a climax set at Madame Tussaud''s Wax Museum in London--also stars Herbert Lom, Marius Goring, Roland Culver, Frank Lawton and Megs Jenkins.');
INSERT INTO movies VALUES (109258, 'Bright Victory', '1951-07-31', NULL, 97, 0, 'A soldier blinded in war returns home and attempts to adjust to civilian life. Director Mark Robson''s 1951 drama stars Arthur Kennedy (Academy Award nomination, Best Actor, for his performance), Peggy Dow, James Edwards, Will Geer, Nana Bryant, Julie Adams, Jim Backus, Richard Egan and Murray Hamilton.');
INSERT INTO movies VALUES (109364, 'Guernica', '1950-01-01', NULL, 13, 0, 'Alain Resnais &amp; Robert Hessen explore the famous Picasso painting "Guernica" in light of the town''s bombing.');
INSERT INTO movies VALUES (109539, 'The Sun Shines Bright', '1953-05-02', NULL, 92, 0, 'John Ford weaves three "Judge Priest" stories together to form a good- natured exploration of honour and small-town politics in the South around the turn of the century. Judge William Priest is involved variously in revealing the real identity of Lucy Lake, reliving his Civil War memories, preventing the lynching of a youth and contesting the elections with Yankee Horace K. Maydew.');
INSERT INTO movies VALUES (109887, 'My Foolish Heart', '1950-01-21', NULL, 98, 0, 'After a long absence, Mary Jane visits her schoolfriend Eloise, and Eloise''s daughter Ramona. Eloise drinks too much and is unhappily married to Lew Wengler. Eloise falls asleep and remembers her time with her true love, Walt Dreiser, at the beginning of the Second World War. She recalls the events that lead up to her split with Mary Jane, and how Lew married Eloise rather than Mary Jane.');
INSERT INTO movies VALUES (109913, 'California Conquest', '1952-07-04', NULL, 78, 0, 'The period is the 1840''s and California is part of Mexico. Many of the citizens wish to become part of the United States. Other countries are also interested and the Russians have established bases in the northern part of the state. To further their hold they have stolen guns and Don Arturo Bordega, a leader of those wanting statehood, is out to recover them.');
INSERT INTO movies VALUES (110465, 'Kim', '1950-12-07', NULL, 113, 0, 'Kim, a young boy living on his own on the streets of India, is actually the son of a British officer. He meets a lama, a holy man, and devotes himself to his tending. But when British administrators discover his birthright, he is placed in a British school. His nature, however, is opposed to the regimentation expected for the son of a British soldier, and he rebels. His familiarity with Indian life and his ability to pass as an Indian child allows him to function as a spy for the British as they attempt to thwart revolution and invasion of India. Rejoining his holy man, Kim (with the help of daring adventurer Mahbub Ali) takes on a dangerous mission.');
INSERT INTO movies VALUES (110502, 'The Private War of Major Benson', '1955-08-02', NULL, 105, 0, 'A Major noted for advancing with his mouth before thinking is given a choice: to be drummed out of the Army, or take command of and shape up the ROTC program at Sheridan Academy before it fails its next inspection. At Sheridan he encounters three hundred pre-teen cadets who range from rascally to adorable, and a female doctor who has just the right prescription for him.');
INSERT INTO movies VALUES (110669, 'Wabash Avenue', '1950-03-31', 2115000, 92, 0, 'Andy Clark discovers he was cheated out of a half interest in partner Mike''s business, now a thriving dance hall in 1892 Chicago. Unable to win it back, Andy schemes to make Mike''s position untenable. He also hopes to turn Ruby Summers, Mike''s motor-mouthed burlesque queen, into a classier entertainer, and incidentally to make her his own. But at the last minute, Andy''s revenge comes unravelled.');
INSERT INTO movies VALUES (111043, 'Springfield Rifle', '1952-10-25', NULL, 93, 0, 'Major Lex Kearney, dishonorably discharged from the army for cowardice in battle, has actually volunteered to go undercover to try to prevent raids against shipments of horses desperately needed for the Union war effort. Falling in with the gang of jayhawkers and Confederate soldiers who have been conducting the raids, he gradually gains their trust and is put in a position where he can discover who has been giving them secret information revealing the routes of the horse shipments.');
INSERT INTO movies VALUES (111359, 'Secret People', '1952-01-01', NULL, 96, 0, 'This tale of intrigue finds Valentina Cortese involved in an assassination plot. She helps the police apprehend the conspirators after an innocent bystander is accidentally killed.');
INSERT INTO movies VALUES (111390, 'Stars in My Crown', '1950-05-11', NULL, 89, 0, 'The story of a young pastor coming to a small town in the United States to set up his ministry.  The movie tells of the various relationships and struggles he goes through as he goes about raising his family and preaching to the community.');
INSERT INTO movies VALUES (111421, 'Wyoming Renegades', '1954-03-27', NULL, 73, 0, 'Brady Sutton returns from three years in prison and tries to go straight. One a member of the Butch Cassidy gang, he is still suspected of being cahoots with them. When Cassidy and his men rob the bank, he is blamed. Escaping from the townspeople, he once again joins up with Cassidy to wait for a chance to help bring him in.');
INSERT INTO movies VALUES (111625, 'Small Town Girl', '1953-04-10', NULL, 93, 0, 'Rick Belrow Livingston, in love with Broadway star Lisa, is sentenced to 30 days in jail for speeding through a small town. He persuades the judge''s daughter Cindy to let him leave for one night, so that he can visit Lisa on her birthday. After that he goes on the town with Cindy and she falls in love with him. But Dr. Schemmer wants his son to become her husband.');
INSERT INTO movies VALUES (111732, 'The Jackpot', '1950-11-01', NULL, 85, 0, 'Jimmy Stewart''s Bill Lawrence wins a bevy or prizes from a radio program, but ends up having to sell them all in order to pay the taxes he''s incurred.');
INSERT INTO movies VALUES (112049, 'Mad About Men', '1954-11-16', NULL, 90, 0, 'Flirtatious mermaid Miranda swaps places with a schoolteacher who has gone on holiday. All is well until she falls in love with a human.');
INSERT INTO movies VALUES (113743, 'Jupiter''s Darling', '1955-02-18', NULL, 95, 0, 'Esther Williams musical about Hannibal''s campaign against Rome, based on a Robert E. Sherwood play.');
INSERT INTO movies VALUES (113823, 'Three Guys Named Mike', '1951-03-01', NULL, 90, 0, 'A stewardess becomes romantically involved with an airline pilot, a college professor, and a successful businessman...all of whom are named Mike. When the three find out about each other, she has to decide which one she loves the most.');
INSERT INTO movies VALUES (133119, 'Torch Song', '1953-10-01', NULL, 90, 0, 'Jenny Stewart is a tough Broadway musical star who doesn''t take criticism from anyone. Yet there is one individual, Tye Graham, a blind pianist who may be able to break through her tough exterior.');
INSERT INTO movies VALUES (113843, 'Woman''s World', '1954-09-30', NULL, 94, 0, 'Needing to fill the position of general manager of his company, and believing that an executive''s wife is crucial to her husband''s success, auto industry mogul Gifford brings three couples to New York to size up: Jerry and Carol: he hard-driven and self-reliant, she willing to use her beauty to further her husband''s career; Sid and Elizabeth, he ulcer-ridden and torn between achieving success and restoring their troubled marriage, she positive that his job will kill him, but gamely agreeing to play the good wife for the duration; and down-to-earth Bill, whose good-natured Katie fears that his promotion would spell the end of their idyllic familiy existence.');
INSERT INTO movies VALUES (113921, 'Dallas', '1950-12-30', NULL, 94, 0, 'Land, a family, a future. They''re "dreams, fried up, short order" for Blayde Hollister (Gary Cooper). Rightly or wrongly, this ex-Confederate from Georgia has waged his own war to settle past injustices. Now he''s a wanted man. And he can feel the law closing in on him.  Posing as a Boston dandy, he comes to the boom town with a gun and a plan: to smoke out the notorious Marlow brothers (including Steve Cochran and Raymond Massey), then give ''em a whiff of gunsmoke. Director Stuart Heisler (Along Came Jones) keeps the pace flowing like the local saloon''s liquor. Max Steiner''s score gallops like a hell-for-leather posse and screenwriter John Twist fires scene after scene with lines like "you''ll get your pockets picked in a graveyard". Dallas, here we come!');
INSERT INTO movies VALUES (114081, 'The Blue Veil', '1951-10-26', NULL, 113, 0, 'Louise Mason is a young widow who fills her empty life with the task of becoming a children''s nurse. As the years pass, and the widow tries to find her own place in life, her young charges, the children of various employers, grow and soon find themselves ready to face the world. When it seems that she will be alone, the nurse finds that her ''children'' have ideas of their own in regards to helping their beloved mentor.');
INSERT INTO movies VALUES (114083, 'Trial', '1955-10-07', NULL, 105, 0, 'The story of a murder trial where a Mexican boy is accused of the death of a Caucasian girl. The two-faced attorney (Arthur Kennedy) who takes the boy''s case is only interested in defending him so he can exploit his Communist-backed organization for their own underhanded purposes. He and his organization bring in an idealistic law professor (Glenn Ford) who agrees to represent the boy in court.');
INSERT INTO movies VALUES (114354, 'El río y la muerte', '1955-06-30', NULL, 91, 2, 'A useless and bloody vendetta has been going on for ages between two families in this mexican village. Men, sons, have killed each other for generations, for a so-called conception of honor in a revenge that never ends since it is also triggered by people of the village. Now, today, there are only two sons left, one in each family. One has become a doctor in the big city and his culture is modern. The other last one - of the other family - hasn''t left the village and is waiting for the doctor to come "home" as he plans to kill him, to settle this war on this matter of honor once and for all. And the people of the village want blood.');
INSERT INTO movies VALUES (114499, 'The Vanishing Prairie', '1954-08-17', NULL, 71, 0, 'Story of the American Prairie as it was when vast herds of bison and elk grazed.');
INSERT INTO movies VALUES (114872, 'Invitation', '1952-01-29', NULL, 84, 0, 'A rich man buys a husband (Van Johnson) for his dying daughter (Dorothy McGuire), and she finds out.');
INSERT INTO movies VALUES (114975, 'Wichita', '1955-07-03', NULL, 81, 0, 'Former buffalo hunter and entrepreneur Wyatt Earp arrives in the lawless cattle town of Wichita Kansas. His skill as a gun-fighter make him a perfect candidate for Marshal but he refuses the job until he feels morally obligated to bring law and order to this wild town.');
INSERT INTO movies VALUES (115111, 'Goodbye, My Fancy', '1951-05-19', NULL, 107, 0, 'A headstrong Congresswoman (Joan Crawford) rekindles old romantic flames when she returns to the college she once attended--and was expelled from--to receive an honorary degree. Director Vincent Sherman''s 1951 film also stars Robert Young, Eve Arden, Frank Lovejoy, Janice Rule, Howard St. John, Lurene Tuttle, Ellen Corby, Morgan Farley, Viola Roache and John Qualen.');
INSERT INTO movies VALUES (115706, 'Hold That Line', '1952-03-23', NULL, 67, 0, 'The Bowery Boys are enrolled in a fancy college by a pair of rich snobs who think they can turn the Boys into classy guys. Sach becomes a football star, and is kidnapped by gangsters to keep him out of the big game.');
INSERT INTO movies VALUES (115834, 'Ten Tall Men', '1951-10-26', NULL, 97, 0, 'Sgt. Mike Kincaid of the French Foreign Legion learns, from a Riff prisoner, that an attack will soon be made by the villainous Hussin on the Legion''s outpost of Tarfa. Kincaid volunteers to lead nine other Legionnaires on a mission to delay Hussin''s attack till reinforcements arrive. When he discovers that Hussin plans to marry Mahla, a girl from a rival tribe, in order to build a coalition against the French, Kincaid kidnaps Mahla. Hussin forcefully takes her back, but by now his planned attack on Tarfa is crumbling and Mahla has begun to fall in love with Kincaid.');
INSERT INTO movies VALUES (116160, 'Jalopy', '1953-02-15', NULL, 62, 0, 'Those wacky Bowery Boys invent a superfast fuel, which will help them win an auto race (isn''t this cheating?). However, the fuel is stolen by the bad guys just before the big race...');
INSERT INTO movies VALUES (116190, 'Paris Playboys', '1954-03-07', NULL, 62, 0, 'Sach is the exact double of a famous French scientist who has invented a powerful rocket fuel. Enemy agents, mistaking Sach for the scientist, attempt to kidnap him and get the formula for the fuel.');
INSERT INTO movies VALUES (118009, 'Víctimas del pecado', '1951-02-02', NULL, 90, 2, 'In México City, a Cuban dancer from "Cabaret Changó" rescues a baby from a garbage can and decides to raise him, but her pachuco pimp gets in her way.');
INSERT INTO movies VALUES (118236, 'State Secret', '1950-09-11', NULL, 104, 0, 'Visiting in England, famed American surgeon Doctor John Marlowe is decoyed to a middle European country, and discovers the operation he is to perform is on the Vosnian dictator. When the latter dies, he is replaced by a look-alike, but Marlowe is the object of a shoot-to-kill, vicious pursuit by the secret police of Vosnia since it is vital to Vosnia that the dictator''s death does not become known. Fleeing, he seeks help from an English-speaking actress, Lisa Robinson, and the two are harried across the countryside before being captured.');
INSERT INTO movies VALUES (118446, 'The Last Outpost', '1951-04-04', NULL, 89, 0, 'The cavalry defend a small town from indians.');
INSERT INTO movies VALUES (118490, 'Jedda', '1955-05-05', NULL, 101, 0, 'An aboriginal girl is brought up by a white family that adopts her. As a young woman, she is mysteriously drawn to go "Walkabout" as people of her tribe have for hundreds of years.');
INSERT INTO movies VALUES (118517, 'Valley of the Kings', '1954-07-23', NULL, 86, 0, 'Hard-boiled archeologist Mark Brandon is searching for ancient tombs in Egypt when he is approached by beautiful Ann Mercedes, who convinces him to help her fulfill her deceased father''s life''s ambition - to provide solid proof of the biblical Joseph''s travels in ancient Egypt. As an ex-pupil of Ann''s father Mark accepts and the two embark on a search for the tomb of the Pharoah Ra Hotep, said to have had some connection with Joseph. The trail to the tomb is fraught with intrigue, betrayal, murder and the possibility that the tomb itself has been emptied of all its artifacts by ancient looters.');
INSERT INTO movies VALUES (132654, 'Les Miserables', '1952-08-14', NULL, 105, 0, 'Jean Valjean, a Frenchman of good character, has nevertheless been convicted for the minor crime of stealing bread. A minor infraction leads to his pursuit by the relentless policeman Javert, a pursuit that consumes both men''s lives for many years.');
INSERT INTO movies VALUES (133716, 'Valley of Head Hunters', '1953-07-29', NULL, 67, 0, 'Bad guys trying to steal the mineral rights away from African natives find it isn''t so easy fighting Jungle Jim.');
INSERT INTO movies VALUES (118636, 'Zombies of the Stratosphere', '1952-07-16', NULL, 167, 0, 'Martians come to Earth to build an H-bomb strong enough to blast Earth out of orbit so that Mars can be moved into its place in closer proximity to the sun.  Super-scientist Larry Martin, inventor of the first stratospheric-flight spaceship as well as a jet-powered personal flying suit with helmet, is called upon by the government to investigate ramped-up UFO reports occasioned by the Martians'' spaceships.  The Martians, meanwhile, led by Marex, engage a renegade earth scientist and a gaggle of gangsters to help them steal supplies, operate a menacing robot, and build their bomb.  This movie serial in 12 chapters was originally planned as a sequel to "Radar Men From The Moon" with Commando Cody as the hero but at the last moment the main characters'' names were changed and all other references to that serial removed from the script.');
INSERT INTO movies VALUES (118910, 'The Court-Martial of Billy Mitchell', '1955-12-31', NULL, 100, 0, 'A dramatization of the American general and his court martial for publically complaining about High Command''s dismissal and neglect of the aerial fighting forces.');
INSERT INTO movies VALUES (120259, 'About Mrs. Leslie', '1954-08-03', NULL, 104, 0, 'A lonely, unhappy owner of a Beverly Hills boarding house reflects on her lonely, unhappy life and the lonely, unhappy man she once loved. Director Daniel Mann''s 1954 drama about lonely, unhappy people stars Shirley Booth, Robert Ryan, Alex Nicol, Marjie Millar, Eileen Janssen, Percy Helton, Ray Teal, Maidie Norman, Mabel Albertson, Ellen Corby, Harry Morgan, James Bell, Virginia Brissac, Laura Elliott, Philip Ober, Nana Bryant and Ian Wolfe.');
INSERT INTO movies VALUES (120509, 'Blackbeard, the Pirate', '1952-12-24', NULL, 99, 0, 'Honest Edward Maynard finds himself serving as ship''s surgeon under the infamous pirate Blackbeard.');
INSERT INTO movies VALUES (120615, 'Arena', '1953-06-24', NULL, 83, 0, 'Left by his wife (Polly Bergen), a vain rodeo star (Gig Young) picks up a floozy (Jean Hagen) and rides a bad Brahman bull.');
INSERT INTO movies VALUES (120932, 'Desperate Search', '1952-11-19', NULL, 73, 0, 'A man (Howard Keel), his wife (Jane Greer) and his famous-aviator ex-wife (Patricia Medina) search for their two children lost with a cougar.');
INSERT INTO movies VALUES (121703, 'Cattle Queen of Montana', '1954-11-18', NULL, 88, 0, 'Sierra Nevada Jones must fight a villainous rancher to regain the land that is rightfully hers.');
INSERT INTO movies VALUES (121707, 'Montana', '1950-01-28', NULL, 76, 0, 'An Australian sheep man comes to Montana looking for grazing space, is opposed by local ranchers and a wealthy cattle-woman.');
INSERT INTO movies VALUES (122221, 'The Limping Man', '1953-12-11', NULL, 76, 0, 'An American (Lloyd Bridges) returns to his London lover (Moira Lister) and joins the search for a limping sniper.');
INSERT INTO movies VALUES (122252, 'The Naked Street', '1955-08-01', NULL, 84, 0, 'A reporter follows the story of a gangster (Anthony Quinn), his sister (Anne Bancroft) and her small-time hoodlum husband (Farley Granger).');
INSERT INTO movies VALUES (123432, 'The Lady Says No', '1952-01-06', NULL, 80, 0, 'The feminist author of a national best-seller titled "The Lady Says No" meets a sexist magazine photographer and decides she''d rather say yes. Director Frank Ross'' 1952 comedy stars David Niven, Joan Caulfield, James Robertson Justice, Frances Bavier, Lenore Lonergan, Peggy Maley, Henry Jones and Jeff York.');
INSERT INTO movies VALUES (123868, 'Destination Gobi', '1953-03-20', NULL, 90, 0, 'A group of US Navy weathermen taking measurements in the Gobi desert in World War II are forced to seek the help of Mongol nomads to regain their ship while under attack from the Japanese.');
INSERT INTO movies VALUES (124521, 'Dead on Course', '1952-04-01', NULL, 73, 0, 'A former pilot suffering from blackouts discovers that a fellow flyer is suspected of being mixed up with a web of smugglers.  While searching for his missing buddy, he unwittingly becomes entangled in a morass of suspicion.');
INSERT INTO movies VALUES (124527, 'Face the Music', '1954-01-29', NULL, 84, 0, 'A famed trumpet player is suspected of murdering a blues singer. Using only two minor clues, he narrows the suspects to four people, but only after surviving poison placed on the mouthpiece of his trumpet!');
INSERT INTO movies VALUES (125666, 'Killer Shark', '1950-03-19', NULL, 76, 0, 'A college student takes a break and goes out to sea with his father, the captain of a shark-hunting boat. When his inexperience results in an accident in which his father and a crewman are badly injured, he tries to make up for it by rounding up another crew and going back out on the hunt. However, things don''t turn out quite the way he planned.');
INSERT INTO movies VALUES (126596, 'The Mudlark', '1950-11-28', NULL, 94, 0, 'It''s 1875 and a young street urchin wants to see Queen Victoria...');
INSERT INTO movies VALUES (127602, 'Happy Go Lovely', '1951-03-06', NULL, 97, 0, 'B.G. Bruno, a rich bachelor, the head of a successful greeting-card company in Scotland, is essentially a kind man but respectable to the point of stodginess and extreme stuffiness. An American troupe visiting Edinburgh wants to produce a musical in town but has trouble getting backers. Bruno meets several of the leading ladies of the show; through a misunderstanding he doesn''t correct they think that he''s a newspaper reporter. He falls in love with one of the women, who reciprocates; he grows more lively and friendly, to the surprise of his employees. After a series of mishaps and comic incidents comes a happy ending: a successful show and true love.');
INSERT INTO movies VALUES (127817, 'Blinkity Blank', '1955-01-01', NULL, 5, 0, 'An animated short film with an improvised jazz soundtrack.');
INSERT INTO movies VALUES (128048, 'Sea Devils', '1953-05-23', NULL, 91, 0, 'Gilliatt, a fisherman-turned-smuggler on the isle of Guernsey, agrees to transport a beautiful woman to the French coast in the year 1800. She tells him she hopes to rescue her brother from the guillotine. Gilliatt finds himself falling in love and so feels betrayed when he later learns this woman is a countess helping Napoleon plan an invasion of England. In reality, however, the "countess" is an English agent working to thwart this invasion. When Gilliatt finds this out, he returns to France to rescue the woman who''s true purpose has been discovered by the French.');
INSERT INTO movies VALUES (128606, 'The Gun That Won the West', '1955-09-01', NULL, 71, 0, 'In the late 1880s, Colonel Carrington and his command are assigned the job of constructing a chain of forts in the Sious Indian territory of Wyoming. Carrington recruits former cavalry scouts Jim Bridger and "Dakota Jack" Gaines to lead the project. Bridger and Gaines are friendly with Sioux chief Red Cloud, and they feel a peace treaty with the Indians can be made. If an Indian-war breaks out, the cavalry is depending on getting a new type of Springfield rifle. Bridger, Gaines and Gaines wife, Maxine, arrive at the fort for the conference. Gaines, in a drunken fit, tries to intimidate the Indians unto signing a treaty. Chied Red Fox threatens war if his territory is invaded by any troops building forts.');
INSERT INTO movies VALUES (130424, 'The Story of Three Loves', '1953-03-26', NULL, 122, 0, 'Passengers on an ocean liner recall their greatest loves.');
INSERT INTO movies VALUES (130885, 'Take Me to Town', '1953-06-19', NULL, 81, 0, 'Saloon entertainer Vermilion O''Toole and her former partner in crime Newt Cole escape from a train ride to prison and hide out in logging town Timberline. Meanwhile, the three ''cute'' sons of widower Will Hall come to town in search of a wife for their dad, and pick our heroine. Vermilion needs to lay low to escape the marshal, so she accepts the boys'' offer to visit pioneer community Pine Grove. Once there, she annoys local Mrs. Grundys but eventually starts to fit in. But what is that blackhearted villain Newt Cole up to? Written by Rod Crawford');
INSERT INTO movies VALUES (130900, 'Nancy Goes to Rio', '1950-03-10', NULL, 100, 0, 'Mother and daughter (Sothern and Powell) compete over same singing role and, unbeknownst to each other, the same man.');
INSERT INTO movies VALUES (120280, 'Pekka ja Patka puistotateina', '1955-03-04', NULL, 64, 55, 'nan');
INSERT INTO movies VALUES (138486, 'Arrow In The Dust', '1954-04-25', NULL, 79, 0, 'Director Lesley Selander''s 1954 western stars Sterling Hayden, Coleen Gray, Keith Larsen, Tom Tully, Lee Van Cleef and Jimmy Wakely.');
INSERT INTO movies VALUES (139799, 'The Glass Slipper', '1955-01-01', NULL, 93, 0, 'The Glass Slipper (1955) is a musical film adaptation of Cinderella, made by MGM, directed by Charles Walters and produced by Edwin H. Knopf from a screenplay by Helen Deutsch. The music score is by Bronislau Kaper, the cinematography by Arthur E. Arling, the art direction by Daniel B. Cathcart and Cedric Gibbons and costume design by Walter Plunkett and Helen Rose.');
INSERT INTO movies VALUES (139922, 'She''s Working Her Way Through College', '1952-07-12', NULL, 104, 0, 'Shapely burlesque dancer Hot Garters Gertie aka Angela Gardner meets her former teacher John Palmer, now a professor at Midwest State... where she decides to begin her new college career. She rents a room; her new landlady proves to be the professor''s wife. Among romantic complications, Angela helps the downtrodden dramatic arts department put on a potentially popular musical show...but someone''s discovered her secret past. Does she have an ace up her garter? Written by Rod Crawford');
INSERT INTO movies VALUES (140849, 'The Rawhide Years', '1955-11-28', NULL, 85, 0, 'Ben Matthews gives up the flashy life of a riverboat gambler, hoping to settle down in Galena with his girlfriend, luscious entertainer Zoe. But Galena''s leading citizen is murdered on the boat; Ben, on arrival, finds a lynch mob after his neck, and flees. Three years of wandering later, Zoe''s letters stop coming and Ben returns to find her and attempt the hopeless task of clearing himself.');
INSERT INTO movies VALUES (141978, 'They Rode West', '1954-12-04', NULL, 84, 0, 'Dr. Allen Seward (Robert Francis) is assigned to a western cavalry post where his predecessors had been drunks and slackers. The post doesn''t take kindly to him either, especially after he disregards regulations and tends to sick Indians on the malaria-infested reservation. The Indians break away from the reservation to move to a healthier higher ground, and when they join with the Comanches to besiege the fort, Seward is branded as a "woodhawk", the bird that turns against its own. Donna Reed is present as the niece of the post commander; Phil Carey is a cavalry captain that believes the only good Indian is a dead Indian, and May Wynn (who shared a screen debut with Francis in "The Caine Mutiny)is the white girl raised by the Indians and married to the chief''s son. Francis would make only two more films before being killed in a 1955 plane crash.');
INSERT INTO movies VALUES (144121, 'Best of the Badmen', '1951-08-09', NULL, 84, 2, 'Though RKO Radio Pictures was, in 1951, still faithful to the concept of "B" westerns starring Tim Holt, the studio was more than capable of turning out an "A" oater from time to time. Best of the Badmen stars Robert Ryan as a former Union officer who persuades a fictional vigilante group which closely resembles Quantrill''s Raiders to lay down their arms and seek out new and honest lives. Ryan is undercut by shifty Pinkerton man Robert Preston, who wants to collect the rewards on the heads of the ex-vigilantes; to that end, he frames Ryan for murder. With the help of Preston''s embittered wife Claire Trevor, Ryan escapes and turns outlaw with the men whom he''d earlier convinced to turn honest.');
INSERT INTO movies VALUES (144852, 'Dig That Uranium', '1955-12-25', NULL, 61, 0, 'The boys buy a uranium mine out west, but when they get there they find that it''s pretty much worthless. However, the local badmen are distrustful of these new strangers, and when they mistakenly get the impression that the mine is loaded with uranium, they hatch a scheme to get rid of the boys and take over the mine.');
INSERT INTO movies VALUES (145813, 'Bunker Hill Bunny', '1950-09-23', NULL, 7, 0, 'Sam Von Schamm The Hessian and Bugs Bunny fight it out in the little known American Revolutionary War Battle of Bagel Heights.');
INSERT INTO movies VALUES (146075, 'Rio, 40 graus', '1955-08-24', NULL, 100, 38, 'Banned by Brazil’s Federal Department of Public Safety, Rio, 40 Graus is a landmark film that ushered in the wave of Neorealist cinema in Brazil - Cinema Novo. The film chronicles a day in the life of five peanut vendors from the favelas (shanty towns) of Rio de Janeiro. This was one of the first Brazilian films to address the issues of race, poverty, and class. These themes would continue to be examined by dos Santos throughout his career. – JCRR, Cine Las Americas');
INSERT INTO movies VALUES (147810, 'Let''s Dance', '1950-11-29', NULL, 112, 0, 'After the war, Donald Elwood meets his former USO partner, Kitty McNeil. Kitty, now the widow of Richard Everett, has a little boy named Richie; and she is trying to evade her husband''s grandmother''s control. Serena Everett controls the family money, and she wants Kitty and Richie to live according to the customs and class of the Everett family.');
INSERT INTO movies VALUES (147882, 'At Sword''s Point', '1952-04-22', NULL, 81, 0, 'France, 1648: Richelieu and Louis XIII are dead, the new king is a minor, and the Duc de Lavalle is in virtually open rebellion, scheming to seize power. As a last resort, Queen Anne summons the heirs of the original Musketeers to her aid...including Claire, daughter of Athos, who when she chooses can miraculously pass as a boy, and wields as fine a sword as any. All their skills will be needed for a battle against increasing odds. One for all and all for one! Written by Rod Crawford');
INSERT INTO movies VALUES (147903, 'Santa Fe', '1951-04-01', NULL, 88, 0, 'After their service in the Civil War, four brothers go their separate ways, but later find themselves on opposite sides of a final showdown.');
INSERT INTO movies VALUES (148356, 'Don''t Give Up the Sheep', '1953-01-03', NULL, 7, 0, 'A sheepdog thwarts the efforts of a thieving wolf whose tricks include altering the time clock, hiding in a bush, imitating Pan, digging a tunnel, unleashing a wildcat and disguising himself as the dog''s coworker.');
INSERT INTO movies VALUES (148766, 'Forever Female', '1954-01-13', NULL, 93, 0, 'Ginger Rogers stars as an aging stage actress in this 1953 comedy set in the theatre world. Call it "All About Eve Lite". Directed by Irving Rapper, the cast includes William Holden, Paul Douglas, Pat Crowley, James Gleason, Jesse White, Marjorie Rambeau, George Reeves, King Donovan, Marion Ross, Kathryn Grant, Maidie Norman and Almira Sessions.');
INSERT INTO movies VALUES (149114, 'Seven Angry Men', '1955-03-27', NULL, 90, 0, 'Director Charles Marquis Warren''s 1955 period drama about abolitionist John Brown''s crusade to free the slaves stars Raymond Massey, Jeffrey Hunter, Debra Paget, Larry Pennell, Leo Gordon, James Best, John Smith, Dennis Weaver, James Edwards, Guy Williams, James Anderson, Dabbs Greer, Robert "Smoki" Whitfield and Tom Irish.');
INSERT INTO movies VALUES (149895, 'The Red Ball Express', '1952-05-24', NULL, 83, 0, 'August 1944: proceeding with the invasion of France, Patton''s Third Army has advanced so far toward Paris that it cannot be supplied. To keep up the momentum, Allied HQ establishes an elite military truck route.');
INSERT INTO movies VALUES (149957, 'Jungle Man-Eaters', '1954-06-01', NULL, 68, 0, 'Jungle Jim does battle with a would-be diamond smuggler and a renegade tribe.');
INSERT INTO movies VALUES (150010, 'Soldat Ivan Brovkin', '1955-09-08', NULL, 93, 0, 'This exhilarating two-part film (“Soldier Ivan Brovkin” and “Ivan Brovkin on the State Farm”) presented to the country a new national hero – kind, modest, charming and… ne’er-do-well. That “ne’er-do-well-ness” proved “Kharitonov’s special key to audiences’ hearts”. Following Brovkin’s appearance on the screen, Kharitonov had become a star of the national cinema, an idol for millions of people. His incredible popularity may be compared to that of another national hero – the world’s first cosmonaut Yuri Gagarin. And not surprisingly, it was Kharitonov who made a cameo appearance going up the festival stairs and followed with the adoring eyes of the heroines in V. Menshov’s Oscar-winning melodrama “Moscow Does Not Believe in Tears”.');
INSERT INTO movies VALUES (151310, 'Ambush', '1950-01-13', NULL, 90, 0, 'A Westerner searches for a white woman held by the Apaches.');
INSERT INTO movies VALUES (152266, 'Submarine Command', '1952-01-18', NULL, 87, 0, 'Submarine commander Ken White is forced to suddenly submerge, leaving his captain and another crew member to die outside the sub during WW II. Subsequent years of meaningless navy ground assignments and the animosity of a former sailor, leave White (now a captain) feeling guilty and empty. His life spirals downward and his wife is about to leave him. Suddenly, he is forced into a dangerous rescue situation at the start of the Koren War.... reassigned to the same submarine where all of his problems began.');
INSERT INTO movies VALUES (153228, 'The Moonlighter', '1953-09-19', NULL, 77, 0, 'A savage story of hate turned love and frenzy turned loose!');
INSERT INTO movies VALUES (154093, 'Riding Shotgun', '1954-04-01', NULL, 73, 0, 'When a stagecoach guard tries to warn a town of an imminent raid by a band of outlaws, the people mistake him for one of the gang');
INSERT INTO movies VALUES (156566, 'Red Garters', '1954-02-09', NULL, 91, 0, 'A spirited cast kicks up its heels in a lively musical spoof of cowboy films crammed with spur-jangling tunes by Jay Livingstone and Ray Evans and decked out with colorfully stylized, Oscar.-nominated sets. Rosemary Clooney heads up the high-kicking, red-gartered girls of the Red Dog Saloon. They can-can. but she won''t-won''t unless Jason (Jack Carson) asks her to get hitched. Guy Mitchell and Gene Barry are gun-totin'' polecats who think they''ve got a feud to settle. And Frank Faylen and Buddy Ebsen are among the folks who hope the gunslingers get itchy fingered - so they can hold a town barbecue during the funeral!');
INSERT INTO movies VALUES (156603, 'Let''s Go Navy!', '1951-07-29', NULL, 68, 0, 'The Bowery Boys join the Navy to catch some crooks who are posing as sailors.');
INSERT INTO movies VALUES (160783, 'Branded', '1950-11-03', NULL, 104, 0, 'A gunfighter takes part in a scheme to bilk a wealthy cattle family out of half a million dollars by pretending to be their son, who was kidnapped as child.');
INSERT INTO movies VALUES (161602, 'Calling Bulldog Drummond', '1951-12-14', NULL, 80, 0, 'The British sleuth (Walter Pidgeon) leaves retirement to help a Scotland Yard woman (Margaret Leighton) catch thieves armed with radar.');
INSERT INTO movies VALUES (171019, 'Pony Soldier', '1952-04-01', NULL, 82, 0, 'Duncan MacDonald, a 19th-century Royal Canadian Mountie, has to escort a group of Cree Indians back to their above-the-border reservation. His guide in this endeavor is the not-too-trustworthy half-breed Natayo.');
INSERT INTO movies VALUES (171130, 'Starlift', '1951-12-14', NULL, 103, 0, 'Air Force fliers Rick Williams and Mike Nolan attempt to meet film star Nell Wayne, with whom Rick shares a hometown but not much else. Fellow film stars Doris Day and Ruth Roman mistakenly believe Rick to be very close to Nell and arrange for him to meet her. The pair begin to form a match, especially after Nell, Doris, and Ruth arrange for Hollywood stars to perform for G.I.s in transit to and from the Korean War, at Travis Air Base. But Nell thinks Rick is getting ready to ship out to the war, when in reality, he and Mike ferry troops part of the way then return to Travis Air Base with returning soldiers. Nell is furious with Rick for letting her believe he was headed to a war zone, especially because the press has made a huge story of their romance. Meantime, a new program, Operation Starlift, has been set in place by the Air Force and the Hollywood studios, whereby stars are flown to San Francisco to perform for the outbound and inbound troops');
INSERT INTO movies VALUES (172908, 'Time Bomb', '1953-02-05', NULL, 72, 0, 'When a saboteur places an explosive device on a train full of sea mines, the authorities call for bomb expert Peter Lyncort to diffuse the situation, unaware that he has explosive problems of his own.');
INSERT INTO movies VALUES (173662, 'Stella', '1950-07-20', NULL, 83, 0, 'Screwball black comedy about a wacky family that forgets where they''ve buried a corpse.');
INSERT INTO movies VALUES (173845, 'Dirch Passer valter byen', '1954-03-22', NULL, NULL, 14, 'Dirch Passer as detective and lady friend in this Swedish/Danish comedy movie');
INSERT INTO movies VALUES (173893, 'Cry, the Beloved Country', '1952-04-26', NULL, 103, 0, 'In the back country of South Africa, black minister Stephen Kumalo (Canada Lee) journeys to the city to search for his missing son, only to find his people living in squalor and his son a criminal. Reverend Misimangu (Sidney Poitier) is a young South African clergyman who helps find his missing son-turned-thief and sister-turned-prostitute in the slums of Johannesburg.');
INSERT INTO movies VALUES (174195, 'Private Eyes', '1953-12-06', NULL, 64, 0, 'After being punched in the nose, Sach finds out that he has the ability to read minds. Slip and the gang start up a detective agency try to cash in on Sach''s new powers.');
INSERT INTO movies VALUES (174278, 'Duffy of San Quentin', '1954-03-16', NULL, 78, 0, 'San Quentin''s new warden crusades for reform and for a framed inmate who loves a nurse.');
INSERT INTO movies VALUES (174773, 'Sealed Cargo', '1951-05-19', NULL, 90, 0, 'A Newfoundland fishingboat comes to the aid of a wrecked Danish sailing ship and tows it to a small village, but eventually the captain of the fishingboat realises that it''s a U-boat supply ship in disguise, loaded with torpedoes. So, together with his crew and a group of villagers he sets about a plan to blow the ship as well as any U-boats that approach it. Based on the novel "The Gaunt Woman" by Edmund Gilligan.');
INSERT INTO movies VALUES (176734, 'A Life of Her Own', '1950-09-01', NULL, 108, 0, 'Glossy melodrama starring Lana Turner as a young woman from Kansas who moves to New York, becomes highly successful at a prestigious modeling agency, and falls in love with a married man.');
INSERT INTO movies VALUES (177234, 'Spy Chasers', '1955-07-31', NULL, 61, 0, 'Slip and the gang (Bowery Boys) foil foes of the exiled, incognito king of Truania (Sig Ruman).');
INSERT INTO movies VALUES (177440, 'The Golden Hawk', '1952-10-08', NULL, 83, 0, 'A 17th-century French pirate (Sterling Hayden) sides with an English noblewoman (Rhonda Fleming) who''s posing as a pirate.');
INSERT INTO movies VALUES (177580, 'The Affairs of Dobie Gillis', '1953-08-14', NULL, 72, 0, 'Grainbelt University has one attraction for Dobie Gillis - women, especially Pansy Hammer. Pansy''s father, even though and maybe because she says she''s in dreamville, does not share her affection for Dobie. An English essay which almost revolutionizes English instruction, and Dobie''s role in a chemistry lab explosion convinces Mr. Hammer he is right. Pansy is sent off broken-hearted to an Eastern school, but with the help of Happy Stella Kolawski''s all-girl band, several hundred students and an enraged police force, Dobie secures Pansy''s return to Grainbelt.');
INSERT INTO movies VALUES (178569, 'Jail Busters', '1955-09-18', NULL, 61, 0, 'Slip and Sach (Bowery Boys) go to prison to help a reporter with a story.');
INSERT INTO movies VALUES (178587, 'The Happy Time', '1952-10-30', NULL, 94, 0, 'A violinist (Charles Boyer) and his brother (Louis Jourdan) guide one''s son through his crush on the family maid in 1920s Ottawa.');
INSERT INTO movies VALUES (178607, 'Right Cross', '1950-10-06', NULL, 90, 0, 'A sportswriter (Dick Powell) forms a ring triangle with a fight manager''s daughter (June Allyson) and her Mexican-American boxer (Ricardo Montalban).');
INSERT INTO movies VALUES (798, 'Punktchen und Anton', '1953-08-26', NULL, 91, 3, 'Punktchen und Anton is a 1953 German film based on the children novel from Erich Kastner about two women who despite all the oppositions together go from chubby to thin.');
INSERT INTO movies VALUES (179057, 'No Sad Songs for Me', '1950-04-27', NULL, 88, 0, 'Mary Scott learns she only has ten months to live before dying of an incurable disease. She manages to keep the news from her husband, Brad and daughter, Polly. She tries to make every moment of her life count, but her effort is weakened by the discovery that Brad is interested in his assistant, Chris Radner. But when she learns that Brad does indeed love her and not Chris, and that Chris is leaving town, she realizes what she must do to ensure the future happiness of Brad and Polly. She persuades Chris to stay, makes a genuine friend of her and watches Polly grow towards Chris.');
INSERT INTO movies VALUES (180819, 'Feudin'' Fools', '1952-09-21', NULL, 63, 0, 'Sach discovers that he is heir to a farm in rural hillbilly country. He and the boys go to the farm to check it out, and find themselves mixed up with feuding hillbillies and a gang of bank robbers.');
INSERT INTO movies VALUES (181876, 'Blackmailed', '1951-01-30', NULL, 85, 0, 'A blackmailer is murdered, and those who witnessed the scene agree to keep quiet; the complication is that the scene is also witnessed by a young artist, a victim of blackmail as well. (BFI Website)');
INSERT INTO movies VALUES (182950, 'Blonde Dynamite', '1950-02-12', NULL, 66, 0, 'While Louie is on vacation, the boys turn The Sweet Shop into an escort service, and soon find a group of beautiful girls as their first clients.');
INSERT INTO movies VALUES (184328, 'Triple Trouble', '1950-08-13', NULL, 67, 0, 'Slip and the gang (Bowery Boys) take the rap for a robbery they did not commit.');
INSERT INTO movies VALUES (184351, 'The Diamond Queen', '1953-11-28', NULL, 80, 0, 'A French jeweler travels to India in search of a fabulous diamond.');
INSERT INTO movies VALUES (184802, 'Because You''re Mine', '1952-10-01', NULL, 103, 0, 'A famous opera singer (Mario Lanza) falls for his sergeant''s (James Whitmore) sister (Doretta Morrow) at boot camp.');
INSERT INTO movies VALUES (185180, 'Mi adorado Juan', '1950-02-12', NULL, NULL, 2, 'nan');
INSERT INTO movies VALUES (185197, 'The Merry Widow', '1952-09-04', NULL, 105, 0, 'Marshovia, a small European kingdom, is on the brink of bankruptcy but the country may be saved if the wealthy American Crystal Radek, widow of a Marshovian, can be convinced to part with her money and marry the king''s nephew count Danilo. Arriving to Marshovia on a visit, Crystal Radek change places with her secretary Kitty. Following them to Paris, Danilo has a hard time wooing the widow after meeting an attractive young woman at a nightclub, the same Crystal Radek who presents herself as Fifi the chorus girl. Plot by Mattias Thuresson.');
INSERT INTO movies VALUES (185273, 'Bowery Battalion', '1951-01-24', NULL, 69, 0, 'Slip, Sach and the gang (Bowery Boys) think an air-raid test is for real and join the Army.');
INSERT INTO movies VALUES (185289, 'Blues Busters', '1950-10-29', NULL, 67, 0, 'The Bowery Boys (Bowery Boys) open a nightclub after Sach has his tonsils out and wakes up with a singing voice.');
INSERT INTO movies VALUES (186766, 'Olympia 52', '1952-07-10', NULL, 82, 0, 'Olympia 52 is a 1952 French documentary film about the 1952 Summer Olympics in Helsinki, Finland. Olympia 52 was produced by Peuple et Culture, a nonprofit organization, and it was the first feature-length work directed by the French filmmaker Chris Marker, who also co-wrote the narrative and served as one of the production’s four cinematographers.');
INSERT INTO movies VALUES (187516, 'Crazy Over Horses', '1951-09-09', NULL, 65, 0, 'The boys get mixed up with a race horse &amp; crooked gamblers');
INSERT INTO movies VALUES (188392, 'Fright to the Finish', '1954-08-27', NULL, 6, 0, 'Olive is reading ghost stories to the boys. Popeye scoffs; Bluto decides to take advantage of this by staging various pranks (a headless man, an animated skeleton, and a sheet-over-balloon ghost). He pins the blame on Popeye and then goes to comfort Olive. Popeye retaliates by turning invisible, thanks to a jar of vanishing cream.');
INSERT INTO movies VALUES (190407, 'The Great Diamond Robbery', '1954-01-29', NULL, 70, 0, 'Ambrose C. Park, left on a park bench as an infant with an impulsive need to find his parents, is an assistant to a diamond cutter. Shyster lawyer Remlick, in a strategy to get a fabulous uncut diamond through Ambrose, arranges for Emily Drummon, Duke Fargoh and Maggie Drummon to pose as Ambrose''s long-lost parents and sister. The diamond, through many comic situations, is acquired and the gang is going to have Ambrose cut the diamond, and relieve him of the two stones and his parental illusions at the same time. But Maggie, who has no taste for the deception, tips Ambrose off and a wild chase ensues. At the end, Ambrose is very happy as he can now marry his "sister."');
INSERT INTO movies VALUES (191428, 'Liliomfi', '1954-05-31', NULL, NULL, 9, 'Liliomfi is a 1954 Hungarian comedy film directed by Károly Makk. It was entered into the 1955 Cannes Film Festival. Set in the "Golden Era" of the wandering Hungarian theatre troupes. Mariska and Liliomfi fall in love without suspecting that Mariska''s foster father, Professor Szilvay, is also Liliomfi''s uncle. Soon the couple must contend with the professor''s plan to make Liliomfi give up his "unrespectable" profession of acting by exposing the professor''s hypocrisy, greed, and tyrannical selfishness.');
INSERT INTO movies VALUES (192371, 'Clipped Wings', '1953-08-14', NULL, 62, 0, 'Slip and correspondence school pilot Sach, go to an air base to help a pal out...but find themselves in when they mistakenly sign enlistment forms. Can the Air Force turn these dodos into eagles? The guys may be airborne airheads, But just watch them find a way to ground a spy network that''s infiltrated the base.');
INSERT INTO movies VALUES (193321, 'The Deep Blue Sea', '1955-11-01', NULL, 98, 0, 'A woman is unhappy in her marriage to a boring, stiff judge, so she takes up with a wild-living RAF pilot, who ends up being more than she can handle. (TCM.com)');
INSERT INTO movies VALUES (193435, 'High Society', '1955-04-17', NULL, 61, 0, 'Sach receives news that he is the heir to the Terwilliger Debussy Jones fortune. Accompanied by his pal Slip, he arrives at the Jones mansion to review the legal papers needed for him to claim his new fortune. However, Sach and Slip discover that the rightful heir, the young Terwilliger III, is being cheated out his inheritance by the miscreant duo of Stuyvesant Jones and Clarissa. Sach and Slip, with the help of their fellow Bowery Boys, save the day and restore the heir’s inheritance.');
INSERT INTO movies VALUES (193459, 'Lucky Losers', '1950-05-14', NULL, 70, 0, 'Slip and Sach''s boss, David J. Thurston, has allegedly committed suicide. Slip finds a book of matches with the name of a local nightclub on his boss'' desk and finds out from Gabe that a gambling casino is being run out of it. Slip comes to the conclusion that the club had something to do with his boss'' death and sets out to find his murderer. The boys get jobs at the club and Louie poses as a rich cattlemen as they gather the information to convict the murderers.');
INSERT INTO movies VALUES (193547, 'Kind Lady', '1951-06-20', NULL, 78, 0, 'Mary Herries has a passion for art and fine furniture. Even though she is getting on in years, she enjoys being around these priceless articles. One day she meets a strange young painter named Elcott, who uses his painting skill to enter into her life. Little does she expect that his only interest in Mary is to covet everything she has.');
INSERT INTO movies VALUES (193878, 'A Millionaire for Christy', '1951-09-02', NULL, 91, 0, 'Christy Sloane is sent on a business trip to inform radio personality Peter Lockwood that his uncle has died and left him $2 million. Christy, who''s in financial straits, decides to try to snag Peter. Zany hijinks ensue and romantic sparks fly.');
INSERT INTO movies VALUES (251657, 'Sininen viikko', '1954-02-26', NULL, 70, 0, 'A Bergmanesque triangle drama. After a weekend of dancing and camping on a recreation island near the city, a young factory worker decides to stay and cut work for a day. Walking around the now deserted island, he meets a beautiful woman camping alone and sunbathing in the nude on the beach. A hot romance flares up between the worker and the more upper-class married lady, lasting through the light-filled nights of the whole summer week until the woman''s much older husband returns to the island the next weekend.');
INSERT INTO movies VALUES (196862, 'Never a Dull Moment', '1950-08-19', NULL, 89, 0, 'Kay Kingsley, a sophisticated and successful songwriter in New York City. falls in love with a widowed rancher, Chris Heyward, she meets at the Madison Square Garden Rodeo and they get married, and leave for his ranch in the west. Her friends warn her of an early disillusionment with life on a ranch, far away from the glitter and bright lights of Broadway. Kay makes one difficulty adjustment after another, as the ranch is presided over by Chris''s kids, and an incident occurs with a neighbor that prompts Kay to return to her glamorous life in New York. But she soon finds her heart is with Chris and his children.');
INSERT INTO movies VALUES (197647, 'Encore', '1951-06-11', NULL, 89, 0, 'Encore is a 1951 anthology film composed of adaptations of three short stories by W. Somerset Maugham:  "The Ant and the Grasshopper", directed by Pat Jackson and adapted by T. E. B. Clarke;  "Winter Cruise", helmed by Anthony Pelissier, screenplay by Arthur Macrae;  "Gigolo and Gigolette", directed by Harold French, written by Eric Ambler.  It is the last film in a Maugham trilogy, preceded by Quartet and Trio.');
INSERT INTO movies VALUES (197785, 'Saturday''s Hero', '1951-03-01', NULL, 111, 0, 'A talented high school football player encounters trouble in a college program.');
INSERT INTO movies VALUES (197788, 'Behave Yourself!', '1951-03-15', NULL, 81, 0, 'A young man takes in a dog that turns out to be wanted by mobsters.');
INSERT INTO movies VALUES (197926, 'Sincerely Yours', '1955-11-05', NULL, 115, 0, 'He dazzled America for decades with his musical artistry. Now fans as well as those curious about this exciting entertainer’s unique appeal can relive the Liberace magic in his only starring film, Sincerely Yours. In a poignant story scripted by Irving Wallace, Liberace plays a concert pianist threatened by deafness. Plunged into despair, he finds escape from personal sorrow by secretly involving himself in the problems of strangers. Liberace touches the heart and delights the ear with sparkling renditions of 31 selections from Chopin to Chopsticks. Along the way he romances Joanne Dru and Dorothy Malone, trades barbs with old pro William Demarest and in a warmly humorous nightclub scene, pokes fun at his own image as the 1950s matinee idol of the little-old-lady set. From beginning to end, Sincerely Yours perfectly captures the charisma and sheer musicality of the legendary Mr. Showmanship.');
INSERT INTO movies VALUES (198600, 'Three Sailors and a Girl', '1953-11-23', NULL, 95, 0, 'A group of sailors invest in a musical revue.');
INSERT INTO movies VALUES (199206, 'La ''Moara cu noroc''', '1955-05-01', NULL, 110, 21, 'Follows the inner transformation of a man who tried to fight his demon, the love for money, and lost.');
INSERT INTO movies VALUES (199222, 'Gli innamorati', '1955-06-17', NULL, 81, 0, 'Despite of (or perhaps because of ) its sparse production values and unpretentiousness, the Italian Gli Innamorati was feted at the 1956 Cannes Film Festival. The bulk of the story takes place in a single Roman neighborhood. In the manner of the 1925 German classic A Joyless Street, director Mauro Bolognini studies the hopes, dreams, successes and failures of the neighborhood''s various and sundry denizens. No one subplot dominates the proceedings, though a bit of extra time is afforded the story of a fickle seamstress and her seemingly meek-and-mild boyfriend. The cast is dotted with such reassuringly familiar faces as Nino Manfredi and Gino Cervi. Released in the US as Wild Love, Gli Innamorati was instrumental in bringing international fame to director Bolognini, whose career soon shifted into high drive.');
INSERT INTO movies VALUES (199463, 'Barabbas', '1953-06-13', NULL, 119, 0, 'The story about the thief who didn''t get crucified because Jesus was choosen to take his place.');
INSERT INTO movies VALUES (202198, 'It''s a Dog''s Life', '1955-12-23', NULL, 88, 0, 'A bull terrier tells his life story, from the streets of the Bowery to a life of luxury.');
INSERT INTO movies VALUES (202727, 'Cattle Town', '1952-09-06', NULL, 71, 0, 'Director Noel M. Smith''s 1952 western stars Dennis Morgan, Philip Carey, Amanda Blake and Rita Moreno.');
INSERT INTO movies VALUES (203901, 'The Bespoke Overcoat', '1955-11-01', NULL, 36, 0, 'Fender is a lowly clerk in the warehouse of clothing manufacturers Ranting and Co. His one ambition is to have an overcoat of his own. Refused one by the cold hearted Ranting he asks a tailor friend, Morry, to make him one instead, but dies of cold before he can take delivery of it. Unwilling to give up his only desire even in death, he returns as a ghost to persuade Morry to steal him the overcoat he so coveted in life.');
INSERT INTO movies VALUES (204994, 'Seminole Uprising', '1955-05-01', NULL, 74, 0, 'An angry Seminole chief wages war after his tribe is relocated from Florida to the American West.');
INSERT INTO movies VALUES (205463, 'One Minute to Zero', '1952-09-19', NULL, 105, 0, 'Using refugees as human shields, North Korean troops advance on Col. Steve Jankowski and his dug-in troops. Hoping to turn the throng back, Jankowski orders his gunners to fire warning shots short of the advance. Again and again the cannons roar, aiming closer each time. The approach continues: Jankowski must make an agonizing decision. Robert Mitchum portrays Jankowski, a leader of U.S. forces that are part of the United Nations Coalition pushing back against the invasion south of the 38th Parallel. Tay Garnett (Bataan, The Cross of Lorraine) directs, effectively integrating documentary footage of the conflict. Ann Blyth plays a UN official drawn to Jankowski. And it wouldn''t be a war flick without a tough top kick -- a role Charles McGraw fits perfectly.');
INSERT INTO movies VALUES (205673, 'Pretty Baby', '1950-09-16', NULL, 92, 0, 'A young woman living in Manhattan pretends to be the mother of an infant in order to advance her career. Comedy.');
INSERT INTO movies VALUES (206099, 'The Iron Glove', '1954-04-01', NULL, 77, 3, 'nan');
INSERT INTO movies VALUES (207178, 'The Lion and the Horse', '1952-05-16', NULL, 83, 0, 'After selling it to a cruel rodeo owner, a cowboy attempts to buy back the wild stallion he snared.');
INSERT INTO movies VALUES (207752, 'Thief of Damascus', '1952-04-01', NULL, 78, 0, 'A young man assembles a band of adventurers to take on an evil sultan.');
INSERT INTO movies VALUES (208434, 'The Scarlet Coat', '1955-07-28', NULL, 101, 0, 'A Colonial major (Cornel Wilde) turns traitor to catch a British spy (Michael Wilding) plotting with Benedict Arnold.');
INSERT INTO movies VALUES (210019, 'The San Francisco Story', '1952-05-11', NULL, 80, 0, 'After five years of being away, Rick Nelson (Joel McCrea) returns to San Francisco to find it filled with corruption - and crooked politicians. It isn''t until he meets a beautiful San Franciscan (Yvonne De Carlo), that Nelson decides to get involved with bringing law-and-order to the city by the bay!');
INSERT INTO movies VALUES (210653, 'El Hombre Sin Rostro', '1950-07-29', NULL, 91, 2, 'A faceless killer who hunts women can only be stopped by a detective with a disturbing past.');
INSERT INTO movies VALUES (212950, 'Eight Iron Men', '1952-12-01', NULL, 80, 0, 'Stanley Kramer''s WW-II character study has Lee Marvin as the Sergeant of a small squad laid over during fighting in Italy. During the otherwise boring time between battles, tensions arise as they are ordered not to rescue a squad mate pinned down by the enemy, for fear of risking more lives. Based on the stage play "A Sound of Hunting", by Harry Brown.');
INSERT INTO movies VALUES (215453, 'The Cariboo Trail', '1950-08-01', NULL, 81, 0, 'A cattleman fights to establish a ranch in the middle of gold country.');
INSERT INTO movies VALUES (215471, 'Gold Raiders', '1951-09-09', NULL, 56, 0, 'The Three Stooges travel West where they become heroes by nabbing a gang of would-be robbers.');
INSERT INTO movies VALUES (216876, 'Unchained', '1955-08-25', NULL, 75, 0, 'This fact-based prison drama tells the tale of a band of prisoners living in the innovative 2,600-acre prison at Chino, California. The place takes a humanistic approach to reform and there are no armed guards, no lockups and no uniforms. The underlying philosophy is that if these things are not there, the prisoners will not want to escape, and will instead accept their punishment. A new inmate arrives and soon accustoms himself to the new idea. The story includes the Oscar nominated song Unchained Melody.');
INSERT INTO movies VALUES (217185, 'I''ll Get By', '1950-10-02', NULL, 83, 0, 'I''ll Get By is an updated remake of the 1940 20th Century-Fox musical Tin Pan Alley. William Lundigan and Dennis Day play William Spencer and Freddie Lee respectively, successful song publishers who make hits out of such numbers as "I Got a Gal in Kalamazoo", "Deep in the Heart of Texas", "You Make Me Feel So Young", "There Will Never Be Another You", and other favorites (the rights to all of these songs were conveniently held by 20th Century-Fox). The partnership has some hard times, especially during the feud between ASCAP and the radio networks, when only public-domain songs like "I Dream of Jeannie" were permitted to be broadcast.');
INSERT INTO movies VALUES (217324, 'Trail Guide', '1952-02-15', NULL, 60, 0, 'A cowboy (Tim Holt) and his Mexican-Irish sidekick (Richard Martin) lead a wagon train to an unfriendly place.');
INSERT INTO movies VALUES (217948, 'Teresa', '1951-04-05', NULL, 102, 0, 'An Italian war bride has problems dealing with her husband''s possessive mother.');
INSERT INTO movies VALUES (218221, 'Onna no sono', '1954-03-16', NULL, 141, 0, 'A student at a woman''s university takes a controversial action against the school''s old-fashioned doctrines.');
INSERT INTO movies VALUES (220504, 'Voodoo Tiger', '1952-11-15', NULL, 67, 0, 'Jungle Jim helps an attractive research writer for the British museum clear up the mystery of a tiger cult in Africa while thwarting art thieves and bringing to justice a Nazi war criminal.');
INSERT INTO movies VALUES (223243, 'A Phantasy', '1952-01-01', NULL, 8, 0, 'An animated film drawn entirely in pastels. Various fantastical plant-like things "grow" from the ground, eventually launching five spheres. The spheres drift in space while changing shapes and come back down to another setting, which eventually becomes more fantastical and symbolic than the opening one. The soundtrack has a jazz slant, with an ensemble of four saxophones and synthetic sound (i.e. sound created by drawing directly on the soundtrack).');
INSERT INTO movies VALUES (225244, 'Hokuspokus', '1953-08-31', NULL, NULL, 3, 'nan');
INSERT INTO movies VALUES (225834, 'Operation Diplomat', '1953-12-01', NULL, 70, 0, 'A physician is forced to operate on a mystery figure under shady circumstances.');
INSERT INTO movies VALUES (228444, 'Hell Is Sold Out', '1951-06-01', NULL, 85, 0, 'A supposedly dead writer suddenly turns up to confront the young woman who is using his penname.');
INSERT INTO movies VALUES (232034, 'The Desert Song', '1953-05-30', NULL, 110, 0, 'Shiek Yousseff, poses as a friend of the French while secretly plotting to overthrow them. Apposing Yousseff are the Riffs, whose secret leader, The Red Shadow, is Paul Bonnard, a professor who is studying the desert, and whose attacks on the supply trains intended for Yousseff keep the Riff villages in food. Foreign Legion General Birabeau arrives to conduct an investigation, accompanied by his daughter, Margot. Birabeau hires Bonnard to tutor her, and she is attracted to a Legionaire captain, Claud Fontaine. While the general, Bonnard and Fontaine pay a visit to Yousseff, an American newspaper man, Benji Kidd, discovers a secret way in and out of Yousseff''s palace, with the aid of Azuri, a dancing girl in love with Bonnard. The latter is forced to resume his role as the Riffs leader, and kidnap Margot until he can convince her of Yousseff''s treachery. But Yousseff''s men attack the Riff camp and take Margot prisoner.');
INSERT INTO movies VALUES (236017, 'A Hound for Trouble', '1951-04-27', NULL, 7, 0, 'Kicked off the boat in Italy, Charlie forces himself upon a pizzeria owner. Donning his best Italian accent and garb, Charlie sets to work as a waiter, astonishing and horrifying the customers with his barefoot grape-stomping and musical rendition of "Atsa Matta for You?"');
INSERT INTO movies VALUES (236112, 'Hurdy-Gurdy Hare', '1950-01-20', NULL, 7, 0, 'Hurdy gurdy operator Bugs must get rid of his Chimp when the ape steals the take from him. The replacement ape is is a Gorrilla.');
INSERT INTO movies VALUES (238616, 'The Big Hangover', '1950-05-26', NULL, 82, 0, 'A young law school graduate is hired by a prestigious firm, but he neglects to inform them he is allergic to even a single whiff of alcohol.');
INSERT INTO movies VALUES (238985, 'Hiawatha', '1952-12-28', NULL, 80, 0, 'A young Indian brave attempts to bring peace to two warring tribes.');
INSERT INTO movies VALUES (239519, 'Close to My Heart', '1951-10-01', NULL, 90, 0, 'A journalist''s wife insists on adopting an abandoned child.');
INSERT INTO movies VALUES (241804, 'Fearless Fagan', '1952-08-15', NULL, 79, 0, 'A young man brings his pet lion with him when he''s drafted into the army. Comedy.');
INSERT INTO movies VALUES (242382, 'An Annapolis Story', '1955-04-10', NULL, 81, 0, 'Two brothers, both cadets at Annapolis, fall in love with the same girl.');
INSERT INTO movies VALUES (242631, 'So This Is Love', '1953-07-15', NULL, 101, 0, 'Film biography of opera star Grace Moore, released in 1953.');
INSERT INTO movies VALUES (242737, 'Irena do domu!', '1955-11-26', NULL, 90, 32, 'A factory foreman discovers (to his discontent) that his housewife secretly takes driving lessons in order to get a job and send their son to kindergarten.');
INSERT INTO movies VALUES (243026, 'The Battle of Gettysburg', '1955-01-01', NULL, 30, 0, 'This film was shot entirely at the Gettysburg National Military Park, where the decisive battle of the American Civil War was fought. Leslie Nielsen narrates the story while contemporary songs and the sounds of battle are heard in the background. The sites of the various engagements, the statues of the leaders of the Northern and Southern troops, and the battlefield cemetery are featured. President Abraham Lincoln''s Gettysburg Address is read at the end.');
INSERT INTO movies VALUES (244636, 'Scarlet Angel', '1952-06-20', NULL, 81, 0, 'After robbing a sea captain in New Orleans, a beautiful saloon girl flees and assumes a dead woman''s identity.');
INSERT INTO movies VALUES (247451, 'The Yellow Balloon', '1953-02-10', NULL, 76, 0, 'One of two young boys accidentally falls to his death when playing in a bombed-out London neighborhood. Frankie, the survivor feels guilty about his friend''s death. Len, a petty thief who has just killed a pub owner during a botched robbery, learns of the accident. He poses as Frankie''s friend and blackmails the boy into stealing from his parents to finance Len''s escape. When Len decides that Frankie may know enough to connect him with the murder, he decides to silence the boy in a tense "hide and seek" chase through the ruins.');
INSERT INTO movies VALUES (249264, 'Watch the Birdie', '1950-12-11', NULL, 71, 0, 'A photographer falls for a rich girl and gets mixed up with crooks.');
INSERT INTO movies VALUES (249567, 'Night Into Morning', '1951-06-08', NULL, 86, 0, 'Berkeley university professor adjusts (using alcohol) to tragic fire deaths of wife &amp; son.');
INSERT INTO movies VALUES (250919, 'Der Struwwelpeter', '1955-01-23', NULL, 79, 3, 'Der Struwwelpeter is a popular German children''s book. It comprises of ten illustrated and rhymed stories, mostly about children. Each has a clear moral that demonstrates the disastrous consequences of misbehavior in an exaggerated way. Writer/director Fritz Genschow adapted Hoffmann''s book to the big screen. He made a career doing such films, he had done Hansel and Gretel and would go on to adapt Cinderella, Sleeping Beauty and other family films. Der Struwwelpeter, however, is weirder and darker than the Grimms'' tales. They are heavy morality lessons in which children are burned to death, starved to death, or have their thumbs cut off. In Hoffmann''s world the punishment usually far outweighs the crime. Genschow provided a happy ending: through the wonders of reverse action children are brought back from their fiery deaths, their thumbs are reattached, and their misdeeds undone through the power of St. Nicholas and some sort of Christmas miracle. (via forcesofgeek.com)');
INSERT INTO movies VALUES (252721, 'An Alligator Named Daisy', '1955-12-13', NULL, 85, 0, 'Returning from a cricket match in Ireland, Peter Weston gains a pet alligator from another passenger who abandons it with him.  He is horrified and while his first instinct is to get rid of it he develops a relationship with a young Irishwoman who appears to be entwined with the reptile. He soon discovers that Daisy is tame and seems to be the way to Moira''s heart.');
INSERT INTO movies VALUES (252886, 'The Lion Hunters', '1951-03-25', NULL, 75, 0, 'A lion trapper and his daughter rendezvous with their hardheaded partner in the African jungle. Bomba, with some assistance from the local natives and lions, runs them off.');
INSERT INTO movies VALUES (252894, 'Bomba and the Jungle Girl', '1952-12-07', NULL, 70, 0, 'Bomba decides to find out who his parents were. He starts with Cody Casson''s diary and follows the trail to a native village. An ancient blind woman tells him his parents and the village''s true ruler were murdered by the current chieftain and his daughter.');
INSERT INTO movies VALUES (252916, 'Here Come the Marines', '1952-06-29', NULL, 66, 0, 'After Slip is drafted into the Marines, the rest of the gang volunteers so they can be with him. Sach discovers that the colonel knew his father and he is promoted. During a drill that he is putting the rest of the gang through, they find a soldier left for dead on the side of the road. Slip discovers a playing card next to the marine and traces it to Jolly Joe Johnson''s gambling house. They suspect that the gambling house is cheating and set out to uncover the proof.');
INSERT INTO movies VALUES (259183, 'Home at Seven', '1952-03-16', NULL, 85, 0, 'Unable to recall the past 24 hours, a British bank clerk is the prime suspect for a robbery/murder.');
INSERT INTO movies VALUES (260064, 'My Man and I', '1952-09-05', NULL, 99, 0, 'Chu Chu Ramirez is a Mexican farm laborer in California, with lofty ideals, who is very proud of his new American citizenship. During his time off, he tries to befriend the alcoholic bar girl Nancy. After working for a month for the subsistence farmer Mr. Ames and his frustrated wife, Chu Chu discovers that his paycheck bounces and Ames stalls in paying him. Just after a confrontation between Ames and Chu Chu, Ames is accidentally wounded by his own shotgun and he and his wife blame it on Chu Chu. Despite the support of his friends and sympathetic sheriff, Chu Chu is given a year''s sentence.');
INSERT INTO movies VALUES (260409, 'Barricade', '1950-03-24', NULL, 75, 0, 'Western remake of Jack London''s The Sea Wolf (and Michael Curtiz''s 1941 film adaptation)');
INSERT INTO movies VALUES (261508, 'Harimau Tjampa', '1953-01-01', NULL, 97, 22, 'Set in the 1930s, and narrated like a ballad from the past, "The Tiger from Tjampa" tells of how a young man, Lukman, seeks to avenge his father’s murder by learning pencak silat, a traditional form of self defence, based on the movements of animals. The pencak silat seen in the film is regionally specific to West Sumatra. Silat in many other Indonesian films is often mixed with the kung fu of Hong Kong cinema.');
INSERT INTO movies VALUES (263260, 'Aschenputtel', '1955-09-03', NULL, NULL, 3, 'nan');
INSERT INTO movies VALUES (266373, 'Bengazi', '1955-09-14', NULL, 79, 0, 'An American with a shady past joins with a morally-bankrupt Irishman to find treasure buried by Arabs in a deserted mosque in the Sahara. The situation becomes complicated when they are surrounded by Bedouin bandits.');
INSERT INTO movies VALUES (269981, 'Twelve Angry Men', '1954-09-20', NULL, 51, 0, 'Twelve Angry Men is a 1954 teleplay by Reginald Rose for the Studio One anthology television series. Initially staged as a CBS live production on 20 September 1954, the drama was later rewritten for the stage in 1955 under the same title and again for a feature film, 12 Angry Men (1957). The episode garnered three Emmy Awards for writer Rose, director Franklin Schaffner and Robert Cummings as Best Actor.');
INSERT INTO movies VALUES (272663, 'Fort Vengeance', '1953-03-28', NULL, 75, 0, 'Two brothers flee America and join the Canadian North West Mounted Police. One brother is good, the other bad, both men on a collision course just as trouble starts to brew with the Indians.');
INSERT INTO movies VALUES (274131, 'Proibito', '1954-04-01', NULL, NULL, 0, 'Don Paolo, a young parson troubled by his love for Agnese, tries to make peace in a little village in Sardinia where two families are at war.');
INSERT INTO movies VALUES (275573, 'Bitter Creek', '1954-02-21', NULL, 74, 0, '"Wild" Bill Elliott is a cowboy who goes in search of the man who killed his brother, and finds himself in the small town of Bitter Creek.');
INSERT INTO movies VALUES (276518, 'La spiaggia', '1954-06-12', NULL, 107, 0, 'A prostitute goes on vacation to a beach resort with her young daughter (who''s being schooled by nuns). Everything is cheerful and pleasant at the seashore; the customers at the hotel think she''s a poor widow  - she always wears black - and treat her like a lady. But when one of her former clients arrives, her carefree days on the beach are numbered.');
INSERT INTO movies VALUES (277809, 'Massacre Canyon', '1954-05-01', NULL, 66, 0, 'A band of renegade Apaches attempts to steal a shipment of rifles being transported to Fort Collins.');
INSERT INTO movies VALUES (281124, 'Screen Directors Playhouse:  Meet the Governor', '1955-10-05', NULL, 30, 0, 'A backwoods lawyer''s race for the governor''s office is thwarted by mainstream opponents who dig up dirt from his past.');
INSERT INTO movies VALUES (285959, 'Valentino', '1951-03-08', 1300000, 102, 0, 'Italian immigrant Rudolph Valentino makes it big in silent Hollywood, but he ends up struggling between his career and the woman he loves.');
INSERT INTO movies VALUES (291907, 'Mustasukkaisuus', '1953-01-13', NULL, 90, 0, 'Love triangle near roaring rapids. Two sisters fight for the attention of a handsome forester.');
INSERT INTO movies VALUES (292498, 'Confidentially Connie', '1953-03-12', NULL, 74, 0, 'Texas cattleman Opie Bedloe comes to Maine to visit his son Joe, a college instructor, and his wife Connie in the hopes of persuading Joe to give up his teaching career and come back to Texas and take over the ranch. When Opie finds out that Connie, who is expecting a baby, can not afford the steaks she yearns for on Joe''s salary, Opie, who believes that pregnant women gotta have meat, arranges for the local butcher, Spangenberg to cut his prices in half (with Opie paying the difference) so that Connie can have the meat she desires.');
INSERT INTO movies VALUES (292893, 'Snake River Desperadoes', '1951-05-30', NULL, 54, 0, 'Starrett tries to prevent a range war between settlers and the Native Americans. Blue and his fellow scoundrels think they can profit from the bloodshed,but the Durango Kid along with a couple of precocious youngsters put an end to Blue''s terrorism.');
INSERT INTO movies VALUES (314070, 'Captain Video, Master of the Stratosphere', '1951-12-27', NULL, 287, 0, 'Space hero Captain Video battles the evil Vultura on the planet Atoma.');
INSERT INTO movies VALUES (343972, 'Pecos River', '1951-12-15', NULL, 55, 0, 'Steve is a Government Agent looking for the gang that stole the U.S. Mail. He goes undercover...');
INSERT INTO movies VALUES (342011, 'Carcel de Mujeres', '1951-09-28', NULL, 83, 2, 'nan');
INSERT INTO movies VALUES (350808, 'HIlja, maitotytto', '1953-12-22', NULL, 82, 55, 'Based on a short story by Johannes Linnankoski. A  story of a milkmaid that falls in love with a student on holiday');
INSERT INTO movies VALUES (355515, 'Meet Me at the Fair', '1953-01-01', NULL, 87, 0, 'In 1904, Doc Tilbee, medicine show huckster and champion tall-tale teller, gives a ride to a young boy escaped from an orphanage, where bad conditions (the result of political graft) are being investigated by new appointee Zerelda Wing, who doesn''t know that her fiancée is one of the politicians responsible. Tad wants to stay with his new friend Doc, who is attracted to Zerelda, to the discomfiture of his old flame Clara...all amid nostalgic musical numbers.');
INSERT INTO movies VALUES (357130, 'Tom and Jerry', '1955-11-30', NULL, 30, 0, 'A priest tries to save a marriage that appears to be headed for the rocks in time for Christmas.');
INSERT INTO movies VALUES (391438, 'El amor no es ciego', '1950-04-04', NULL, NULL, 0, 'nan');
INSERT INTO movies VALUES (401895, 'Brigada criminal', '1950-12-04', NULL, 80, 2, 'A young policemen witnesses a bank robbery which will become his first case. To catch the thieves he will infiltrate himself as one of the gang members. At first it works, but it won''t be so easy afterwards.');
INSERT INTO movies VALUES (413235, 'The Veils of Bagdad', '1953-10-06', NULL, 82, 0, 'Antar is sent by Suleiman, head of the Ottoman Empire, to Bagdad to prevent Hammam, Pasha of Bagdad, from purchasing the services of local leader Mustapha to unite the hill tribes and overthrow the emperor. The intrigue mounts as Antar falls in love with dancer Selima, who tries to avenge her father''s death against Hammam''s right-hand-man Kasseim, whose wife Rosanna has fallen in love with Antar!');
INSERT INTO movies VALUES (439263, 'Kaunis Veera eli ballaadi Saimaalta', '1950-09-22', NULL, 88, 55, 'nan');
INSERT INTO movies VALUES (8779, 'Cesta do praveku', '1955-08-04', NULL, 93, 28, 'Most classical sci-fi from K. Zeman. Four young boys visit a dinosaur exhibit at the New York city Museum of Natural History. They then row out onto Central Park Lake where they find a secret cave and paddle into, and go back-in-time into a wondrous prehistoric world filled with the very dinosaurs they had just seen.');
INSERT INTO movies VALUES (18650, 'Froken Julie', '1951-06-28', NULL, 90, 25, 'Based on the play by August Strindberg, Miss Julie vividly depicts the battle of the sexes and classes that ensues when Julie, a wealthy businessman''s daughter, falls for Jean, her father''s bitter servant.');
INSERT INTO movies VALUES (36918, 'Cisaruv pekar – Pekaruv cisar', '1952-01-04', NULL, 144, 28, 'Rudolph II, the Holy Roman Emperor, does not have a simple life. And yet he manages to complicate it even more with his frequent outbursts of anger. While he searches for a mythical Golem, an animated clay statue, Matthew the Baker is thrown into the dungeon for selling the special buns for the emperor to people. Matthew is accidentally mistaken for the emperor and takes his place. And when the Golem is finally found, it will complicate things beyond comprehension...');
INSERT INTO movies VALUES (41228, 'Pysna princezna', '1952-09-26', NULL, 94, 0, 'It''s very human and nice story about lofty princess (her father is amiable but incapable - unforgettable performance of S. Neumann) and good, nice, kind and well-principled young king (prince) who tries to make tender her calm heart to get married with her. After being refused (she''s very capricious), he conclude to make her better. He start to work as a gardener at her castle (in secret) and successively bring she to her senses...The story continues when already reformed princess and the young king (she learn about his real identity later) have to take refuge from troops, that princess father (old king) has sent (of course he took a bad and mean counsellors advice). They have to take shelter by several ordinary and poor families, which are always very friendly and give them a help... Of course the tale has happy end.');
INSERT INTO movies VALUES (43333, 'Desiree', '1954-11-16', NULL, 110, 0, 'In Marseilles, France in 1794, Desiree Clary, a young millinery clerk, becomes infatuated with Napoleon Bonaparte, but winds up wedding Genaral Jean-Baptiste Berandotte, an aid to Napoleon who later joins the forces that bring about the Emperor''s downfall. Josephine Beauharnais, a worldly courtesan marries Napoleon and becomes Empress of France, but is then cast aside by her spouse when she proves unable to produce an heir to the throne.');
INSERT INTO movies VALUES (43338, 'La ilusion viaja en tranvia', '1954-01-01', NULL, 90, 2, 'Confronted with the unfortunate news that their favorite Streetcar, no. 133, is going to be decommissioned, two Municipal Transit workers get drunk and decide to "take ''er for one last spin," as it were. Unfortunately, the "one last spin" ends up being an all-night and all-day scramble to stay out of trouble, as they are confronted with situation after sometimes bizarre situation that prevents them from returning the "borrowed" Streetcar!');
INSERT INTO movies VALUES (43344, 'El', '1953-07-09', NULL, 92, 2, 'Francisco is rich, rather strict on principles, and still a bachelor. After meeting Gloria by accident, he is suddenly intent on her becoming his wife and courts her until she agrees to marry him. Francisco is a dedicated husband, but little by little his passion starts to exhibit disturbing traits. Nevertheless, Gloria meets with scepticism as she expresses her worries to their acquaintances.');
INSERT INTO movies VALUES (61070, 'Pekka ja Patka lumimiehen jaljilla', '1954-07-30', NULL, NULL, 55, 'nan');
INSERT INTO movies VALUES (64782, 'En lektion i karlek', '1954-10-04', NULL, 96, 25, 'After 15 years of marriage, David and Marianne have grown apart. David has had an affair with a patient of his and Marianne has got herself involved with her former lover Carl-Adam, who''s also David''s best friend. When she travels to Copenhagen to meet Carl-Adam, David takes the same train as she does, making it look coincidental. Spending time together remembering their past and talking about their future, they come to understand each other again, which leads to a reconciliation.');
INSERT INTO movies VALUES (69544, 'Kvinnors vantan', '1952-11-03', NULL, 107, 25, 'Rakel, Marta, Karin and Annette are married to four brothers. While waiting in a summer cottage for their husbands to come home, they tell each other stories about their marriages. Rakel tells about the time she had an affair and confronted her husband with it. Marta''s story is about how she at first refused to marry and had her child by herself. Karin tells about what happened when one time she and her husband got stuck in an elevator together. While the women tell their stories, Marta''s younger sister Maj is planning to elope.');
INSERT INTO movies VALUES (74718, 'O Costa d''Africa', '1954-09-19', NULL, 90, 0, 'Costa is travelling from Africa to London, and wishes very much to his nephew Amadeu, and see by himself how well he has been invested large sums of money he is been sending him. Amadeu ''borrows'' for 24 hours a wife, a villa, a car, and a servant - for he has been lies to his uncle all the time. All goes well. But, Costa decides to prolong his stay for two weeks...');
INSERT INTO movies VALUES (97211, 'Kvinnodrom', '1955-08-22', NULL, 87, 25, 'In Stockholm, the fashion photographer Susanne Frank misses her married lover Henrik Lobelius that lives in Gothenburg with his wife and children, and the naive twenty years old model Doris has a troubled relationship with her boy friend Palle Palt. Susanne schedules a session of photo shoots in Gothenburg with Doris, and once there, she calls Henrik for an encounter. Meanwhile, Doris meets an elegant middle age gentleman on the street, the Consul Otto Sönderby, who buys expensive gifts for her: a dress, a pair of Italian gloves and valuable pearl necklace. They spend the afternoon together in an amusement park and later they go to Otto''s mansion, where they are interrupted by his wicked daughter Marianne. Susanne has a love affair with Henrik in her room, but they are interrupted by his cynical wife. The incidents in these encounters affect their perspective of love.');
INSERT INTO movies VALUES (31936, '!Bienvenido, Mister Marshall!', '1953-04-04', NULL, 78, 2, 'After finding out that North American people are visiting the Spanish villages, the citizens of Villar del Río start preparing themselves to welcome them when they arrive.');
INSERT INTO movies VALUES (150838, 'Hotel des Invalides', '1952-12-31', NULL, 23, 0, 'A tour of the Hotel des Invalides, and more particularly of the Army Museum and the Saint Louis Chapel. From François I''s armor to Guynemer''s airplane, to Napoleon''s and Marshall Foch''s tombs. But this is no ordinary tour,it is rather a chilling visit guided by Georges Franju and narrated by Michel Simon emphasizing - at times through biting humor -not the glory but the nonsense of wars, but their tragic aftermath.');
INSERT INTO movies VALUES (219335, 'Noita palaa elamaan', '1952-12-05', NULL, 74, 0, 'An archaeological team unearths a body of a young woman, who was told to be a witch buried in the bog some 300 years ago. Soon a naked woman appears and drives the men of the village crazy...');
INSERT INTO movies VALUES (235932, 'Le grand Melies', '1952-11-12', NULL, 31, 0, 'A biography of the pioneer film director Georges Mélies, featuring his son André playing Georges, and with shots of his second wife, aged 90.');
INSERT INTO movies VALUES (312137, 'Le film est deja commence?', '1951-01-01', NULL, 62, 0, '“A pink moving screen will stand at the entrance to the theatre, in the night. One hour before the screening a projectionist will show Griffith’s Intolerance? on this screen. The start of the film will be announced at 8.30 but no one will enter before 9.30. During these 60 minutes of waiting, people on the first floor of the building will shake out very dusty carpets, and someone else will throw ice water on the heads of those spectators waiting for the screening. Some actors who have infiltrated the crowd will insult other actors on the first floor. At this moment only, and to stop the beginning of a scandal, the doors of the theatre will open…”');
